INSERT INTO `species` VALUES (1,'Cnaphalocrocis_medinalis','Rice leaf roller','C. medinalis','Rice leaf roller','insect_Cnaphalocrocis_medinalis','Trứng của sâu vẽ bùa gần hình elip, hình dẹt, dài khoảng 1 mm (5⁄128 in), lần đầu đẻ ra có màu trắng sữa, sau chuyển sang màu vàng nâu, trước khi nở sẽ có một đốm đen.\n\nNhìn chung, ấu trùng có 5 trường hợp, chiều dài cơ thể ấu trùng ở giai đoạn trưởng thành khoảng 15–18 mm (19⁄32–23⁄32 in). Ấu trùng có đầu màu nâu, ngực và bụng lúc đầu có màu xanh lục, sau đó chuyển sang màu xanh lục vàng, khi trưởng thành có màu nâu đỏ. Có hai đường màu đen hình xoắn ốc ở rìa sau của đỉnh của ngực trước và 8 vòng tròn nhỏ màu đen riêng biệt ở tận cùng của ngực giữa và sau, trong đó có sáu cạnh trước và hai cạnh sau. [1]\n\nNhộng, dài khoảng 9 milimét (23⁄64 in), đốt bụng thứ 5 đến đoạn thứ 7 ở gần mép đầu có 1 vạch mịn màu nâu sẫm, đầu đuôi, có 8 gai, nhộng dài với kén mỏng màu trắng.\n\nCon trưởng thành dài khoảng 7–9 milimét (9⁄32–23⁄64 in), sải cánh dài khoảng 13–18 milimét (1⁄2–23⁄32 in), hình lanh, proala có 3 đai ngang màu nâu, trong số một ngắn tương đối thô. Phần trung tâm của mép đầu của bọ cánh tơ đực có một hốc mắt sáng và lõm, trong khi đó, bọ cánh tơ cái không có hốc mắt.','Nó được tìm thấy ở Đông Nam Á, bao gồm Hồng Kông, Sri Lanka, Đài Loan, Thái Lan và hầu hết Australia.','Vòng đời của sâu đục thân bướm 2 chấm từ 35-45 ngày. Nhiệt độ từ 16-29oC và độ ẩm 70% có:\n+ Thời gian trứng: 5-10 ngày.\n+ Thời gian sâu non: 20-48 ngày.\n+ Thời gian nhộng: 7-15 ngày.\n+ Thời gian ngài vũ hóa đến đẻ trứng: 2-7 ngày.\nNgài cái của sâu đục thân 5 vạch đầu nâu có tính hướng quang mạnh, ngài cái vào đèn nhiều hơn ngài đực. Mỗi ngài cái đẻ từ 3-4 ổ trứng (có 40-82 quả trứng/ổ) và số trứng của một con có thể đẻ là 124-210 quả nhưng chúng không bao giờ đẻ hết số trứng, sau khi chết bao giờ cũng còn từ 10-100 quả trong bụng và nếu nhiệt độ thấp, mưa gió nhiều thì số trứng còn lại trong bụng nhiều. Ngài của loại sâu này thích đẻ trên lúa xanh hơn trên mạ. Một năm sâu đục thân 5 vạch đầu nâu phát sinh 6 lứa. Điều kiện nhiệt độ thích hợp cho loài sâu này phát triển trong tất cả các giai đoạn sinh trưởng là nhiệt độ thấp, chúng có thể phát triển bình thường trong môi trường lạnh.','Bướm đêm rất hiếu động, có màu vàng tươi hoặc màu vàng rơm với hai đường lượn sóng rõ rệt ở cánh trước và một đường gợn sóng riêng biệt ở cánh sau. Nó có sải cánh là 15 mm (19⁄32 in). Trứng được đẻ đơn lẻ hoặc thành từng nhóm, xếp thành hàng dọc ở mặt dưới của lá có màu trắng có vảy. Khả năng sinh sản khoảng 56 trứng. Thời gian ủ bệnh từ 4–8 ngày. Chúng tôi tìm thấy 5–6 cá thể ấu trùng, thời kỳ ấu trùng khoảng 22–23 ngày. Nó phát triển thành nhộng trong nếp lá bị nhiễm bệnh trong khoảng thời gian từ 6–7 ngày. Sâu bướm đã trưởng thành hoàn toàn có màu xanh lục và dài 16,5 mm (21⁄32 in). Tổng vòng đời hoàn thành trong khoảng 5 tuần.\n\nTất cả các giai đoạn của cây trồng đều bị sâu bệnh này tấn công. Khi nở sâu bướm mới nở cắt mép lá và gấp mép lá lại. Khi cây con bị tấn công, nó sẽ gấp 3–4 lá cây liền kề và cạo sạch chất xanh để những lá bị nhiễm bệnh có màu trắng. Một con sâu bướm làm hại một số lá. Các cây bị tấn công sẽ khô héo và nó làm giảm sức sống của cây. Cuối cùng thì năng suất bị giảm. Sự mất mát năng suất có thể thay đổi lên đến 10–50 phần trăm. Nó có nhiều vấn đề hơn ở giai đoạn khởi động lá.','Cải cách hệ thống làm đất, gieo trồng, bón phân hợp lý, tránh để lúa chín sớm, chín muộn. Ngoài ra, tác hại của sâu cuốn lá lúa có thể được giảm thiểu bằng cách tránh trồng hỗn hợp lúa sớm, giữa và muộn. Cũng có thể giảm thiệt hại của sâu bệnh thông qua bố trí giống, thiết lập bẫy và ruộng tiêu diệt và giảm diện tích bón. Cũng có thể thu hoạch lúa sớm theo tốc độ phát triển của sâu cuốn lá, sau đó diệt một số sâu non và nhộng ở vùng nước sâu, để giảm tỷ lệ đẻ lứa sau.','thumbnails/Rice_leaf_roller.jpg',1,0,'Sâu cuốn lá nhỏ'),(2,'Cnaphalocrocis_medinalis','Rice leaf caterpillar','C. medinalis','Rice leaf caterpillar','insect_Cnaphalocrocis_medinalis','Trứng: Màu trắng, hình tròn, đẻ đơn lẻ trên lá lúa.\n\nẤu trùng :\nMàu xanh lục với da nhám, dẹt ở mặt lưng và có đầu màu nâu sẫm với một cặp sừng đỏ như đã qua xử lý và hai quá trình màu vàng ở phần cuối hậu môn. Nó ăn lá.\n\nNhộng :\nNhộng màu xanh đậm treo trên lá và dính vào phiến lá bởi đầu mút hậu môn của nó.\n\nCon trưởng thành :\nBướm có màu nâu sẫm với đôi cánh lớn có một vài dấu màu đen và vàng giống như mắt trên mỗi cánh trước và sáu đốm tế bào trên cánh sau.','Yên Bái','Sâu róm xanh có 4 pha: Trưởng thành, trứng, sâu non và nhộng. Trưởng thành đực kích thước nhỏ hơn trưởng thành cái, toàn thân có màu nâu sẫm. Râu đầu hình lông chim và cánh trước có 2 mắt cánh màu đen, trưởng thành cái râu đầu hình sợi chỉ và cánh trước có 3 mắt cánh trong suốt. Trứng mới đẻ có màu trắng nhạt sau chuyển thành màu xám nhạt. Sâu non có 5 tuổi, có màu xanh lá mạ và đầu màu nâu sẫm. Nhộng nằm trong kén, lúc đầu có màu xanh sau chuyển màu cánh gián. Vòng đời của sâu róm xanh nuôi ở điều kiện nhiệt độ trung bình 260C, độ ẩm 80%, thời gian hoàn thành vòng đời trung bình là 69,6 ngày. Trưởng thành có tính xu quang thường bay vào đèn vào buổi tối.\nTrưởng thành sâu róm xanh một năm xuất hiện 4 lứa, lứa I  từ tháng 2 đến tháng 3, lứa II từ tháng 4 đến tháng 5, lứa III từ tháng 6 đến tháng 7, lứa IV từ tháng 9 đến tháng 10.\nThành phần loài thiên địch của sâu róm xanh ở rừng trồng Quế ở Yên Bái có 5 loài đó là: Nấm bạch cương và Ruồi ba vạch, Bọ ngựa, Bọ ngựa cánh xanh Trung bộ và Nhện linh miêu.','Trưởng thành sau khi vũ hóa di chuyển khá chậm chạp và thường đậu tại nơi gần nhộng nghỉ ngơi để cánh giang rộng ra, ban ngày nấp trên cành cây hoặc lá thông, cây bụi. Mùa sinh sản trưởng thành đực và cái thường ban ngày nằm im ở những nơi yên tĩnh, vào ban đêm ghép đôi rất nhanh giao phối xong con cái tìm nơi đẻ trứng. Ở những nơi có bóng đèn trưởng thành đực và cái thường bay tới ghép đôi, giao phối đẻ trứng. Trong 1 năm sâu trưởng thành xuất hiện 4 đợt như sau: Đợt 1 từ giữa tháng 3 đến đầu tháng 4. Đợt 2 từ cuối tháng 5 đến giữa tháng 6. Đợt 3 từ cuối tháng 7 đến giữa tháng 8. Đợt 4 từ cuối tháng 9 đến cuối tháng 10.Trứng thường được đẻ thành từng đám, vị trí đẻ trứng thường ở lá thông, ngoài ra (trưởng thành có tính xu quang và giao phối) có khi ở tường nhà, cột điện. Thời gian trứng xuất hiện trong năm có 4 đợt: Đợt 1 từ giữa tháng 3 đến giữa tháng 4. Đợt 2 từ cuối tháng 5 đến cuối tháng 6. Đợt 3 từ cuối tháng 7 đến cuối tháng 8. Đợt 4 từ cuối tháng 9 đến đầu tháng 11.\n\nSâu non là pha duy nhất duy trì dinh dưỡng, khi sâu mới nở sống thành đàn, gây hại mạnh ở trên cây. Sâu non thành thục làm kén hóa nhộng. Thời điểm sâu non xuất hiên trong năm có 4 đợt: Đợt 1 từ tháng 1 đến cuối tháng 3.Đợt 2 từ giữa tháng 3 đến cuối tháng 5.Đợt 3 từ cuối tháng 5 đến giữa tháng 8.Đợt 4 từ tháng 8 đến giữa tháng 10.\n\nVào nhộng trên tán cây, thân cây thông hoặc cây bụi ở dưới gốc thông. Khi có dịch sâu xuất hiện thì nhộng thường được làm thành từng đám ở trên cây hoặc cây bụi ở dưới gốc cây thông. Thời gian nhộng xuất hiện trong năm: Tháng 3; giữa tháng 5 đến đầu tháng 6; giữa tháng 7 đến giữa tháng 8; giữa tháng 9 đến đầu tháng 10.','* Biện pháp vật lý: Sử dụng bẫy đèn với ánh sáng màu tím để bẫy Sâu róm xanh ăn lá hại Quế ở pha trưởng thành cho kết quả rất khả quan. Trung bình 1 đêm bẫy đèn ánh sáng màu tím bẫy được trên 221,1 cá thể, còn bẫy đèn màu trắng và vàng bẫy được rất ít với số lượng là 24 và 25,5 cá thể.* Biện pháp lâm sinh: Thực hiện phát dọn thực bì thường xuyên, giữ lại những cây bụi có hoa để thu hút thiên địch, chặt tỉa những cây còi cọc, cây bị sâu hại nặng, tỉa cành tạo tán có thể giảm trên 10% số cây bị sâu hại.\n\n* Biện pháp sinh học: Sử dụng các chế phẩm sinh học Delfin 32WG (vi khuẩn Bacillus thuringiensis) và Bitadin WP (vi khuẩn Bacillus thurigiensis và Granulosis virut) để phòng trừ Sâu róm xanh ăn lá Quế cho hiệu quả rất tốt. Sau 7 ngày phun hiệu lực của thuốc đạt 79,0% và 78,5%.\n\n* Biện pháp hóa học: Khi có dịch sâu róm xanh có thể sử dụng một số loại thuốc trừ sâu hóa học như Sherpa 25EC, Trebon 10EC để phun dập dịch. Thuốc cho hiệu lực khá cao, đối với thuốc Sherpa 25EC sau 9 ngày là 84,6%, với thuốc Trebon 10EC sau 9 ngày là 89,2%','thumbnails/Rice_leaf_caterpillar.jpg',1,0,'Sâu cuốn lá nhỏ'),(3,'Chlorops oryzae','Paddy stem maggot','Chlorops oryzae','Paddy stem maggot','insect_Chlorops_oryzae','Trứng đẻ thành ổ hình bầu dục dài, trên mặt phủ một lớp lông màu vàng nhạt ở giữa hơi nhô lên. Mới đẻ trứng màu trắng sau chuyển màu ngà vàng sắp nở màu đen. Sâu non đẫy sức dài 21 - 25 mm màu trắng sữa, đầu màu nâu vàng.\n\nNgài đực có đầu ngực và cánh trước màu nâu nhạt, giữa cánh có một chấm đen. Ngài cái thân dài 10 - 13 mm, thân màu trắng vàng hoặc vàng nhạt, cuối bụng có chùm lông màu vàng nhạt, giữa cánh trước có một chấm đen.','China, Japan, North Korea, South Korea','Vòng đời:\n- Trứng: 2-4 ngày\n- Ấu trùng: 10 -13 ngày\n- Nhộng: 5-7 ngày\n- Trưởng thành: 1-3 ngày\nCon ruồi cái đẻ trứng trên mặt lá, một con cái có thể đẻ 250 trứng. Trứng nở sau khoảng 3 - 4 ngày tùy thuộc vào nhiệt độ.\nDòi đục lá đục ăn mô lá làm giảm diện tích quang hợp, do vậy chúng làm cây vàng, cằn cỗi, lá rụng sớm, chúng gây hại nặng giai đoạn cây con. Khi lá bị hại nặng, nhất là những lá gần quả mới hình thành có thể làm ảnh hưởng đến năng suất. Đối với một số cây rau ăn lá, vết đục của dòi đục lá làm giảm thương phẩm.\nNgoài ra, vết thương trên lá do dòi đục lá gây ra tạo điều kiện cho các vi sinh vật gây hại cây khác xâm nhập. Dòi đục lá có thể xuất hiện nhiều lứa gây hại trong năm nhưng thường gây hại nặng vào mùa nắng.','loài côn trùng này sinh ra 5 thế hệ trong một năm từ cuối tháng 4 đến đầu tháng 11. Nó có nhiều nhất ở thế hệ thứ ba và thứ tư, và những ruộng lúa được cấy từ cuối tháng Bảy đến đầu tháng Tám bị nhiễm bệnh nặng. Trong suốt mùa đông, côn trùng ngủ đông ở giai đoạn ấu trùng trên Leersia sayanuka và các loại cỏ dại đáng kể khác. Những con trưởng thành khá chịu được sự thay đổi nhiệt độ rộng và thể hiện hoạt động bình thường ở 18-39 ° C','Vì con trưởng thành bị thu hút bởi nước đọng, biện pháp kiểm soát nuôi được khuyến nghị là tháo nước ruộng lúa với tần suất 3-4 ngày trong 30 DT đầu tiên để giảm sự đẻ trứng. Tuy nhiên, các cánh đồng thoát nước cho phép nhiều cỏ dại mọc hơn. Các phương pháp trồng trọt cho phép cây phủ kín mặt nước nhanh nhất dẫn đến thiệt hại không đáng kể do giòi bọ. Che phủ bề mặt nước bằng azolla giúp ngăn ngừa sự xâm nhập của cây. Nên gieo hạt trực tiếp vì ruộng hoặc luống gieo hạt trực tiếp không hấp dẫn đối với con trưởng thành. Khi cấy, nên sử dụng cây con già hơn để rút ngắn giai đoạn sinh dưỡng của cây trồng.','thumbnails/Paddy_stem_maggot.jpg',2,0,'Ruồi vàng hại lúa'),(4,'Chilo_suppressalis','Asiatic rice borer','C. suppressalis','Asiatic rice borer','insect_Chilo_suppressalis','Sải cánh dài 18 mm ở con đực và 18–20 mm ở con cái. Ở con đực, đầu và ngực có màu nâu và trắng. Bụng tái nhợt. Cánh chim có đỉnh hơi cấp tính, có chất nhờn, toàn bộ chỉ có màu nâu, ngoại trừ một mảng trong tế bào và một vệt bên dưới dây thần kinh trung gian. Lề bên trong màu trắng. Một đường trung gian gồ ghề hình sin chạy với các đốm bạc ở mặt trong của nó, cũng trên đĩa đệm và bên dưới tĩnh mạch 2. Một đường ranh giới dưới gồ ghề, có góc cao ở vân 6 và với đường màu bạc ở rìa ngoài của nó. Một loạt các đốm đen được tìm thấy. Lông mao to. Bọ cánh cứng màu trắng. [3]\n\nỞ con cái, nó có màu cam đậm hơn nhiều. Cánh chim đã được khử trùng (rắc) với màu nâu. Đường trung tuyến và đường cận biên hầu như đã lỗi thời. Các đốm màu bạc bên dưới tế bào nổi rõ và đôi khi gấp đôi. Khu vực sau chăm sóc sức khỏe có vảy bạc.','Nó là một loài phổ biến, được biết đến từ Ấn Độ, Sri Lanka, Trung Quốc, Đông Á, Nhật Bản, Đài Loan, Malaysia đến Thái Bình Dương.','Vòng đời của sâu đục thân bướm 2 chấm từ 35-45 ngày. Nhiệt độ từ 16-29oC và độ ẩm 70% có:\n+ Thời gian trứng: 5-10 ngày.\n+ Thời gian sâu non: 20-48 ngày.\n+ Thời gian nhộng: 7-15 ngày.\n+ Thời gian ngài vũ hóa đến đẻ trứng: 2-7 ngày.\nNgài cái của sâu đục thân 5 vạch đầu nâu có tính hướng quang mạnh, ngài cái vào đèn nhiều hơn ngài đực. Mỗi ngài cái đẻ từ 3-4 ổ trứng (có 40-82 quả trứng/ổ) và số trứng của một con có thể đẻ là 124-210 quả nhưng chúng không bao giờ đẻ hết số trứng, sau khi chết bao giờ cũng còn từ 10-100 quả trong bụng và nếu nhiệt độ thấp, mưa gió nhiều thì số trứng còn lại trong bụng nhiều. Ngài của loại sâu này thích đẻ trên lúa xanh hơn trên mạ. Một năm sâu đục thân 5 vạch đầu nâu phát sinh 6 lứa. Điều kiện nhiệt độ thích hợp cho loài sâu này phát triển trong tất cả các giai đoạn sinh trưởng là nhiệt độ thấp, chúng có thể phát triển bình thường trong môi trường lạnh.','.Chúng đục khoét thân cây chủ nên được xếp vào loại sâu đục thân lúa. [6]\n\nHầu như tất cả các bộ phận của cây, từ cành, lá, thân đều bị tấn công. Sâu bướm có thể là loài ăn chủ yếu bên trong, trong khi con trưởng thành là loài ăn nhựa cây bên ngoài. Các cây bị tấn công nặng có thể biểu hiện các triệu chứng khác nhau từ chết héo, đầu trắng, lùn, còi cọc, thối rữa, dạng bất thường và ra hoa. Cuối cùng toàn bộ cây sẽ chết. Trái tim chết là triệu chứng hiện trường rõ ràng nhất.','Dịch hại nên được chẩn đoán sớm khi có triệu chứng, trừ khi nó không đáng để bảo vệ trồng trọt. Nhiều tập quán nông nghiệp và truyền thống như làm ngập nước và bừa hoặc cày xới gốc rạ để phòng trừ sâu bệnh trong vụ mùa tiếp theo. Việc sử dụng các giống chín sớm và khi thu hoạch, trồng đồng bộ và cắt bỏ thân sát mặt đất được quản lý. [7]\nVề mặt sinh học, chúng có thể dễ dàng loại bỏ bằng cách sử dụng tachinid Paratheresia claripalpis, được thực hành rộng rãi ở Malaysia. Ichneumonid Eriborus sinicus cũng được sử dụng ở Châu Á và Hawaii. [7]\n\nTrồng các giống lúa có sức đề kháng cao và cây chuyển gen cũng được biết là làm giảm sự tấn công của những loài gây hại này. [7]','thumbnails/Asiatic_rice_borer.jpg',3,0,'Sâu đục thân 5 vạch đầu nâu'),(5,'Scirpophaga_incertulas','Yellow rice borer','S. incertulas','Yellow rice borer','insect_Scirpophaga_incertulas','Sải cánh của con đực là 18–22 mm và con cái là 34 mm. [2] Con đực trưởng thành nhỏ hơn con cái. Con đực có màu nâu nâu. Cánh chim có vảy đen và có các đường gân hơi loang lổ. Một điểm đen được tìm thấy ở góc thấp hơn của ô. Có một đường xiên chạy từ đỉnh đến vân 2. Có thể nhìn thấy một loạt đốm đen ở rìa. Màu trắng đục như bọt biển. Con cái có lông màu nâu với những chiếc lông sau màu nâu nhạt. [3]','Nó được mô tả bởi Francis Walker vào năm 1863. Nó được tìm thấy ở Afghanistan, Nepal, đông bắc Ấn Độ, Sri Lanka, Bangladesh, Myanmar, Việt Nam, Thái Lan, Malaysia, Singapore, Sumatra, Java, Borneo, Sumba, Sulawesi, Philippines, Đài Loan, Trung Quốc và Nhật Bản. [1]','Sâu non qua đông tới mùa xuân hóa nhộng.\n- Nhộng hóa trong gốc thân lúa ở dưới mặt đất 1 - 2 cm. Trước khi hóa nhộng sâu đục sẵn một lỗ ở thân lúa, chừa lại một lớp biểu bì mỏng để khi vũ hóa đục chui ra.\n- Sâu đục thân phát triển thuận lợi trong điều kiện nhiệt độ từ 23 -30oC, độ ẩm trên 90%.\n- Khả năng gây dảnh héo và bông bạc của sâu non từ một ổ trứng là 12 dảnh khi lúa đẻ nhánh và 9,2 bông bạc khi lúa trỗ (khi mật độ ổ trứng thấp hơn 5 ổ/ m2).','Sau khi nở, sâu non đục vào bẹ lá và gây ra các mảng màu trắng vàng theo chiều dọc do bị ăn. Sau đó, nó xâm nhập vào thân cây lúa và ở trong mấu để ăn bề mặt bên trong của thành thân. Đây không phải là biểu hiện bên ngoài như các triệu chứng. Ăn nhiều gây ra một vết cắt hình tròn sâu xuyên qua mô nhu mô cho thấy những vết chết ở giai đoạn sinh dưỡng và mụn đầu trắng ở giai đoạn sinh sản.','Do lúa trên toàn thế giới bị thiệt hại nặng, nhiều biện pháp kiểm soát đang được tiến hành. Các biện pháp kiểm soát hóa học, vật lý và sinh học và nhiều phương pháp truyền thống được sử dụng để kiểm soát dịch hại ở bất kỳ giai đoạn nào trong vòng đời của nó. Nhiều giống lúa kháng sâu bệnh đã được chính quyền địa phương biến đổi gen và đưa vào đồng ruộng. Trong kiểm soát sinh học, khả năng ký sinh ở trứng cao và phổ biến. Các loài của ba chi Telenomus, Tetrastichus và Trichogramma có hiệu quả rất tốt đối với trứng, ấu trùng và sâu non trưởng thành.','thumbnails/Yellow_rice_borer.jpg',4,0,'Sâu Đục thân (bướm) 2 chấm'),(6,'Orseolia_oryzae','Rice gall midge','O. oryzae','Rice gall midge','insect_Orseolia_oryzae','Trưởng thành là loài muỗi nhỏ, dài khoảng 3-5mm, bụng màu hồng nhạt, chúng đẻ trứng rãi rác từng quả, rất nhỏ, màu trắng, trước khi nở có màu vàng. Ấu trùng giống như con dòi, mình dẹt, màu trắng sữa, dài 4-5mm. Nhộng màu hồng, dài 4-5mm, nằm trong ống hành. Vòng đời từ 25-30 ngày. Muỗi hoạt động về đêm, có xu tính rất mạnh với ánh sáng. Sức bay yếu nên sự phân bố thường có tính khu vực. Trứng đẻ riêng lẻ hoặc từng nhóm 3-4 cái ở phía dưới mặt lá gần gốc lúa. Mỗi con cái đẻ hàng trăm trừng. Trứng cần có ẩm độ cao (trên 80%) để phát triển và nở. Sâu năn phát triển thích hợp trong điều kiện thời tiết tương đối ẩm, có mưa và trời ít nắng. Thường phát sinh cục bộ trên một cánh đồng hoặc một vùng hẹp do khả năng di chuyển yếu của muỗi.','Cambodia, China, India,Laos, Malaysia, Myanmar, Vietnam, Thailand …','Con trưởng thành chủ yếu sống về đêm và ẩn náu vào ban ngày. Con cái đẻ nhiều lứa trứng nhỏ (lên đến sáu quả) ở mặt dưới của lá lúa. Những quả trứng lúc đầu có màu đỏ, nhưng đến khi nở, hai đến bốn ngày sau, chúng có màu nâu sô cô la. Những ấu trùng nhỏ bé chui xuống bẹ lá cho đến khi chúng chạm tới nách lá, nơi chúng chui vào thân. Sau khi kiếm ăn khoảng mười ngày và hình thành một túi mật , chúng sẽ hóa nhộng bên trong. Bốn đến bảy ngày sau, chúng sử dụng gai ở đầu bụng để tạo một lỗ trên túi mật gần đầu của nó. Ở đây các côn trùng trưởng thành xuất hiện. Chúng sống trong ba hoặc bốn ngày, và có thể có tới tám thế hệ muỗi vằn trong năm.','Muỗi hành phá hại lúa từ giai đoạn mạ đến giai đoạn cuối đẻ nhánh, khi bị tấn công đỉnh sinh trưởng biến dạng thành \"cọng hành\" (hay còn gọi ống hành). Khi ống hành đã vươn ra ngoài cũng là lúc sâu non đã hoá nhộng. Cần phân biệt triệu chứng thiệt hại do sâu đục thân và muỗi hành. Với sâu đục thân đọt lúa cuốn tròn có màu xanh lúc đầu, sau đó những đọt này héo khô, nắm kéo lên thì đứt ra ngay, đó là do sâu ăn phá đọt non làm dưỡng chất và nước không di chuyển lên nuôi đọt được.\n\nVới muỗi hành là những ống tròn màu xanh lá cây nhạt, đó là bẹ lá bị biến dạng, phiến lá chỉ là một mảnh nhỏ ở đầu ống, nắm kéo lên không đứt, những ống này không chết đi nhưng làm chồi bị nhiễm không trổ bông được, những bụi lúa bị nhiễm lùn, đâm nhiều chồi, lá xanh thẫm, ngắn, dựng đứng, có nhiều cọng lúa giống như cọng hành lẫn trong bụi lúa.','Sử dụng giống kháng. Liên hệ với văn phòng nông nghiệp địa phương của bạn để biết danh sách cập nhật các giống có sẵn.\n\nCày ratoon của vụ trước và loại bỏ tất cả các ký chủ thực vật trái vụ.\n\nKhuyến khích sử dụng các tác nhân phòng trừ sinh học: platygasterid, eupelmid, và pteromalid ong bắp cày (ký sinh ở ấu trùng), ve phytoseiid (ăn trứng), nhện (ăn con trưởng thành).','thumbnails/Rice_gall_midge.jpg',5,0,'Sâu năn muỗi hành'),(7,'Pachydiplosis oryzae','Rice Stemfly','oryzae','Rice Stemfly','insect_Pachydiplosis_oryzae','Con trưởng thành là một con muỗi mỏng manh như ruồi, dài 1/4 inch và có thân hình mảnh mai với đôi chân dài. Giòi có màu hơi hồng.','Nó là loài gây hại chính trên lúa ở nhiều vùng khác nhau của Ấn Độ và thường được gọi là “Kharika hoặc Kane”.','Trứng dài màu hồng nhạt được đẻ ở gốc lá lúa, đơn lẻ hoặc thành từng chùm. Số lượng trứng tối đa của một con cái là 200. Ấu trùng nở trong khoảng 4-5 ngày. Nó chui vào giữa các bẹ lá và cố gắng đạt đến điểm ngọn hoặc điểm đang phát triển. Sau đó nó bắt đầu cho ăn. Do bị cho ăn và bị kích thích liên tục, một khoang hình bầu dục được hình thành xung quanh giòi. Những khoang này phát triển thành hình trụ, dài, được gọi là \"Chồi bạc\". Thời kỳ ấu trùng kéo dài 5-15 ngày, tùy thuộc vào điều kiện khí hậu. Ấu trùng trưởng thành có chiều dài khoảng 3 mm và có màu đỏ nhạt. Sau khi hình thành mật, ấu trùng sẽ hóa nhộng bên trong nó. Sau 5-8 ngày hóa nhộng, ruồi trưởng thành chui ra khỏi túi mật. Toàn bộ vòng đời được hoàn thành trong khoảng 2-3 tuần. Giai đoạn lúa đẻ nhánh dễ bị sâu bệnh này tấn công nhất.','Giòi xâm nhập vào các mô thực vật và kích thích sự hình thành sự phát triển hình ống rỗng được gọi là \"Chồi bạc\". Những máy xới đất như vậy không tạo ra hạt và cuối cùng cây bị ảnh hưởng sẽ chết. Đôi khi người ta quan sát thấy sự phát triển bất thường của cây bị nhiễm bệnh có thể là do sự kích ứng của giòi phát triển bên trong thân cây. Thiệt hại đối với cây trồng do dịch hại này dao động trong khoảng 10-15%.','Nên sử dụng các giống lúa kháng bệnh để bảo vệ cây trồng khỏi loại dịch hại này. Ở những khu vực lưu hành, việc sử dụng hạt Phorate trong vườn ươm rất hữu ích trong việc giảm sự lây nhiễm trên đồng ruộng.Carbaryl Quinalphos, Phosphamidon và các hạt của Quinalphos nên được phun trong vườn ươm hoặc trên đồng ruộng nếu sự nhiễm bệnh có tính chất nghiêm trọng (Ghosh và cộng sự, 1960; Aggar, 1963).Sử dụng bẫy đèn khá hiệu quả.','thumbnails/Rice_Stemfly.jpg',6,0,'Ruồi lúa'),(8,'Nilaparvata lugens','Brown plant hopper','N. lugens','Brown plant hopper','insect_Nilaparvata_lugens','Rầy nâu là loài lưỡng hình, với các dạng \'đại thực bào\' có cánh hoàn toàn và cánh cụt. Các dạng đại thực bào có khả năng là những người di cư và chịu trách nhiệm định cư các cánh đồng mới. Sau khi định cư trên cây lúa, chúng tạo ra thế hệ tiếp theo, nơi hầu hết các côn trùng cái phát triển thành các chương và con đực là các chương lớn. Con trưởng thành thường giao phối vào ngày xuất hiện, và con cái bắt đầu đẻ trứng từ ngày sau khi giao phối. Những con cái thuộc bộ lông to đẻ từ 300 đến 350 trứng, trong khi những con cái thuộc bộ lông to đẻ ít trứng hơn. Trứng đâm theo đường thẳng nói chung dọc theo vùng giữa của bẹ lá. Trứng nở trong khoảng sáu đến chín ngày. Nhộng non mới nở có màu trắng bông, và chuyển sang màu nâu tím trong vòng một giờ.','Rầy nâu phân bố khắp Australia, Bangladesh, Bhutan, Miến Điện (Myanmar), Campuchia, Trung Quốc, Fiji, Ấn Độ, [2] Indonesia, Nhật Bản, Bắc và Hàn Quốc, Lào, Malaysia, Ấn Độ, Nepal, Pakistan, Papua New Guinea, Philippines, Sri Lanka, Đài Loan, Thái Lan và Việt Nam','Con cái di cư vào ruộng lúa ngay sau khi cấy, đẻ các nhóm từ 5-15 trứng vào các bẹ hoặc gân giữa của lá. Nhộng non đầu tiên nở sau 5-9 ngày; chúng lột xác năm lần trong khoảng thời gian 2-3 tuần. Ban đầu, hầu hết chúng phát triển thành những con trưởng thành thiếu máu não: nhưng khi mật độ dân số tăng lên, hoặc nếu thức ăn trở nên khan hiếm, thì tỷ lệ phát triển thành dạng đại thực bào sẽ tăng lên. Trong thời gian trưởng thành của chúng từ 10-30 ngày, mỗi con cái thuộc họ đại thực bào đẻ khoảng 100 trứng, con cái thuộc họ lông đen từ 300 đến hơn 700. Ở vùng nhiệt đới, N. lugens hoạt động quanh năm, và sinh sản 3-6 thế hệ mỗi vụ. Nó không có khả năng đông lạnh quá ở các vùng ôn đới, vì vậy nó di cư vào các vùng này vào mùa xuân, thường là sau khi đi một quãng đường dài.','Rầy nâu xâm nhập vào cây lúa ở tất cả các giai đoạn phát triển của cây. Do cả nhộng và nhộng trưởng thành ăn ở gốc của đẻ nhánh, cây chuyển sang màu vàng và khô héo nhanh chóng. Trong giai đoạn nhiễm bệnh ban đầu, các mảng màu vàng tròn xuất hiện, sau đó sẽ sớm chuyển sang màu nâu do cây bị khô héo. Tình trạng này được gọi là \'cháy phễu\'. Nhiệt độ là một yếu tố quan trọng ảnh hưởng đến hoạt động sống của loài côn trùng này. Khả năng nở và tỷ lệ sống sót cao nhất vào khoảng 25 ° C. Trứng rất nhạy cảm với sự hút ẩm và sớm teo đi khi cây chủ bắt đầu héo. Tăng trưởng quần thể rầy nâu là tối đa trong phạm vi nhiệt độ từ 28 đến 30 ° C [cần dẫn nguồn].','Việc sử dụng quá nhiều urê làm phân đạm và thuốc trừ sâu có thể dẫn đến bùng phát dịch bệnh do làm tăng khả năng sinh sản của rầy nâu và làm giảm quần thể thiên địch. [10] [11] [12] Theo đó, phương pháp tiếp cận quản lý dịch hại tổng hợp (IPM) chính bao gồm hạn chế việc sử dụng không thích hợp và quá mức các đầu vào này. Ví dụ vào năm 2011, chính phủ Thái Lan đã công bố sáng kiến ​​ứng phó với đợt bùng phát rầy nâu lớn bằng cách hạn chế các loại thuốc trừ sâu gây bùng phát dịch bao gồm abamectin và cypermethrin; quyết định được hỗ trợ bởi Viện Nghiên cứu Lúa gạo Quốc tế (IRRI). [13] IRRI cũng đưa ra các khuyến nghị trong một kế hoạch hành động để giúp quản lý thông minh sự bùng phát của rầy. [14] Vào tháng 12 năm 2011, IRRI đã tổ chức một hội nghị tại Việt Nam để giải quyết các mối đe dọa của việc lạm dụng thuốc trừ sâu và tìm ra các giải pháp để giảm thiểu. [15]\n\nCác giống lúa kháng rầy nâu, ví dụ: IR64, rất quan trọng để ngăn ngừa bùng phát. [16] [17] [18] Tuy nhiên, ở những khu vực ít sử dụng thuốc trừ sâu, mức độ kháng rầy nâu cao thường không cần thiết. [19] Sự đột biến hóa học có thể làm tăng hoặc giảm đáng kể mức độ kháng rầy nâu của cây lúa. [20] Một số hóa chất diệt côn trùng, ví dụ: imidacloprid, có thể ảnh hưởng đến sự biểu hiện gen của lúa và do đó làm tăng tính nhạy cảm với rầy nâu. [21]\n\nTrong một nỗ lực để làm cho việc kiểm soát rầy nâu cụ thể hơn cho từng loài, các nhà nghiên cứu đang cố gắng phát triển các phương pháp tắt các gen BPH cụ thể để tiêu hóa, phòng thủ- và chuyển hóa xenobiotic. Nhiều gen mới cho các chức năng này đã được phát hiện trong mô từ ruột của rầy nâu. [22]\n\nMột số lectin thực vật là chất kháng rầy nâu và nếu được pha chế đúng cách có thể có khả năng bảo vệ lúa khỏi rầy nâu. [23] [24] [25] [26] sử dụng laal đa dạng kháng','thumbnails/Brown_plant_hopper.jpg',7,0,'Rầy nâu'),(9,'Sogata_furcifera','White backed plant hopper','Sogatella furcifera','White backed plant hopper','insect_Sogata_furcifera','Trứng rầy lưng trắng có dạng quả chuối tiêu như trứng rầy nâu nhưng nhỏ, dài và nhọn hơn. Rầy đẻ trứng thành từng ổ theo chiều dọc, chìm trong bẹ hoặc gân chính của lá, mỗi ổ 2-7 quả. Rầy non mới nở có màu trắng đục, đến tuổi 3 xuất hiện các vệt vằn trên lưng[1]. Rầy trưởng thành có màu đen nâu với một dải trắng trên mảnh lưng giữa. Cơ thể màu trắng kem, bụng màu đen. Con cái có hai dạng: cánh dài và cánh ngắn; con đực chỉ có một dạng hình cánh dài. Thời gian từ khi vũ hoá đến đẻ trứng 3-5 ngày, có thể sống 20 - 30 ngày[2].','Australia, Russia, Vietnam, Thailand, Taiwan, South Korea, …','Trưởng thành được 4 - 5 ngày thì bắt đầu đẻ trứng, một trưởng thành đẻ được 400-600 trứng. Có xu tính nhẹ với ánh sáng.\n\n- Rầy non thường tập trung ở gốc sát mặt nước, ít di chuyển. Khi bị động có thể nhảy lên các bộ phận khác của cây hoặc rơi xuống nước. Nhiệt độ thích hợp cho rầy phát triển là 25-30oC, ẩm độ 80-85%.\n\n- Điều kiện môi trường thuận lợi, thức ăn phong phú thì rầy cánh ngắn xuất hiện nhiều; trong điều kiện không thuận lợi (cuối vụ-rầy hết thức ăn) thì rầy cánh dài là chủ yếu.\n\nKhi trưởng thành cánh ngắn xuất hiện nhiều (0,5 - 2 con/khóm) báo hiệu rầy lứa mới sẽ phát sinh thành dịch.','Gây hại cùng với rầy nâu nhưng trong cùng lứa thì rầy lưng trắng phát sinh rộ sớm hơn. Rầy non có màu trắng hoặc nền trắng cùng các vết xám đậm. Thường hại nặng trên các giống lúa nhiễm rầy, lúa lai, thâm canh cao, bón nhiều đạm, ruộng lúa cấy dày, rậm rạp. Rầy lưng trắng thường có mật độ cao, gây hại nặng vào giai đoạn giai đoạn lúa làm đòng. ở vùng lúa đồng bằng sông Hồng một năm có 6-7 lứa. Quan trọng là lứa tháng 4 và cuối tháng 8 đầu tháng 9 trùng với các giai đoạn trên. Rầy lưng trắng đặc biệt nguy hiểm vì là môi giới truyền bệnh virus lùn sọc đen.','Tránh sử dụng quá nhiều phân đạm\n\nKiểm soát việc tưới tiêu bằng cách tháo nước gián đoạn\n\nViệc gieo cấy đồng bộ trong vòng 3 tuần kể từ khi gieo sạ và duy trì thời kỳ lúa trỗ cũng có thể làm giảm sự hình thành của rầy nâu.\n\nCó những giống do IRRI phát hành, có chứa các gen kháng rầy lưng trắng, như IR26, IR64, IR36, IR56 và IR72.\n\nTránh trồng gần và tạo khoảng cách cách nhau 30 cm, cứ 2,5 đến 3,0 m để giảm tỷ lệ sâu bệnh.','thumbnails/White_backed_plant_hopper.jpg',8,0,'Rầy lưng trắng'),(10,'Laodelphax striatellus','Small brown plant hopper','L.striatellus','Small brown plant hopper','insect_Laodelphax_striatellus','Rầy trưởng thành màu nâu và có 2 dạng cánh: cánh dài phủ kín thân, cánh ngắn phủ 2/3 thân.Trứng hình quả chuối, một đầu to, một đầu nhỏ màu trong suốt.Rầy non lúc nhỏ có màu đen xám, sau thành màu nâu vàng, thân hình tròn trĩnh. Rầy non có 5 tuổi, dài 1- 3mm.','Algeria, Morocco, Tunisia,Armenia, China, Iran, Israel, Japan, North Korea, Philippines, South Korea, Thailand','Rầy thành trưởng thành được 4- 5 ngày thì đẻ trứng. Trứng đẻ ở mô tế bào bẹ lá và có thể gân chính của lá. Mỗi con có thể đẻ 400- 600 trứng, trứng được xếp thành từng hàng như nải chuối.','Đầu tiên, rầy xuất hiện thành từng đám/vạt giữa ruộng, sau đó lan dần ra quanh ruộng.Rầy nâu tập trung ở gốc lúa, chích hút nhựa cây, làm lúa chậm phát triển. Khi mật độ rầy cao gây hiện tượng “cháy rầy”. Rầy trưởng thành thường tập trung thành đám ở trên thân cây lúa, phía dưới khóm để hút nhựa. Khi bị khua động thì lẩn trốn bằng cách bò ngang hoặc nhảy sang cây khác, hoặc xuống nước hoặc bay xa đến chỗ khác.Mưa nắng xen kẻ là điều kiện thuận lợi để rầy phát sinh mạnh. Trường hợp thiếu thức ăn do lúa bị “cháy” hoặc khô già thì xuất hiện rầy cánh dài để di chuyển sang ruộng khác.','Hiện nay, lúa đang giai đoạn trổ bông, mật độ rầy còn thấp nhưng không được chủ quan, cần thường xuyên thăm đồng, đặc biệt chú ý tới những điểm, những vùng thường có các ổ rầy đã gây hại ở  những vụ trước. Khi phát hiện trong ruộng có rầy với mật độ cao trên 1.500con/m2 (2- 3 con/dãnh lúa) thì phun trừ bằng các loại thuốc như Chess 50WG, Cheestar 50WG, Sagometro 50WG, Oscare 50WG, Startcheck 755WP,… Sau phun 3- 5 ngày kiểm tra lại, nếu rầy tiếp tục nở, mật độ còn cao cần phun lại lần 2.Trường hợp mật độ rầy quá cao, đen gốc (trên 10.000 con/m2), có nhiều pha phát dục, có khả năng gây “cháy rầy”, thì sử dụng các loại thuốc tiếp xúc, xông hơi như Bassa 50EC, Vibasa 50EC trộn với cát, dầu diezel để vãi ở gốc lúa, phía trên phun bằng các loại thuốc như Chess 50WG, Cheestar 50WG, Sagometro 50WG, Oscare 50WG,... Trường hợp rầy gây hại mạnh, lúa đã chín gần thu hoạch nên thu hoạch sớm 5-7 ngày để hạn chế thiệt hại do rầy gây ra.Khi sử dụng thuốc ruộng phải có nước hiệu quả trừ rầy mới cao. Nên giữ nước trong ruộng lúa đến khi mật độ rầy giảm không có khả năng gây hại mới rút nước để chuẩn bị thu hoạch.','thumbnails/Small_brown_plant_hopper.jpg',9,0,'Rầy xám'),(11,'Lissorhoptrus oryzophilus Kuschel','rice water weevil','L. oryzophilus','rice water weevil','insect_Lissorhoptrus_oryzophilus Kuschel','Con trưởng thành là những con mọt màu nâu xám (dài 1/8 inch) với một vết hình chữ V màu nâu sẫm trên lưng. Con trưởng thành bay vào ruộng lúa và bắt đầu ăn lá của cây lúa. Con đực và con cái trưởng thành RWW giao phối, sau đó con cái ký sinh trứng trong bẹ lá ở hoặc dưới mực nước. Ấu trùng trắng xuất hiện từ trứng trong khoảng một tuần và phát triển qua bốn giai đoạn khi ăn rễ cây lúa. Ấu trùng nhộng te trong kén được che phủ bằng một lớp nhỏ gọn của bùn và được gắn vào rễ lúa. Vòng đời từ trứng đến con trưởng thành mất khoảng một tháng.','Trung Quốc, Ấn Độ, Nhật Bản, Hàn Quốc và Đài Loan','Trứng trắng có hình trụ (dài 0,8 mm và dài 0,14 mm) bằng quả lê với một lớp đệm rất mỏng. Trứng được đẻ trong bẹ lá và đôi khi ở rễ. Ấu trùng nở từ trứng sau 4-9 ngày.Các ấu trùng là thủy sản và sống trọn vẹn cuộc sống của họ trong vùng rễ. Chúng có màu trắng và dài tới 1 cm ở giai đoạn thứ 4. Ấu trùng sống sót trong vùng thiếu khí bằng cách sử dụng các xoắn khuẩn biến đổi có hình dạng như móc lưng nối với hệ thống khí quản. Các móc này xâm nhập vào tế bào nhu mô của cây lúa và các loại cỏ đất ngập nước khác để hô hấp. [2] Ấu trùng trải qua 4 giai đoạn (hoặc giai đoạn) và phát triển hoàn thiện trong khoảng 28–35 ngày. Nhộng là một kén tơ nhỏ bọc trong bùn (dài 0,5-0,9 cm) và bám vào rễ . Giai đoạn nhộng mất khoảng 7 ngày để hoàn thành.\n\nNhững người lớn dài 3,3-3,7 mm, trong đó có mỏ chim . Bộ xương ngoài có màu từ be sẫm, nâu hoặc nâu sẫm. Dọc theo tâm elytra, một số con mọt nước gạo có một vết dài màu nâu đen đến nâu đen. Các cặp chân ở giữa có lông kỵ nước cho phép nó bơi (Hix et al. 2000).','mọt nước có thể bơi trong nước, con trưởng thành chủ yếu ăn mô lá. Kích thước trưởng thành của mọt nước hại lúa chỉ 3 - 4 mm màu nâu nhạt. Chúng thích nghi với đời sống thủy sinh, nhờ có các sợi lông kỵ nước trên chân, cho phép chúng có thể bơi như một số loài thuộc bộ cánh cứng và bộ cánh nửa sống thủy sinh khác.','Dọn cỏ sạch bờ ruộng, bờ đê vì đây là nơi duy trì tích lũy nguồn mọt nước. Tháo nước khô ruộng trước khi vào vụ mới, hoặc khi xuất hiện mọt gây hại. Ruộng khô có thể gây chết và ngăn chặn tốc độ gây hại của trưởng thành, vì trưởng thành di chuyển trong nước tốt hơn. Tuy nhiên biện pháp này không kiểm soát được trứng và ấu trùng.\n\n- Sau mỗi vụ thu hoạch, cho nước ngập chìm gốc rạ (nếu điều kiện thủy lợi cho phép) đến khi rơm rạ bị phân hủy. Cắt nguồn thức ăn của mọi nước.\n\n- Nên xử lý hạt giống trước khi gieo bằng các thuốc có chứa thiamethoxam như Actara 25WG, Cruiser plus 312.5FS.\n\n- Nếu mật độ vượt ngưỡng gây hại kinh tế, phòng trừ bằng các thuốc hóa học thuộc nhóm diamide (Chloratrniliprole) và neonicotinoids (Thiamethoxam) với các thuốc như Actara 25WG, Virtako 40WG.\n\n- Ngoài ra có thể sử dụng các thuốc có chứa lambda-cyhalothrin (Karate 2.5EC), fipronil (Regent 800WP), diflubenzuron… Trong biện pháp sinh học sử dụng chế phẩm vi khuẩn Bacillus thuringiensis.','thumbnails/rice_water_weevil.jpg',10,0,'Mọt gạo'),(12,'Nilaparvata lugens','rice leafhopper','N. lugens','rice leafhopper','insect_Nilaparvata_lugens','Con trưởng thành có màu nâu tối có loại cánh dài và cánh ngắn, con đực nhỏ hơn con cái','Đông Nam Á','Vòng đời của rầy nâu từ 25-30 ngày và thay đổi theo mùa, thời gian trứng 5-14 ngày, rầy non: 12-32 ngày; rầy trưởng thành: 3-20 ngày','Rầy trưởng thành màu nâu và có 2 dạng cánh: cánh dài phủ kín thân, cánh ngắn phủ 2/3 thân.Trứng hình quả chuối, một đầu to, một đầu nhỏ màu trong suốt.Rầy non lúc nhỏ có màu đen xám, sau thành màu nâu vàng, thân hình tròn trĩnh. Rầy non có 5 tuổi, dài 1- 3mm.','Có bằng chứng cho thấy một vài loại thuốc trừ sâu làm tăng lượng protein của accessory glands con cái rầy nâu, và do đó làm tăng khả năng sinh sản của rầy nâu.[18] Vài loại thuốc trừ sâu làm tăng số lượng axit amino và sucrose có trong phloem của cây lúa, và do đó làm tăng độ sống sót của rầy nâu.Sự phong phú giống lúa với khả năng kháng rầy nâu là quan trọng trong việc ngăn chặn bùng phát rầy nâu. Tuy nhiên, trong các khu vực ít sử dụng thuốc trừ sau, mức kháng rầy nâu cao không nhất thiết.Một số lectin thực vật có khả năng kháng BPH','thumbnails/rice_leafhopper.jpg',7,0,'Rầy nâu'),(13,'Stenchaetothrips biformis (Bagnall)','grain spreader thrips','Stenchaetothrips biformis (Bagnall, 1913)','grain spreader thrips','insect_Stenchaetothrips_biformis_(Bagnall)','Bọ trĩ non rất nhỏ, dài độ 1 mm màu vàng nhạt, hình dáng giống con trưởng thành nhưng chưa có cánh. Con trưởng thành có màu đen thon dài 1,5-2mm.','Loài bọ trĩ này được coi là phổ biến trên khắp Cựu thế giới, từ Úc đến Châu Âu, và cũng du nhập vào Nam Mỹ','Vòng đời và cách gây hại trên lúa: giai đọan trứng: 3 ngày; giai đọan ấu trùng: 14 ngày; giai đọan nhộng: 5 ngày; giai đọan thành trùng: dưới 18 ngày.','Bọ trĩ trưởng thành và non đều hút nhựa lá làm cho lá có màu vàng đỏ. Khi mật độ thấp xuất hiện những chấm nhỏ xếp theo hàng dọc trên lá, lá non hầu như bị quăn lại, không hồi phục được. Bọ trĩ gây hại ngay từ khi cây lúa xuất hiện, mật độ tăng dần từ khi lúa hồi xanh đến đẻ nhánh sau đó giảm dần tới lúc lúa trỗ.Trời mưa lớn là bất lợi cho bọ trĩ. Bọ trĩ thường hại nặng những ruộng thiếu nước. Ruộng khô xuất hiện nhiều bọ trĩ gây hại làm cho đầu lá lúa quăn lại và biến màu vàng. Khi trời mưa bọ trĩ giảm số lượng rõ rệt, nhất là giai đoạn bọ trĩ lớn.','Bọ trĩ gây hại không quan trọng đến mức làm giảm năng suất lúa, chỉ hạn chế sinh trưởng giai đoạn đầu và làm cho cánh đồng có màu vàng nên nông dân thấy khó chịu. Không cần phải phun thuốc mà cần tìm các biện pháp như vệ sinh đồng ruộng, làm sạch cỏ dại; gieo sạ mật độ vừa phải, giữ nước không để ruộng khô. Nếu cần thiết phun nên dùng các loại thuốc sinh học nhằm bảo vệ thiên địch không bùng phát các loại sâu, rầy khác giai đoạn sau. Bọ trĩ rất dễ tiêu diệt, biện pháp phòng trừ như sau: cần tăng cường bón phân chăm sóc, không để ruộng khô nước; khi bị bọ trĩ gây hại với tỷ lệ trên 15% dảnh hoặc  mật độ trên 2.500 con/m2 thì dùng các loại thuốc sinh học đặc hiệu như Actara 25Wp, Radiant 60SC, … để phun trừ.','thumbnails/grain_spreader_thrips.jpg',11,0,'Bọ trĩ'),(14,'','rice shell pest','','rice shell pest','insect_','','','','','','thumbnails/rice_shell_pest.jpg',NULL,0,'Sâu gạo'),(15,'Varies','grub','Grubworm','grub','insect_Varies','Tất cả các loài giun đất đều có cơ thể cong thành hình chữ C với đầu màu vàng nâu. Chúng có sáu chân nằm gần phía trước cơ thể và phần bụng có màu sẫm do các hạt đất lộ ra qua bộ xương ngoài của chúng. Chiều dài của sâu mọt có thể dao động tùy thuộc vào loài sâu mọt. Chúng thường có chiều dài từ một phần tư inch đến hai inch và rất dễ nhận biết với cơ thể màu kem của chúng.','Nhật Bản, Mỹ và khắp châu Á','Vòng đời của bọ xít trắng bao gồm 4 giai đoạn là Trứng, Ấu trùng, Nhộng và Trưởng thành. ... Các loài Bọ trắng đều hoàn thành vòng đời của chúng trong 1 năm, ngoại trừ Bọ tháng sáu có vòng đời 3 năm. Giai đoạn trứng. Bọ cánh cứng trưởng thành đào những lỗ nông trên đất nơi chúng đẻ trứng','Giun bụi ăn rễ của bất kỳ loại cỏ nào mùa ấm và mát, từ đó làm hỏng cỏ và trong một số trường hợp, giết chết hoàn toàn. Họ không có nhiều ưu tiên giữa các loại cỏ để nuôi. Giun bụi có thể được tìm thấy khi ăn rễ của cỏ bermuda, cỏ zoysia, cỏ bahia, cỏ rết, cỏ xanh Kentucky, cỏ đuôi ngựa cao, cỏ St. Augustine và hơn thế nữa. Không có một loại cỏ sống, kháng sâu grub.','Tưới cỏ ngay sau khi bôi thuốc diệt côn trùng. Sử dụng đúng tỷ lệ / lượng sản phẩm. Cỏ khỏe mạnh với một vài bụi rậm có thể không cần thuốc diệt côn trùng.','thumbnails/grub.jpg',12,0,'Ấu trùng'),(16,'Gryllotalpa brachyptera','mole cricket','G. brachyptera','mole cricket','insect_Gryllotalpa_brachyptera','dế dũi thường có màu nâu nhạt hơi vàng.có 6 chân, nhưng 2 chân trước lớn có 3-4 móng sắc(Hình 3), nhọn(để đào bới đất…), 4 chân sau nhỏ hơn và chỉ có 2 nhỏ như đầu kim.một con trưởng thành thông thường dài khoảng 3,5-4,5cm và bề ngang khoảng 1cm.','Nam Mỹ,Tây Ấn và New South Wales ở Úc','Dế có nốt ruồi trải qua quá trình biến thái không hoàn toàn ; khi nhộng non nở ra từ trứng, chúng ngày càng giống với hình thức trưởng thành khi chúng lớn lên và trải qua một loạt lên đến 10 lần lột xác. Sau khi giao phối, khoảng thời gian 1-2 tuần có thể xảy ra trước khi con cái bắt đầu đẻ trứng. Nó đào sâu vào đất tới độ sâu 30 cm (12 in), (72 cm (28 in) đã được nhìn thấy trong phòng thí nghiệm) và đẻ một lứa từ 25 đến 60 trứng. Những con cái Neoscapteriscus sau đó nghỉ hưu, bịt kín lối vào, nhưng ở Gryllotalpa và Neocurtillaloài, con cái đã được quan sát thấy vẫn ở trong một buồng liền kề để có xu hướng ly hợp. Các ly hợp khác có thể xảy ra sau vài tháng, tùy theo loài. Trứng phải được đẻ trên nền đất ẩm, và nhiều nhộng chết vì đất không đủ ẩm. Trứng nở trong vài tuần, và khi chúng lớn lên, nhộng tiêu thụ rất nhiều vật liệu thực vật dưới lòng đất hoặc trên bề mặt. Con trưởng thành của một số loài dế chũi có thể di chuyển xa tới 8 km (5,0 mi) trong mùa sinh sản. Dế nốt ruồi hoạt động hầu hết trong năm, nhưng qua mùa đông như nhộng hoặc trưởng thành ở vùng khí hậu mát mẻ hơn, hoạt động trở lại vào mùa xuân.','Dễ trũi cũng có thể bay - một con trưởng thành có thể bay xa 8 km trong mùa sinh sản. Mùa đông thì chúng đi ngủ đông. Dễ trũi là loài ăn tạp, chúng ăn cả ấu trùng, giun, rể cây, cỏ. Các loại kẻ thù ăn thịt dế trũi có chim, chuột, chồn hôi, tatu, gấu trúc Mỹ, cáo,gà và loài người.ả hai loại trên đều rất thích sống ở những nơi ủ phân, đất nền chuồng, ban ngày trú ẩn dưới đất.','nên trộn nước và xà phòng kali và áp dụng nó vào lỗ vào của nơi trú ẩn của nó.Một thời gian ngắn sau chúng sẽ nổi lên và chúng ta có thể bắt và thả chúng ở một nơi tự nhiên cách xa khu vườn.','thumbnails/mole_cricket.jpg',13,0,'dế chũi'),(17,'Melanotus spp.','wireworm','Melanotus spp.','wireworm','insect_Melanotus spp','Loài giun này mảnh mai, có khớp nối, thường có vỏ cứng, có ba cặp chân và có màu nâu rám nắng. Đây là giai đoạn chưa trưởng thành của bọ kích, chúng đẻ trứng trên đất trong tháng 5 và tháng 6. Cỏ, sod và sorghum-sudangrass là những nơi đẻ trứng ưa thích. Trứng nở để trở thành giun xoắn ăn hạt, rễ, củ và các mô thực vật khác dưới mặt đất. Giun dây kiếm ăn trong vài năm trước khi hóa nhộng và xuất hiện khi trưởng thành. Do đó, vấn đề về sâu mọt vào mùa xuân có thể có nghĩa là đã có một loại cỏ hấp dẫn xuất hiện trong vòng 3-5 năm trước. Giun đũa cũng thích đất ẩm ướt và nhiệt độ vừa phải; chúng di cư lên để đến vùng đất ấm hơn, nhưng xuống dưới để tránh quá lạnh, nóng hoặc hạn hán.','Murcia, Cộng đồng Valencia, Extremadura và Aragon là nơi có tầm quan trọng nhất.','Cùng xem chu kỳ sinh học của loại sâu hại cây ăn quả này như thế nào nhé. Những con trưởng thành chủ yếu trú ẩn trên mặt đất cho đến cuối mùa hè. Đó là từ giai đoạn này, nơi chúng bắt đầu xuất hiện và trùng hợp với sự đâm chồi của cây ăn quả. Đây là nguyên nhân khiến các loại cây trồng này bị ảnh hưởng. Những người lớn trở ra rất đói sau cả mùa đông dưới mặt đất. Điều này xảy ra ít nhiều vào cuối tháng Hai và đầu tháng Ba. Chúng bắt đầu ngấu nghiến tất cả các chồi non, chồi non và cuống lá trên đường đi của chúng. Sau khoảng 40 ngày cho ăn, chúng bắt đầu sinh sản. Mùa sinh sản kéo dài từ tháng Năm đến tháng Chín.Nhiệt độ mùa xuân và mùa hè ôn hòa hơn đối với sâu bệnh, vì vậy mỗi con cái có thể đẻ từ 350 đến 400 trứng trên mặt đất và cách thân cây chưa đầy một mét. Độ sâu của mặt đất nơi nó đẻ trứng xấp xỉ từ 0.5 đến 2 cm. Chỉ trong khoảng 10 ngày, trứng nở thành ấu trùng và tiến về phía rễ cây. Bên trong rễ chúng phát triển dài đến 7-10 cm','Chúng gầy và ăn rễ và củ của các loại cây trồng như ngô, khoai tây và lúa mì. Chúng được coi là một loài gây hại khi chúng di chuyển từ cây này sang cây dưới đất và có thể làm như vậy trong nhiều năm trước khi hóa nhộng thành con trưởng thành.','Thông thường người trồng sử dụng lớp phủ hàng nổi trên các cây trồng sớm để loại trừ côn trùng gây hại, chỉ phát hiện ra rằng những loài gây hại cây con này gây ra rắc rối ngay bên dưới lớp phủ. Loài gây hại này thường trú ngụ trong đất, đặc biệt là những nơi có cây che phủ tươi tốt, và sẽ tìm kiếm thức ăn và nơi đẻ trứng ngay khi chúng hoạt động vào mùa xuân.','thumbnails/wireworm.jpg',14,0,'Giun kim'),(18,'Pieris Brassicae','white margined moth','P. brassicae','white margined moth','insect_Pieris_Brassicae','Được xác định tốt nhất bởi sự kết hợp của bề mặt từ trắng không nguyên chất đến nhiều bụi với màu đen, vảy đen tập trung dọc theo các gân cánh và gần như không có trong các tế bào giữa các gân; mặt dưới gần như vô nhiễm màu trắng đến ngả vàng, có nhiều đường gân xanh xám dọc theo các đường gân.','Châu Âu, Bắc Phi và Châu Á đến dãy Himalaya thường ở các khu vực nông nghiệp, đồng cỏ và đất công viên.','Con cái đẻ trứng đơn lẻ, chủ yếu ở mặt dưới của lá cây chủ, đôi khi ở thân cây (Scott 1986, 1992, 2006; James và Nunnallee 2011). Số lượng trứng trên một noãn (1/8 tổng số) khoảng 90 (Ehrlich và Ehrlich 1978). Trứng nở trong khoảng 4-5 ngày (tùy thuộc vào nhiệt độ), phát triển nhanh chóng từ kích thước L1 đến kích thước L5 và nhộng trong khoảng 18-21 ngày sau khi trứng nở, con trưởng thành nở (nhộng ra khỏi nhộng) trong khoảng 8-10 ngày (Guppy và Shepard 2001; James và Nunnallee 2011). Sâu non đục vào lá, ăn cả hoa và quả, không xây tổ, nhộng trên cây ký chủ; nhộng ngủ đông (Scott 1979, 1986; Guppy và Shepard 2001; James và Nunnallee 2011). Con đực tuần tra suốt cả ngày dọc theo những con đường mòn, con đường, những con suối có bóng râm để tìm kiếm những con cái','Rừng và đồng cỏ ẩm, khoảng trống của rừng cây lá kim, dọc theo các dòng suối, ven đường, khe, thấm, lãnh nguyên (Scott 1986; Opler và Wright 1999; Glassberg 2001; Pyle 2002). Trong Vườn quốc gia Glacier, Montana đã báo cáo về đường trên trong địa hình núi cao (Debinski 1993); trong Hệ sinh thái Greater Yellowstone được báo cáo trong rừng cây lá kim và rụng lá râm mát, rừng và ven rừng, lãnh nguyên, ven đường và đồng cỏ ẩm ướt trên núi','Dùng vợt bắt bướm, ngắt nhộng trên lá, thu dọn và hủy bỏ tàn dư cây trồng.Luân phiên sử dụng một số loại thuốc sau: Emamectin; Lufenuron và hỗn hợp có hoạt chất (Chlorantraniliprole + Abamectin)…','thumbnails/white_margined_moth.jpg',15,0,'Bướm viền trắng'),(19,'Agrotis ipsilon (Hufnagel)','black cutworm','A. ipsilon','black cutworm','insect_Agrotis_ipsilon_(Hufnagel)','38–48 mm. Antennae ở đực lưỡng tính. Cánh chim có màu nâu, hơi đỏ, trộn lẫn với chất nhờn màu xám nhạt, màu trắng và đôi khi vùng trung bình có nhiều lông sẫm màu; dòng đầu tiên và dòng thứ hai có viền màu tối; các điểm được viền bằng màu đen, sau đó là dấu gạch ngang ngắn màu đen; đường phụ bị che khuất, thường có hai vết đen nhỏ ở trước ở giữa. Cánh sau có màu xám trắng hoặc hơi trắng, cuối cùng có nhiều lông mềm. Ấu trùng màu nâu nâu hoặc xám xám, hai bên đôi khi hơi xanh; đường lưng, đường dưới lưng và đường gai có màu đậm hơn hoặc nhạt hơn một cách mờ nhạt, thường có viền đậm hơn; đầu có màu nâu thường được sử dụng đánh dấu.','Các quần thể của loài này đã được tìm thấy ở miền nam Canada , 48 của Hoa Kỳ (và thêm cả Hawaii ), Mexico , Trung và Nam Mỹ, Úc , New Zealand , Vành đai Thái Bình Dương , Bắc Phi , Châu Âu và Châu Á','Trong một năm nhất định, số lượng thế hệ khác nhau dựa trên vị trí và điều kiện thời tiết. Ở Canada, có 1 hoặc 2 thế hệ, trong khi ở Hoa Kỳ, có 2 đến 4 thế hệ mỗi năm. Loài này có nhiều ở nhiệt độ ấm hơn (chẳng hạn như Arkansas, Hoa Kỳ) vào cuối mùa xuân vào tháng 5 - tháng 6 và đầu mùa thu vào tháng 9 và tháng 10, trong khi chúng có nhiều ở nhiệt độ mát hơn (chẳng hạn như New York, Hoa Kỳ) trong mùa hè ở Tháng sáu và tháng bảy. Một vòng đời kéo dài từ 35–60 ngày.','Loài này là loài di cư theo mùa, di cư lên phía bắc vào mùa xuân và phía nam vào mùa thu để thoát khỏi nhiệt độ khắc nghiệt vào mùa hè và mùa đông. Các mô hình di cư phản ánh cách sinh sản xảy ra vào mùa xuân và chấm dứt vào mùa thu.','Đối với những ruộng nhỏ, khi mật độ sâu thấp có thể bắt sâu bằng tay vào buổi sáng sớm hay chiều tối bằng cách bới đất quanh gốc cây bị sâu cắn để bắt sâu.Biện pháp sinh học:– Hạn chế phun thuốc để bảo tồn thiên địch trên đồng ruộng như nhện, bọ rùa, ong ký sinh…\n– Dùng bẫy bả chua ngọt để bẫy bướm. Cách làm bẫy bả chua ngọt: Trộn hỗn hợp gồm 4 phần đường + 4 phần dấm + 1 phần rượu + 1 phần nước. Cho vào trong bình đậy kín sau 3 – 4 ngày thì thêm vào 1% thuốc trừ sâu. Quấn giẻ hay bùi nhùi rơm rạ vào đầu gậy nhúng vào bả cắm trên bờ ruộng. Bướm trưởng thành sẽ bay vào ăn bả chua ngọt và bị chết. Cứ 2 – 3 ngày nhúng bả lại 1 lần.','thumbnails/black_cutworm.jpg',16,0,'Sâu xám'),(20,'Noctua pronuba','large cutworm','N. pronuba','large cutworm','insect_Noctua_pronuba','Các loài giun chỉ phổ biến nhất xuất hiện trong các khu vườn ở Minnesota là giun đồng, giun nhiều màu, giun đen, giun nhăn nheo, giun thủy tinh và giun quân đội.Bướm đêm trưởng thành là loại côn trùng có kích thước vừa phải, màu nâu hoặc đen với nhiều đốm khác nhau, hoặc các sọc có màu xám, nâu, đen hoặc trắng.\n\nNhìn chung, chúng có chiều dài cơ thể khoảng 1 inch với các sải cánh có chiều ngang lên đến 1 1/2 inch.\nThông thường, cánh trước sẫm màu hơn cánh sau và có hoa văn.','Châu Âu , Bắc Phi , Quần đảo Canary , Trung Đông , Thổ Nhĩ Kỳ , Iraq , Iran , Afghanistan , tây bắc Ấn Độ , Nga , Novosibirsk Oblast , Caucasus , Transcaucasia và Trung Á','Trứng được đẻ trên vật liệu thực vật gần bề mặt đất. Chúng có màu trắng kem khi đẻ và mất ba ngày đến vài tuần để nở tùy thuộc vào nhiệt độ. Những con sâu bướm mới xuất hiện sẽ phát triển với một số moults cho đến khi chúng có kích thước đầy đủ và sau đó thành nhộng trong đất. Bướm đêm chui ra từ nhộng. Có thể mất một tháng hoặc cả năm để hoàn thành vòng đời của một con giun chỉ tùy thuộc vào loài có liên quan và nhiệt độ.','Ấu trùng giun chỉ thường sống về đêm. Chúng ẩn mình dưới bề mặt đất, đất đóng cục hoặc thành lớp và đi ra ngoài vào ban đêm để kiếm ăn, mặc dù việc kiếm ăn vào ban ngày trên mặt đất đôi khi xảy ra, đặc biệt là khi ấu trùng ở mật độ cao. Sâu bướm thường cuộn tròn khi bị quấy rầy. Vào ban đêm, những con bướm đêm trưởng thành là những con bay mạnh mẽ và có thể được nhìn thấy xung quanh đèn hoặc trên ô cửa sổ.','Biện pháp canh tác: làm đất kỹ, vệ sinh đồng ruộng, xử lý đất trước khi trồng để tiêu diệt mầm mống sâu hại ở trong đất.Biện pháp nhiệt hóa học để xử lý hạt giống, mầm hạt trước khi gieo.\n- Đối với sâu chích hút nhựa Quế cần quét vôi vào cây hòa bột cây ruốc cá với xà phòng phun vào sáng sớm hay chiều tối.','thumbnails/large_cutworm.jpg',17,0,'Sâu cắt lớn'),(21,'Large yellow underwing','yellow cutworm','N. pronuba','yellow cutworm','insect_Large_yellow_underwing','Cánh trước dài, hẹp và tròn. Chúng có màu sắc thay đổi từ nâu đỏ đến nâu đen nhưng có một chấm đen nhỏ ở gần mép chính ở đầu. Phần đuôi màu vàng có một dải hẹp màu đen không có hình lưỡi liềm hoặc lớp phủ sẫm màu được tìm thấy ở các loại quần lót màu vàng khác.Những con trưởng thành đến với ánh sáng với số lượng lớn và có thể bị quấy rầy bởi các mảnh vụn thực vật hoặc thảm thực vật mặt đất vào ban ngày. Ấu trùng có thể được tìm thấy từ tháng 8 đến đầu mùa xuân, kiếm ăn vào ban đêm và ẩn dưới đất vào ban ngày.','Quốc gia - Anh, Wales, Scotland và Ireland. Phổ biến và rộng rãi trên khắp nước Anh, Ireland và quần đảo Channel. Những cuộc di cư lớn thỉnh thoảng cũng đã được ghi nhận ở bờ biển phía nam.','Trứng được đẻ thành từng lô lớn, thẳng hàng với nhau từ hai đến ba trăm quả trên nhà máy thức ăn cho ấu trùng. Những con cái cũng sẽ đẻ tự do trong điều kiện nuôi nhốt kể cả bên trong bẫy đèn.Trứng nở trong vòng 10 ngày và sâu bướm ăn nhiều loại cây thân thảo thấp bao gồm bồ công anh, bến tàu, cỏ và các loại cây nông nghiệp trồng thương mại.Khi chúng trở nên lớn hơn, chúng kiếm ăn chủ yếu vào ban đêm, ban ngày ngay dưới bề mặt đất hoặc giữa các gốc và rễ của cây.','Sâu bướm mùa đông trong đợt áp chót hoặc đợt cuối và có thể kiếm ăn ít trong những đợt nhẹ.Đôi khi chúng được bắt gặp trên mặt đất hoặc thậm chí trên bề mặt tuyết vào giữa mùa đông.\nBắt đầu phát triển khi thời tiết ấm lên.','có thể mua tuyến trùng có lợi từ một số nhà bán lẻ thương mại. Tưới nước vào đất để loại bỏ sâu mọt trong đất. Nhiệt độ đất cần từ 12-20ºC để việc xử lý đạt hiệu quả. Luôn chú ý nghiên cứu các sản phẩm để đảm bảo chúng là giải pháp phù hợp cho vấn đề của bạn! Luôn đọc hướng dẫn trước khi nộp đơn.','thumbnails/yellow_cutworm.jpg',17,0,'Sâu cắt vàng'),(22,'Tetranychus sp.','red spider','Tetranychus sp.','red spider','insect_Tetranychus_sp','là loài côn trùng gây bệnh rất phổ biến trên cây. Có nhiều giống nhện đỏ khác nhau. Đa số giống nhện đỏ hiện nay có phần thân nhỏ, chỉ khoảng 0,4mm, thành trùng đực có kích thước nhỏ hơn, chỉ khoảng 0,3mm.Toàn thân nhện đỏ phủ một lớp lông thưa và có màu xanh, đỏ hoặc trắng, ở hai bên thân mình có đốm đen.','Phân bố rộng trên thế giới từ Hà Lan (phát hiện trên cây cau Phoenicis năm 1939) đến Achentina. Gây hại khá phổ biến cây trồng tại các vùng nhiệt đới nóng ẩm','Nhện đỏ có 8 chân, chúng di chuyển nhanh chóng và linh hoạt, thành trùng cái có màu vàng nhạt hay hơi ngả sang màu xanh lá cây một chút. Loại này bạn có thể nhìn xuyên qua cơ thể và thấy hai đốm màu khá đậm bên trong. Đây là nơi chứa thức ăn của nhện đỏ. Thành trùng cái bắt đầu đẻ trứng khoảng 2 – 6 ngày sau khi bắt cặp, mỗi con đẻ khoảng 70 trứng mỗi lần.Trứng nhện đỏ nhìn hình cầu hoặc hình củ hành, bóng láng, nhìn bằng mắt thường rất nhỏ. Nhện đỏ thường đẻ trứng lá lá, cụ thể là sát gân lá ở cả 2 mặt lá, thường là gắn chặt ở mặt dưới ở lá, ở nơi nào có tơ do nhện giăng ra khi chúng di chuyển. Trứng sẽ nở rất nhanh vào 4 – 5 ngày sau đó.\n\nẤu trùng nhện đỏ khi mới nở trông khá giống thành trùng nhưng không có đủ 8 chân mà chỉ có 3 đôi chân. Thời gian sau đó ấu trùng sẽ nở ra thành trùng cái, sau đó thay da 3 lần. Tuy nhiên những ấu trùng sẽ nở thành trùng đực chỉ thay da 2 lần thôi. Mất khoảng 5 – 10 ngày để ấu trùng phát triển.','Loài nhện đỏ thường sống ở mặt trên của những lá già hoặc lá bánh tẻ, thậm chí nếu phát triển với mật độ cao chúng còn sống ở cả mặt dưới của lá, trên những cảnh lộc non hoặc quả.Nhện đỏ sẽ hút chẹc nhựa cây để sống nên sẽ tạo thành các vết chấm nhỏ li ti màu trắng bạc, hơi càng. Nếu lá bị nặng sẽ chuyển sang màu trắng bạc, rụng nhanh, cây còi cọc, chậm lớn, không ra chồi mới.','Biện pháp canh tác, kỹ thuật:+ Không nên trồng quá dầy làm cho vườn bị um tùm rậm rập, không thông thoáng, tán bị che phủ nhiều.Biện pháp hóa học:\n- Nhện đỏ rất khó trị vì rất nhỏ và thường sống ở gần gân lá, nơi thuốc trừ sâu rất khó tiếp xúc, hơn nữa, nhện tạo lập quần thể rất nhanh nên mật số tăng nhanh và nhiều. Có thể sử dụng các loại thuốc trừ nhện nhưng phải để ý đến quần thể thiên địch.\n\n+  Phun các thuốc có hỗn hợp hoạt chất (Chlorantraniliprole + Abamectin)…\n\n- Nếu vườn đào thường bị nhện gây hại nặng thì cứ mỗi đợt cây ra đọt, lá non nên phun xịt 3 lần thuốc trừ nhện: lần 1 khi cây vừa nhú đọt non, lần 2 khi đọt non ra rộ và lần 3 khi lá non bước sang giai đoạn bánh tẻ.','thumbnails/red_spider.jpg',18,0,'Nhện đỏ'),(23,'Ostrinia nubilalis Huber','corn borer','Ostrinia nubilalis (Huebner, 1796)','corn borer','insect_Ostrinia_nubilalis Huber','Còn gọi là xén tóc sao hay xén tóc hoa vì trên toàn thân màu đen của con bọ trưởng thành cánh cứng này có điểm khoảng 30 chấm trắng. Con trưởng thành thường ăn bổ sung bằng các phần non của cây, đặc biệt là rễ non trước khi đẻ trứng vào tháng 5, tháng 6, vũ hoá vào tháng 5-6. Trước khi đẻ, xén tóc sao cắn vào gốc cây một vết hình chữ T ngược rồi đẻ trứng vào đó. Sau 6-12 ngày thì trứng nở, sâu non di chuyển xuống phía dưới gốc, phá hại phần gốc, rễ cây tiếp giáp với thân. Đầu tiên sâu hại vỏ, sau đó đục vào bên trong phần gỗ. Nhiều khi sâu đục cả những rễ to làm cho cây héo toàn bộ, rụng lá và chết. Sâu non phá hại trong 2-3 tháng thì nghỉ đông ở gốc cây. Đến tháng 3, tháng 4 năm sau thì hoá nhộng, tháng 5-6 vũ hoá. Vòng đời của xén tóc sao là một năm.','Malaysia hay Indonesia.','Trứng: Trứng được xếp thành từng chùm không đều, có kích thước khoảng 15 đến 20. Trứng có hình bầu dục, dẹt, màu trắng kem, thường có ánh kim. Trứng sẫm dần thành màu be hoặc nâu vàng theo tuổi. Trứng thường được tích tụ ở mặt dưới của lá và chồng lên nhau giống như bệnh zona trên mái nhà hoặc vảy cá. Trứng có chiều dài khoảng 1,0 mm và chiều rộng 0,75 m. Ngưỡng phát triển của trứng là khoảng 15 ° C. Trứng nở sau bốn đến chín ngày.Ấu trùng:Ấu trùng có xu hướng có màu nâu nhạt hoặc xám hồng ở mặt lưng, với một nang đầu màu nâu đến đen và một tấm ở ngực màu nâu vàng.Người lớn:Bướm đêm khá nhỏ, con đực có sải cánh dài từ 20 đến 26 mm và con cái từ 25 đến 34 mm. Bướm đêm cái có màu từ vàng nhạt đến nâu nhạt, với cả cánh trước và cánh sau đan chéo nhau bằng những đường ngoằn ngoèo sẫm màu và mang những mảng màu nhạt, thường hơi vàng. Con đực có màu lông sẫm hơn, thường là nâu nhạt hoặc nâu xám, nhưng cũng có những đường ngoằn ngoèo sẫm màu và các mảng màu vàng.','Nếu là sâu non chúng sẽ chọn các đốt ở chồi và hoa để tấn công từ đó làm chúng héo đi. Sau đó các phần trên non sẽ bị gãy và chết. Con nào gây hại cho trái thì làm trái bị hỏng, nếu có phát triển cũng không đạt kích thước tiêu chuẩn.Các con cái sẽ đục vào vỏ thân thành từng lỗ rồi đẻ trứng vào đó. Phần xung quanh lỗ đục sẽ có màu đậm hơn chỗ khác và sau vài giờ sẽ chuyển sang màu đen.','Việc kiểm soát sinh học đã được cố gắng nhiều lần trên ngô ngọt và các loại rau khác dễ bị sâu đục thân ngô châu Âu tấn công. Các sản phẩm Bacillus thuringiensis có thể có hiệu quả như nhiều loại thuốc trừ sâu hóa học, nhưng thường tỏ ra kém hiệu quả hơn một số loại. Hầu hết các phương pháp tiếp cận đơn yếu tố, ngoại trừ các công thức mới hơn của Bacillus thuringiensis , đã được chứng minh là không ổn định. Phát hành Trichogramma spp bản địa . (Bộ cánh màng: Trichogrammatidae), chẳng hạn, cung cấp mức độ đàn áp thay đổi và trung bình.','thumbnails/corn_borer.jpg',19,0,'Sâu đục thân ngô'),(24,'Fall armyworm','army worm','S. frugiperda','army worm','insect_Fall_armyworm','Bướm đêm trưởng thành có kích thước từ 32 đến 40 mm ( 1+1 ⁄ 4 đến 1+1 ⁄ 2  in) từ đầu cánh đến đầu cánh, với cánh trước màu nâu hoặc xám, và cánh sau màu trắng. Có một chút lưỡng hình về giới tính , với những con đực có nhiều hoa văn hơn và một đốm trắng riêng biệt trên mỗi cánh trước của chúng. Các ấu trùng đầu tiên instar được ánh sáng màu với một cái đầu đen lớn hơn. Khi chúng phát triển qua các cửa sổ, chúng trở nên nâu hơn với các đường thẳng dài màu trắng. Chúng cũng phát triển các đốm đen với gai.','phân bố rộng rãi ở miền đông và trung Bắc Mỹ và Nam Mỹ.','Trứng của sâu bọ có hình vòm,  có đường kính khoảng 0,4 mm ( 1 ⁄ 64 in) và cao 0,3 mm ( 3 ⁄ 256  in). [6] Con cái thích đẻ trứng ở mặt dưới của lá, nhưng ở những quần thể cao, chúng sẽ đẻ ở bất cứ đâu. [33] Trong thời tiết ấm áp, trứng sẽ nở thành ấu trùng trong vòng vài ngày.Ấu trùng trải qua sáu giai đoạn khác nhau , mỗi giai đoạn khác nhau một chút về ngoại hình và kiểu dáng. Quá trình ấu trùng kéo dài từ 14 đến 30 ngày, một lần nữa tùy thuộc vào nhiệt độ. [6] Sâu bướm trưởng thành khoảng 1+Chiều dài 1 ⁄ 2 –2 inch (38–51 mm). [1] Đây là giai đoạn sống phá hoại nhất vì ấu trùng có các bộ phận miệng cắn. Ấu trùng có một vết khâu chữ Y ngược đặc biệt trên trán.Sau đó, ấu trùng sẽ hóa nhộng dưới đất từ ​​7 đến 37 ngày trong một cái kén, chúng tạo thành đất và tơ. Thời gian tồn tại và thời gian tồn tại của giai đoạn nhộng phụ thuộc vào nhiệt độ của môi trường.Sau khi xuất hiện, con trưởng thành sống trong khoảng 10 ngày, và đôi khi lên đến 21 ngày, với con cái đẻ hầu hết trứng trong thời gian đầu đời. [6] Người lớn sống về đêm và thích hợp nhất vào những đêm ấm áp và ẩm ướt','Sâu non gây hại bằng cách tiêu thụ tán lá. Ấu trùng non ban đầu tiêu thụ mô lá từ một phía, để lại lớp biểu bì đối diện còn nguyên vẹn. Đến giai đoạn thứ hai hoặc thứ ba, ấu trùng bắt đầu tạo lỗ trên lá và ăn từ mép lá vào trong. Ăn ngô thường tạo ra một hàng lỗ đặc trưng trên lá. Mật độ ấu trùng thường giảm xuống còn một đến hai con trên mỗi cây khi ấu trùng kiếm ăn gần nhau, do hành vi ăn thịt đồng loại. Sâu non già hơn gây rụng lá trên diện rộng, thường chỉ để lại sườn và thân cây ngô, hoặc có hình dạng xù xì, rách nát. Marenco và cộng sự. (1992) đã nghiên cứu ảnh hưởng của tổn thương sâu vẽ bùa đối với sự phát triển sinh dưỡng sớm của ngô ngọt ở Florida. Họ báo cáo rằng giai đoạn vòng xoắn đầu ít nhạy cảm nhất với chấn thương, giai đoạn vòng tròn trung gian và giai đoạn vòng quay muộn nhạy cảm nhất với chấn thương. Hơn nữa, họ lưu ý rằng mật độ trung bình từ 0,2 đến 0,8 ấu trùng trên mỗi cây trong giai đoạn cuối của ấu trùng có thể làm giảm năng suất từ ​​5 đến 20 phần trăm.','Thuốc trừ sâu:Thuốc trừ sâu thường được áp dụng cho ngô ngọt ở các bang miền đông nam để bảo vệ khỏi bị sâu mọt phá hại mùa thu, đôi khi thường xuyên như hàng ngày trong giai đoạn mạ bạc. Ở Florida, sâu vẽ bùa mùa thu là loài gây hại quan trọng nhất đối với ngô. Thường phải bảo vệ cả giai đoạn sinh dưỡng sớm và giai đoạn sinh sản của ngô. Vì ấu trùng ăn sâu trong vỏ của cây ngô non, nên có thể cần một lượng lớn thuốc trừ sâu dạng lỏng để có thể xâm nhập đầy đủ. Thuốc diệt côn trùng có thể được áp dụng trong nước tưới nếu nó được áp dụng từ các vòi phun nước trên cao. Thuốc trừ sâu dạng hạt cũng được áp dụng trên cây non vì các hạt này rơi sâu vào rãnh. Một số khả năng kháng thuốc diệt côn trùng đã được ghi nhận, với mức độ kháng khác nhau theo từng khu vực. Foster (1989) báo cáo rằng việc giữ cho cây không có ấu trùng trong thời kỳ sinh dưỡng làm giảm số lần phun thuốc cần thiết trong thời kỳ trỗ. Người trồng tập trung các lần phun thuốc vào đầu giai đoạn ủ bạc thay vì rải đều các lần phun thuốc sẽ mang lại ít lợi ích.','thumbnails/army_worm.jpg',20,0,'Sâu keo'),(25,'Aphidoidea','aphids','Aphids','aphids','insect_Aphidoidea','Rệp cây là một trong những loài côn trùng phá hoại nhiều nhất đối với cây trồng ở các vùng ôn đới.[3] Thiệt hại mà chúng gây ra cho cây cối đã làm cho trở thành kẻ thù của nông dân và người làm vườn trên toàn thế giới, nhưng từ quan điểm động vật, chúng là một nhóm sinh vật rất thành công.[4] Thành công của chúng một phần là do khả năng sinh sản vô tính của một số loài. Có khoảng 4400 loài thuộc 10 họ được biết đến. Trong lịch sử, một số họ được công nhận, hầu hết các loài được đưa vào họ Aphididae. Khoảng 250 loài là loài dịch hại nghiêm trọng cho nông nghiệp và lâm nghiệp cũng như một số ít hơn gây phiền toái cho người làm vườn. Chúng khác nhau về chiều dài từ 1 đến 10 milimét (0,04 đến 0,39 in).','phân bố phổ biến tại vùng Đông Nam châu Á, Australia, New Zealand, quần đảo Pacific, Nam Mỹ, Caribbean, Floria và Nam Phi. Chúng là loài gây hại chủ yếu trên cây có múi (Citrus).','Vòng đời của một số loài liên quan đến sự luân phiên giữa hai loài cây ký chủ, ví dụ giữa cây hàng năm và cây thân gỗ . Một số loài chỉ ăn một loại thực vật, trong khi những loài khác là sinh vật tổng hợp, sống tập trung nhiều nhóm thực vật. Khoảng 5.000 loài rệp đã được mô tả, tất cả đều thuộc họ Aphididae . Khoảng 400 trong số này được tìm thấy trên cây lương thực và cây lấy sợi , và nhiều loài là loài gây hại nghiêm trọng cho nông nghiệp và lâm nghiệp , cũng như gây khó chịu cho những người làm vườn . Cái gọi là kiến vắt sữa có mối quan hệ tương hỗ với rệp, chăm sóc chúng để lấy mật, và bảo vệ chúng khỏi những kẻ săn mồi .','Vào mùa thu, nhộng đực được tạo ra để trưởng thành và giao phối với con cái.Con cái đẻ trứng sống qua mùa đông trên cây.\nVào mùa xuân, trứng nở và rệp cái mới kiếm ăn và sinh sản.','Biện pháp đơn giản nhất là dùng que khều bắt rệp ở khe giường, giũ chiếu xuống sàn để tìm rệp và diệt. Sau đó dùng nước sôi dội vào các khe, kẽ giường hoặc dùng đóm lửa lùa vào để đốt chết rệp con và làm ung trứng. Cũng có thể dùng nước xà phòng đun nóng để đổ vào, rồi cọ rửa sạch và phơi ra ngoài nắng.Nếu có điều kiện, dùng dụng cụ hun khói chứa hóa chất pyrethroid diệt côn trùng để hun khói trong nhà. Dụng cụ sẽ cháy khoảng 3-15 phút và chỉ có thể dùng được một lần. Một làn khói với các hạt hóa chất rất nhỏ được sinh ra có thể len lỏi vào các khe kẽ để giết chết rệp và bọ chét, ruồi, muỗi. Loại màn tẩm hóa chất dùng phòng chống muỗi sốt rét cũng có tác dụng làm sạch rệp và chấy.\n\nVới những ngôi nhà bị nhiễm rệp nặng, cần phải phun hóa chất diệt tồn lưu do đơn vị quân y thực hiện. Có thể dùng dipterex 2-3%, DDVP 3%o hoặc pyrethrin 0,1-0,2% phun vào nơi có rệp. Chỉ một lần phun cũng có thể tiêu diệt rệp, nhưng nếu rệp vẫn còn thì có thể phun lại một lần nữa cách lần thứ nhất không dưới 2 tuần. Thường phải phun đến khi tường và sàn nhà ướt (tương ứng với 1 lít cho 50 m2 đối với bề mặt không thấm nước, 5 lít cho bề mặt thấm nước như tường gạch, đất). Cần phun vào buổi sáng để cho khô và tối có thể vào nhà ngủ được, hoặc sau khi phun 2 giờ, đem giường chiếu cọ rửa sạch rồi phơi nắng thật khô.\n\nCó thể diệt rệp theo kinh nghiệm dân gian: dùng một phần hoa hồi, hai phần bồ kết đem tán nhỏ, hòa với thuốc lào, nước điếu rồi nhỏ vào các khe kẽ giường có rệp; hoặc lấy cây thuốc lào tươi rải khắp giường rồi trải chiếu lên; có thể dùng lá thuốc lào khô tán nhỏ, rắc vào khe giường hoặc đốt lùa khói vào khe giường. Một số nơi thì dùng lá xoan lót dưới chiếu. Các biện pháp trên có tác dụng làm cho rệp chui ra để diệt.','thumbnails/aphids.jpg',21,0,'Rệp'),(26,'Ground Beetles','Potosiabre vitarsis','G.Beetles','Potosiabre vitarsis','insect_Ground_Beetles','Bọ cánh cứng có thể dài từ 2 đến 25 mm, chúng có xu hướng dài và hình bầu dục. Hầu hết các loài đều có màu sẫm, nhưng một số loài có thể có vỏ óng ánh với nhiều màu kim loại như xanh lam, đồng, xanh lá cây, cam, đỏ, vàng hoặc sự kết hợp của các màu đó.','Bọ cánh cứng là một trong những nhóm bọ lớn nhất, phổ biến nhất ở Bắc Mỹ. Hàng ngàn loài, bao gồm cả bọ cánh cứng bản địa và không động đất, được tìm thấy trên khắp Hoa Kỳ.','Bọ cánh cứng xanh Delta sinh sản từ tháng 1 đến tháng 9,[2] với con cái sinh ra một thế hệ mỗi năm.','Môi trường sống phổ biến là dưới vỏ cây, dưới khúc gỗ, hoặc giữa các tảng đá [2] hoặc cát ven ao và sông. Hầu hết các loài đều ăn thịt và tích cực săn lùng bất kỳ con mồi không xương sống nào mà chúng có thể chế ngự được. [2] Một số chạy nhanh để bắt con mồi; bọ hổ (Cicindelinae) có thể duy trì tốc độ 9 km / h (5,6 mph) [9] - so với chiều dài cơ thể, chúng là một trong những động vật trên cạn nhanh nhất trên Trái đất. Không giống như hầu hết các loài thuộc họ Carabidae, là loài sống về đêm , bọ hổ là loài săn mồi tích cực vào ban ngày và thường có màu sắc rực rỡ; chúng có đôi mắt to và săn mồi bằng thị giác. Bọ cánh cứng thuộc loài Promecognathus laevissimuslà những kẻ săn mồi đặc biệt của loài Harpaphe haydeniana cyanide , đối kháng với hydrogen cyanide khiến những con milipedes này trở nên độc đối với hầu hết các loài ăn thịt.','Nếu bạn tin rằng bạn có thể bị bọ đất xâm nhập bên trong hoặc sự kiện bên ngoài nhà của bạn, hãy liên hệ với chuyên gia kiểm soát dịch hại dân cư chuyên nghiệp, như các kỹ thuật viên tại ASAP Pest Control. Một kỹ thuật viên và kỹ thuật viên diệt trừ chuyên nghiệp sẽ có thể xác định mức độ xấu của sự lây nhiễm, quyết định sử dụng phương pháp phòng ngừa nào và đảm bảo rằng các biện pháp cần thiết được thực hiện để ngăn chặn khả năng tái nhiễm. Để biết thêm thông tin về cách phát hiện và giảm thiểu sự xâm nhập của bọ đất trong nhà của bạn, hãy liên hệ với nhóm ASAP Pest Control ngay hôm nay.','thumbnails/Potosiabre_vitarsis.jpg',22,0,'Bọ cánh cứng'),(27,'Synanthedon exitiosa','peach borer','S. exitiosa','peach borer','insect_Synanthedon_exitiosa','Sâu đục quả đào trưởng thành là loài sâu bướm có cánh rõ ràng với sải cánh 1-1 / 4. Không giống như phần lớn các loài bướm đêm, những con bướm đêm này bay vào ban ngày và hoạt động mạnh nhất từ ​​10 giờ sáng đến 2 giờ chiều. Con cái và con đực có sự khác biệt về ngoại hình. Con cái có màu xanh lam sẫm, màu thép với một hoặc hai dải rộng màu cam quanh bụng. Đôi cánh trước của cô ấy mờ đục trong khi đôi cánh sau rõ ràng. Bướm đực nhỏ hơn và mảnh mai hơn. Nó cũng có màu xanh thép, nhưng có một số dải màu vàng hẹp xung quanh bụng. Cả hai đôi cánh đều rõ ràng.','Sâu đục thân Peachtree có nguồn gốc từ Hoa Kỳ. Chúng được tìm thấy trên khắp Hoa Kỳ và Canada.','Vòng đời của sâu đục thân cần một năm để hoàn thành. Chỉ có giai đoạn chưa trưởng thành (sâu non) (Hình 3) mới gây hại cho cây. Khi nở ra từ trứng (Hình 4), ấu trùng non ngay lập tức chui vào dát gỗ của cây, thường là qua các vết nứt và vết thương trên vỏ cây. Ấu trùng tiếp tục kiếm ăn và phát triển cho đến khi bắt đầu có thời tiết lạnh. Hầu hết các hoạt động xảy ra một vài inch dưới mặt đất trên thân cây và rễ lớn hơn. Các loài côn trùng trải qua mùa đông như ấu trùng phát triển một phần dưới mặt đất dưới vỏ cây.','Ấu trùng đục vào thân cây từ 8 cm dưới mặt đất đến khoảng 30 cm trên bề mặt. Một loại sâu bệnh hại cây đào.','Việc kiểm soát sâu đục thân cây đào trong vườn cây ăn trái thương mại dựa vào việc ngăn chặn sự thành lập của ấu trùng bên dưới vỏ cây. Khi đã ở dưới vỏ cây, việc kiểm soát hóa chất không hiệu quả. Thuốc diệt côn trùng nên được canh thời gian trùng với thời điểm trứng nở ban đầu để có hiệu quả. Để hỗ trợ thời điểm phun thuốc, bẫy pheromone được sử dụng để cảnh báo người chăn nuôi về sự hiện diện và hoạt động của sâu bướm bướm đào. Bởi vì quá trình nở trứng bắt đầu khoảng 9 đến 10 ngày sau khi bướm xuất hiện, nên phun thuốc diệt côn trùng từ 7 đến 14 ngày sau khi bắt được con sâu bướm cái đầu tiên trong bẫy.  Thuốc xịt có chứa Asana XL, Lorsban và Warrior được dán nhãn để kiểm soát sâu đục quả trên quả đào. Thuốc xịt trực tiếp nên được áp dụng đồng nhất trên thân cây từ gốc đến các chi dưới. Làm ướt kỹ vỏ cây. Không để thuốc xịt Lorsban tiếp xúc với tán lá của quả. Asana XL, trong khi Warrior và Lorsban có khoảng thời gian 14 ngày trước khi thu hoạch Asana XL, Warrior và Lorsban là thuốc diệt côn trùng HẠN CHẾ SỬ DỤNG.','thumbnails/peach_borer.jpg',23,0,'Sâu đục quả đào'),(28,'Sitobion avenae','english grain aphid','S. avenae','english grain aphid','insect_Sitobion_avenae','1,3-3,3 mm.Apterous: vàng, xanh lá cây hoặc đỏ, lá thẳng, màu đen và dạng  lưới .\nAlate: màu xanh lục hoặc đỏ với các đốm bên sẫm màu, râu dài, màu đen; cornicles dài vừa phải, đen, thẳng và có lưới; cauda dài và sáng màu.','Nó xuất hiện rộng rãi ở Châu Âu, Bắc Phi, Trung Đông và Châu Á.','Khi cây trưởng thành, rệp di chuyển đến các bông hoa đang phát triển - những tai mới nổi trong trường hợp lúa mì. Các dạng có cánh phát triển vào cuối tháng 5 dẫn đến việc thành lập nhiều thuộc địa hơn trong tháng 6. Các dạng có cánh tiếp tục được sản xuất trong suốt mùa hè để đối phó với mật độ dân số ngày càng tăng và chất lượng thực phẩm giảm sút. Vào mùa thu, chúng chuyển sang tái phá hoại ngũ cốc hoặc các loại cỏ khác.','Rệp hạt, Sitobion avenae, một loài sinh vật sống ở vũ trụ khác, ăn thực vật trên cỏ và ngũ cốc, và thực sự là loài gây hại chính sau này. Nó hiển thị một loạt các dạng màu từ xanh táo đến xanh đậm và hồng cá hồi đến nâu đậm. Mặc dù cũng thể hiện một loạt các phương thức sinh sản, nó chủ yếu là vô tính ở vùng khí hậu ôn đới, nhưng tạo ra các hình thức hữu tính dẫn đến việc đẻ trứng quá đông khi được cảm ứng dưới ngưỡng nhiệt độ và ánh sáng quan trọng (<15 ° C; <16 giờ ánh sáng) . Chiều dài cơ thể trưởng thành = 1,3-3,3 mm; ảnh (không theo tỷ lệ) cho thấy alate (có cánh) di cư vô tính với nhộng [© RD Dransfield & R. Brightwell, influencer.com; xem trang web của họ và Blackman & Eastop (2000) để biết thêm chi tiết về lịch sử cuộc đời, bao gồm cả việc phân phối].','sử dụng một loạt các kỹ thuật quản lý để thúc đẩy kiểm soát sinh học tự nhiên. Chúng bao gồm việc cho phép hoa umbellifer và cây tầm ma phát triển mạnh ở các rìa ruộng và các khu vực dành riêng để cung cấp mật hoa cho syrphidae trưởng thành và con mồi thay thế cho loài cầu gai. Mặc dù rất hứa hẹn, nhưng tính đầy đủ của phương pháp này vẫn chưa được kiểm tra nghiêm ngặt trong các thử nghiệm ngẫu nhiên. Đây là một lý do tại sao các nhà khoa học tại một viện nghiên cứu ở Anh (Rothamsted Research) gần đây đã bắt tay vào một thử nghiệm gây tranh cãi về lúa mì biến đổi gen.','thumbnails/english_grain_aphid.jpg',24,0,'rệp hạt'),(29,'Green stink bug','green bug','C. hilaris','green bug','insect_Green_stink_bug','Màu của bọ xít xanh thường có màu xanh lục sáng, với các cạnh hẹp màu vàng, cam hoặc hơi đỏ. Nó là một loài bọ lớn, hình khiên, có hình bầu dục, thon dài và chiều dài từ 13 đến 18 mm. Nó có thể được phân biệt với loài Nezara viridula bằng ba đoạn ăng ten ngoài cùng màu đen của nó . Trước ngoài của nó (= ở phía trước và xa giữa) pronotal lề là tương đối thẳng và không arced mạnh mẽ như trong Chinavia pensylvanica','Nó xuất hiện rộng rãi ở Châu Âu, Bắc Phi, Trung Đông và Châu Á.','Con trưởng thành xuất hiện trên đồng ruộng vào đầu tháng 9 và trở nên dồi dào ở những vị trí có mái che. Sau đó, giao phối xảy ra vào đầu tháng 10 và cuối cùng, trứng có thể được tìm thấy từ giữa đến cuối tháng 10. Nhộng xuất hiện vào cuối tháng Mười và đầu tháng Mười Một. Hai hoặc ba thế hệ xảy ra trong những tháng mùa hè trên thực địa và trong phòng thí nghiệm ở 26 ° C.','Nó được tìm thấy trong vườn cây ăn quả, vườn, rừng và cánh đồng trồng trọt trên khắp Bắc Mỹ, [1] kiếm ăn bằng miệng như kim của chúng trên nước ép của nhiều loại thực vật từ tháng 5 cho đến khi băng giá xuất hiện. Con trưởng thành thích phát triển hạt giống và do đó trở thành sâu bệnh hại cây trồng (cà chua, đậu, đậu, bông, ngô, đậu tương, cà tím). Khi không có hạt, chúng cũng ăn thân và tán lá, do đó gây hại cho một số cây ăn quả, chẳng hạn như cây táo, anh đào, cam và đào. Hơn nữa, nó có thể được tìm thấy ở Queensland và New South Wales, Úc. Bọ xít xanh sinh sản tốt trên cây hoa salvia lửa cũng như cà chua và dâu tằm . Ngoài ra nó đã được tìm thấy trên đào , mơ, nho , củ cải bạc và đậu Pháp . Sự khác biệt ở đây là chúng dường như không phải là loài gây hại cho chúng','Phát hiện sớm, diệt các ổ bọ xít xanh mới nở, vợt bắt con trưởng thành.Nên trồng sớm họăc đồng lọat, luân canh với các cây khác không cùng ký chủ. Sử dụng thuốc hóa học nên lưu ý dến sự lưu bả độc trên trái đậu rau.\n\n- Sử dụng các loại thuốc hóa học lưu dẫn, có vị độc, tiếp xúc như Ofatox 400EC, Fastac 5EC, Padan 95 SP; Cyperan 5EC/10EC hoặc 25EC; Bassan 50EC; Sumicidin 10 hoặc 20EC, BIAN 40EC để phòng trị....','thumbnails/green_bug.jpg',25,0,'sâu xanh'),(30,'Rhopalosiphum padi','bird cherry-oataphid','R. padi','bird cherry-oataphid','insect_Rhopalosiphum_padi','1,2-2,4 mm, màu xanh đậm và hình cầu.Apterous: đốm đỏ xung quanh các điểm chèn của cornicles.\nAlate: râu sẫm và ngắn hơn thân; các mảnh vụn ở rìa ở bụng và một mảnh lớn hơn ở gốc của các lớp sừng; cornicles thẳng, có sắc tố, với một điểm  thắt ở đầu, cauda ngắn và có sắc tố.','Loài rệp này phân bố trên toàn cầu, nằm ở tất cả các môi trường sống trên cạn lạnh giá nhất.','Trứng của Rhopalosiphum padi được đẻ vào mùa thu trong khe hẹp giữa chồi nách và thân (xem hình bên dưới).ước tính chỉ có đủ chỗ trong khu vực này cho 10-15 quả trứng được bảo vệ đầy đủ khỏi những kẻ săn mồi, và đã chỉ ra rằng sau khi đẻ trứng có một khoảng thời gian tỷ lệ chết phụ thuộc vào mật độ nơi trứng ở những khu vực chưa tối ưu được ăn trước. Động vật ăn thịt bao gồm nhện và chim. Sau khi trứng nở, nhộng non mới xuất hiện (xem hình đầu tiên bên dưới) di chuyển đến những chiếc lá anh đào chim đang hé mở, nơi chúng kiếm ăn và phát triển (xem hình thứ hai bên dưới).','Rhopalosiphum padi là loài rệp xen kẽ ký chủ - nó thường khai thác các cây thân gỗ (ký chủ thứ cấp) vào mùa hè và trả lại cho nó vật chủ thân gỗ chính (anh đào) để hoàn thành thế hệ hữu tính vào mùa thu. Những con cái hữu tính (oviparae) đẻ trứng dày đặc trên cành anh đào và những con cái này nở thành những con cái sinh sản thế hệ đầu tiên (sinh sản) vào mùa xuân. Vào thời điểm các con cái của những sinh vật gốc này trưởng thành, sự phát triển mới trên cây anh đào cứng lại và không còn là nguồn thức ăn thích hợp nữa, vì vậy hầu như tất cả đều phát triển thành các dạng có cánh (alatae) phân tán để tập trung vào các cây ăn hạt thích hợp như lúa mì, yến mạch hoặc lúa mạch.','Ấn phẩm này được chuẩn bị để giúp các nhà sản xuất quản lý quần thể côn trùng bằng các phương pháp tốt nhất hiện có đã được chứng minh là thực tế trong điều kiện Kansas. Các hướng dẫn và hạn chế trên nhãn thuốc trừ sâu có thể thay đổi, và một số có thể đã thay đổi kể từ khi ấn phẩm này được viết. Các nhà côn trùng học của Đại học Bang Kansas không chịu trách nhiệm về hiệu suất của sản phẩm, thương tích cá nhân, thiệt hại tài sản hoặc các loại tổn thất khác do xử lý hoặc sử dụng các loại thuốc trừ sâu được liệt kê. Hãy nhớ rằng, sử dụng thuốc trừ sâu theo cách không phù hợp với nhãn là bất hợp pháp. Người sử dụng phải chịu trách nhiệm về việc sử dụng đúng. Luôn đọc và làm theo hướng dẫn trên nhãn một cách cẩn thận.','thumbnails/bird_cherry-oataphid.jpg',26,0,'Rệp yến mạch'),(31,'Sitodiplosis mosellana','wheat blossom midge','S. mosellana','wheat blossom midge','insect_Sitodiplosis_mosellana','Trong số 2 loài thì hoa lúa mì màu cam midge là loài gây hại chủ yếu trên cây lúa mì ở Anh. Ruồi trưởng thành có màu da cam, dài 2-3mm và rất yếu. Ấu trùng cũng có màu cam, nhỏ và dễ nhận biết. Như tên cho thấy hoa lúa mì vàng midge có màu vàng khi trưởng thành và ấu trùng. Những ấu trùng này có thể được tìm thấy khi kiếm ăn trong tai của cây trồng trong vài tuần sau khi ra hoa.','Alberta, Saskatchewan, Manitoba, nam British Columbia, Minnesota, Bắc Dakota và Idaho.','Muỗi vằn bay trong điều kiện khô ráo khi nhiệt độ trên 15 ° C. Trứng được đẻ ở bên trong các bông lúa mì có thể nở trong vòng 4-10 ngày. Khi được cho ăn đầy đủ ấu trùng sẽ thả xuống đất. Người ta cho rằng midge hoa lúa mì màu cam có thể tồn tại trong đất từ ​​10-15 năm và midge hoa lúa mì vàng lên đến 3 năm. Trong điều kiện thích hợp, ấu trùng rời kén và di chuyển lên bề mặt đất để hóa nhộng. Vào giữa mùa hè và trong điều kiện ấm áp và ẩm ướt, con trưởng thành xuất hiện từ các hộp nhộng trong đất để hoàn thành vòng đời của chúng.','Hầu hết ấu trùng vẫn nằm trong 5 cm (2 inch) trên cùng của đất, nhưng một số có thể đào sâu 10 cm (4 inch) dưới bề mặt đất. Ấu trùng quay những kén tròn có kích thước bằng một nửa hạt cải dầu kiểu Ba Lan. (Hinh 4). Ấu trùng trú đông có thể ở trạng thái ngủ đông cho đến khi có điều kiện thuận lợi để phát triển, cho dù đó là mùa xuân năm sau hay vài năm sau.','Bẫy pheromone tổng hợp có thể được sử dụng để theo dõi muỗi đực và đưa ra cảnh báo sớm về sự xuất hiện của muỗi vằn liên quan đến các giai đoạn sinh trưởng nhạy cảm của cây trồng. Con cái đẻ trứng có thể ẩn náu tốt trong tán cây trồng và ấu trùng cũng ẩn trong tai lúa mì, và cả hai đều là mục tiêu phun khó khăn. Vì vậy, để đạt được hiệu quả kiểm soát bất kỳ ứng dụng thuốc trừ sâu nào phải được áp dụng kịp thời trước khi ấu trùng chui vào giữa bọ xít và bọ phấn.','thumbnails/wheat_blossom_midge.jpg',27,0,'Ruồi lúa mì'),(32,'Penthaleus major','penthaleus major','P. major','penthaleus major','insect_Penthaleus_major','Ve hạt mùa đông có cơ thể màu nâu sẫm đến gần như đen với các chân màu cam đỏ dễ thấy. Chân trước của chúng dài hơn các chân khác, nhưng không rõ rệt như trên loài ve lúa mì nâu. Chúng cũng có hai móng vuốt ở cuối mỗi chân. Chúng khá bất thường ở chỗ chúng là loài ve duy nhất có tầm quan trọng về kinh tế trong khu vực này với lỗ hậu môn ở bề mặt trên của bụng. Hầu hết các loài ve khác có lỗ hậu môn ở mặt dưới hoặc ở đầu bụng. Đặc điểm này được nhìn thấy rõ nhất bằng kính hiển vi, nhưng có thể quan sát bằng ống kính cầm tay. Lỗ chân lông ở hậu môn xuất hiện như một đốm màu nâu đến cam trên đầu cơ thể, nhưng biến mất nhanh chóng trong rượu.','Loài ve ký sinh thực vật Penthaleus major (Dugès) xuất hiện như một loài gây hại trên cỏ lâu năm trong các cánh đồng cỏ khô ở Iceland, miền bắc Na Uy và miền nam Greenland.','Loài sinh vật gây hại cỏ này đẻ trứng từ tháng 6 đến tháng 10, và phần lớn hoạt động của loài bọ này là trong những tháng mùa đông. Hai thế hệ chồng chéo có thể xảy ra trong mùa đông với quần thể cao điểm được tìm thấy vào cuối tháng 12 và cuối tháng 2.','Khi mặt trời mọc, bọ ve đi xuống cây và tìm kiếm sự bảo vệ trên bề mặt đất ẩm dưới tán lá trong thời gian nóng bức trong ngày. Bọ ve gây hại cho cây bằng cách đục thủng các tế bào riêng lẻ, làm cho lá có màu xám bạc. Những lá bị hại nặng sẽ có đầu lá màu nâu. Nếu đất khô và có ít tán lá, bọ ve sẽ chui vào đất để tìm kiếm độ ẩm và nhiệt độ mát hơn. Nhiệt độ và độ ẩm là những yếu tố quan trọng nhất ảnh hưởng đến sự phát triển và phong phú của mạt. Nhiệt độ mát mẻ thay vì ấm áp có lợi cho sự phát triển của chúng. Hoạt động của những con ve này là lớn nhất trong khoảng từ 40º đến 70ºF. Trứng kiến ​​không nở vào mùa thu cho đến khi mưa cung cấp đủ độ ẩm. Vào những ngày khô nóng, có thể phải đào sâu vào đất 4 hoặc 5 inch để tìm ve. Những con ve dường như không bị tổn hại bởi độ ẩm cao, lượng mưa, thời gian ngắn của mưa tuyết hoặc băng bao phủ, hoặc bởi mặt đất đóng băng ở độ sâu vài inch, vào mùa thu. Tuy nhiên, mưa lớn vào mùa xuân có thể khiến quần thể bọ ve biến mất.','Khi cây đang có các triệu chứng bị hại do ăn và có thể tìm thấy một số WGM trên mỗi cây, việc sử dụng thuốc trừ sâu trên lá có thể có hiệu quả trong việc giảm số lượng mạt hạt mùa đông. Mặc dù không có thuốc diệt côn trùng nào được dán nhãn đặc biệt cho mạt hạt mùa đông, nhưng Warrior II, được dán nhãn để ức chế bọ ve ở lúa mì và lúa mạch, cũng như dimethoate được dán nhãn để kiểm soát bọ nâu (chỉ lúa mì) đã ngăn chặn quần thể WGM. Hãy chắc chắn đọc nhãn để biết tỷ lệ sử dụng và các hạn chế.','thumbnails/penthaleus_major.jpg',28,0,'Nhện'),(33,'Spider mite','longlegged spider mite','S. mite','longlegged spider mite','insect_Spider_mite','Nhện có kích thước nhỏ hơn 1 mm (0,04 in) và có nhiều màu sắc khác nhau. Chúng đẻ những quả trứng nhỏ, hình cầu, ban đầu trong suốt và nhiều loài quay thành những tấm màng tơ để giúp bảo vệ đàn khỏi những kẻ săn mồi ; họ nhận được phần \"con nhện\" trong tên thông thường của họ từ mạng lưới này.','Nhiều loài nhện ve (họ: Tetranychidae), rất phổ biến ở Bắc Mỹ, tấn công cả cây trồng trong nhà và ngoài trời. Chúng có thể phá hoại đặc biệt trong nhà kính.','Điều kiện khô nóng thường liên quan đến sự tích tụ quần thể của bọ ve nhện. Trong điều kiện tối ưu (khoảng 27 ° C), nhện hai đốm có thể nở trong vòng 3 ngày và trưởng thành về mặt giới tính trong vòng ít nhất là 5 ngày. Một con cái có thể đẻ tới 20 quả trứng mỗi ngày và có thể sống từ 2 đến 4 tuần, đẻ hàng trăm quả trứng. Tốc độ sinh sản nhanh này cho phép các quần thể bọ xít nhện thích nghi nhanh chóng để kháng thuốc trừ sâu , vì vậy các phương pháp kiểm soát hóa học có thể trở nên kém hiệu quả khi cùng một loại thuốc trừ sâu được sử dụng trong thời gian dài. Spider mạt, như hymenopterans và một số côn trùng quy mô , là arrhenotochous : nữ là lưỡng bội và con đực đơn bội . [4] Khi giao phối, con cái tránh sự phân chia một số trứng để tạo ra con đực. Trứng được thụ tinh tạo ra con cái lưỡng bội. Những con cái chưa được giao phối, chưa được thụ tinh vẫn đẻ trứng chỉ có nguồn gốc từ những con đực đơn bội .','','Kiểm soát văn hóa: Nếu sự xâm nhập của bọ nhện được phát hiện đủ sớm, phun sương hàng ngày hoặc phun nước có thể là biện pháp kiểm soát hiệu quả.Thuốc trừ sâu: Việc sử dụng thuốc trừ sâu ăn lá trong thời tiết khô nóng có thể gây bùng phát bọ xít nhện bằng cách giết chết các động vật chân đốt có ích thường ăn bọ ve. Ngoài ra, nấm bệnh tấn công bọ nhện sau thời tiết ẩm ướt, mát mẻ. Một số loại thuốc diệt nấm có thể loại bỏ loại nấm này và nên tránh sử dụng trong vài tuần nếu cây bị nhiễm bệnh và các tình trạng như vậy xảy ra.\n\nCác giai đoạn nghỉ ngơi và trứng của nhện hai đốm có khả năng chống chịu với thuốc trừ sâu hơn so với các dạng di động. Do đó, có thể cần phải phun thuốc trừ sâu lần thứ hai vào khoảng thời gian 4 hoặc 5 ngày khi thời tiết nóng (7 đến 10 ngày trong thời tiết mát mẻ) để tiêu diệt những con mạt có thể còn sống sót sau lần bón đầu tiên. Để biết các khuyến nghị kiểm soát hóa chất cụ thể, hãy tham khảo ý kiến ​​của Dịch vụ Khuyến nông Hợp tác .','thumbnails/longlegged_spider_mite.jpg',29,0,'Nhận chân dài'),(34,'Haplothrips aculeatus (grass thrips)','wheat phloeothrips','H. aculeatus','wheat phloeothrips','insect_Haplothrips_aculeatus_(grass_thrips)','Cơ thể của nó màu đen, dài 2 mm, con đực nhỏ hơn con cái. Trứng có hình trứng và trong mờ, ấu trùng có màu đỏ cam, dài 1,8 mm. Nhộng có màu giống với ấu trùng và dài 1,7 mm.','Ở châu Âu, loài này được biết đến từ các khu vực thảo nguyên cho đến vùng núi. Nó thường được tìm thấy trên ngũ cốc, nhưng rõ ràng nó thích lúa mạch đen hơn.','hi nhiệt độ tăng thì vòng đời của bọ trĩ càng ngắn. Cụ thể, nhiệt độ trung bình của đợt nuôi thứ I là 22,83ºC thời gian vòng đời trung bình của F. intonsa là 19,96 ngày (pha trứng là 6,11 ngày; bọ trĩ non tuổi 1 là 3,00 ngày; bọ trĩ non tuổi 2 là 4,14 ngày;\ntiền nhộng là 1,82 ngày; nhộng giả là 2,50 ngày và thời gian từ trưởng thành đến khi đẻ\ntrứng là 2,39 ngày).\nTrong khi đó khi nhiệt độ trung bình cao hơn, ở 25,08ºC, thời gian vòng đời trung bình của\nloài F. intonsa là 17,71 ngày (pha trứng là 6,14 ngày; bọ trĩ non tuổi 1 là 2,36 ngày; bọ trĩ non\ntuổi 2 là 4,14 ngày; tiền nhộng là 1,64 ngày; nhộng giả là 1,75 ngày và thời gian từ trưởng thành\nđến khi đẻ trứng là 1,68 ngày).','Nó hình thành một thế hệ mỗi năm và qua mùa đông khi trưởng thành trong tàn dư thực vật của những cây bị tấn công. Con trưởng thành và sâu non cư trú ở lớp phủ của chiếc lá cuối cùng, chúng đẻ trứng và kiếm ăn bằng các cơ quan tai, bằng hoa và hạt non. Sự phát triển của một thế hệ từ khi đẻ trứng mất 50-56 ngày.','Cày sâu 20-25 cm đảm bảo biến mất 90% ấu trùng bám vào tàn dư thực vật trong đất.Xử lý hóa chất với các sản phẩm được chứng nhận khác nhau như Actara (0,02%), Biscaya 240 OD (0,16 l / ha), Faster 10 CE (0,15 l / ha), Fury 10 CE (0,1 l / ha), Kaiso Sorbie 5 WG (0,15 kg / ha) v.v.','thumbnails/wheat_phloeothrips.jpg',30,0,'Rệp lúa mì'),(35,'Wheat Stem Sawfly','wheat sawfly','Sawfly','wheat sawfly','insect_Wheat_Stem_Sawfly','Một con chuồn chuồn trưởng thành có màu đen bóng với ba dải màu vàng xung quanh bụng. Các chân có màu vàng. Những bộ cánh nhuốm màu \"khói\". Con trưởng thành có chiều dài khoảng 8 đến 13 milimét (mm) (5/16 -1/2 Inch) và có đặc điểm là không hoạt động, thường thấy nằm trên thân cây lúa mì với đầu hướng xuống dưới.Trứng dài khoảng một mm, màu trắng sữa và hình lưỡi liềm. Chúng mất khoảng năm đến tám ngày để nở. Ấu trùng có màu kem, nhăn nheo và có hình chữ S mạnh mẽ hơn (Hình 4) so ​​với các ấu trùng côn trùng đục thân khác (ví dụ như giòi thân lúa mì) khi tách khỏi thân. Chúng có đầu màu nâu và hình chiếu cùn ngắn ở phần đuôi. Khi trưởng thành, ấu trùng có thể đạt chiều dài khoảng 13 mm (1/2 in).','Châu Âu, các vùng của Châu Á, Canada và Bắc Mỹ','Ruồi cưa thân lúa mì chỉ có một thế hệ mỗi năm. Mặc dù con trưởng thành tồn tại tương đối ngắn (từ bảy đến 10 ngày), sự xuất hiện của con trưởng thành xảy ra trong một thời gian dài, thường là khoảng ba tuần nhưng đôi khi dài đến một tháng.Lần xuất hiện đầu tiên thường là vào giữa đến cuối tháng 6 ở Bắc Dakota. Bướm cưa cái gửi trứng vào thân dài của cây ký chủ vào đầu mùa hè (Hình 8) , và ấu trùng phát triển ăn mô thân và di chuyển lên xuống theo chiều dài của thân. Mặc dù một số trứng có thể được đẻ trong một thân cây, nhưng chỉ có một ấu trùng duy nhất sống sót đến khi trưởng thành.Thời gian chờ bị phá vỡ khi nhiệt độ, độ ẩm và / hoặc chu kỳ quang tăng vào mùa xuân. Quá trình phát triển sau khi chết bao gồm giai đoạn tiền trưởng thành và giai đoạn nhộng kéo dài khoảng 20 đến 30 ngày, tùy thuộc vào nhiệt độ môi trường xung quanh. Con trưởng thành chui ra khỏi kén và dùng các răng hàm dưới để thoát ra khỏi phần cuống thông qua phần đầu đã được cắm sẵn.','Sau khi hoàn thành quá trình phát triển và thoát ra khỏi nhộng, con trưởng thành nhai và đẩy qua thân cây đã cắm, xuất hiện từ giữa tháng 6 đến đầu tháng 7. Con đực xuất hiện trước, với con cái bắt đầu xuất hiện sau đó vài ngày. Họ có xu hướng ở gần khu vực mà họ xuất hiện bởi vì họ là những người bay yếu. Nếu thời tiết mát mẻ, ẩm ướt xảy ra trong thời kỳ trỗ thì thời kỳ trỗ được kéo dài. Điều kiện ẩm ướt cũng giúp làm mềm phích cắm trên thân cây cho phép ruồi cưa trưởng thành xuất hiện dễ dàng hơn.','Thuốc trừ sâu nói chung không có hiệu quả đối với ruồi cưa thân lúa mì. Các giai đoạn trứng, sâu non và nhộng được bảo vệ tốt bên trong thân cây.Việc phun thuốc cho con trưởng thành không thành công vì con trưởng thành mới xuất hiện có thể di chuyển vào ruộng đã được phun thuốc, thời gian xuất hiện của ruồi cưa quá dài và con trưởng thành xuất hiện sau khi phun thuốc đã giảm tiếp xúc với thuốc trừ sâu. Người lớn không cho ăn hoặc uống nước, điều này giúp giảm thiểu việc tiếp xúc với thuốc diệt côn trùng.\n\nNhìn chung, thuốc trừ sâu không hiệu quả trong việc kiểm soát ruồi đục thân lúa mì; tương đối tốn kém đối với một loại cây trồng có giá trị thấp, diện tích lớn như lúa mì; và gây hại cho các quần thể ký sinh trùng có ích.','thumbnails/wheat_sawfly.jpg',31,0,'Ong bắp cài lúa mì'),(36,'Agromyzidae','cerodonta denticornis','Agromyzidae','cerodonta denticornis','insect_Agromyzidae','Một họ trên  toàn thế giới với khoảng 2.500 loài, chúng nhỏ, một số có cánh dài 1 mm. Kích thước tối đa là 6,5 mm. Hầu hết các loài có kích thước từ 2 đến 3 mm.Các agromyzid trưởng thành có thể được nhận biết bởi sự xơ cứng đặc biệt của đầu. Phần trên của các vây , phía trên đường khâu lỗ chân lông (được gọi là thủy tinh thể phía trước ) bị xơ cứng nhẹ và không có nốt sần , trong khi phần dưới của các vây và vùng lưng của đầu có xu hướng bị xơ cứng và đóng cặn nhiều hơn. Vì vậy, thủy tinh thể trán thường tạo thành một mảng đặc biệt trên đầu, khác biệt về màu sắc và kết cấu so với phần còn lại của đầu. Các mắt kép thường hình bầu dục và khá nhỏ, mặc dù trong một số loài, họ lớn hơn và tròn hơn.Các cánh thường hủy của , mặc dù những người của một vài loài nhiệt đới có đậm dấu. Một vài loài, bao gồm tất cả agromyza spp., Có khả năng stridulation , sở hữu một \"tập tin\" vào ngày đầu tiên bụng phân khúc và một \"cạo\" trên chân sau xương đùi . Họ Agromyzidae thường được gọi là ruồi đục khoét lá, vì thói quen kiếm ăn của ấu trùng của chúng , hầu hết chúng đều là những con sâu đục khoét lá trên nhiều loại cây khác nhau.','Bắc, Trung Mỹ và Caribê,','Giao phối bắt đầu trên không và kết thúc trên mặt đất, nơi con cái sau đó đẻ một khối trứng đôi khi có chất bài tiết bóng hay trắng như phấn, hỗ trợ giữ nước. Trứng được đẻ thành các khối có từ 100 đến 1000 trứng trên một bề mặt thẳng đứng treo trên mặt nước hay nền đất ướt thuận lợi cho ấu trùng phát triển. Trứng nở trong vòng 5-7 ngày. Chúng ngủ đông trong giai đoạn ấu trùng và phát triển thành nhộng vào mùa xuân và đầu mùa hè. \nVòng đời của con trưởng thành là 30 đến 60 ngày.','Ấu trùng Agromyzidae là loài thực vật ăn thực vật , kiếm ăn như những kẻ khai thác lá, ít thường xuyên hơn là những con sâu đục khoét thân hoặc sâu đục thân. Một số ít sống bằng hạt đang phát triển, hoặc tạo ra túi mật . Đôi khi ấu trùng ở rễ hoặc dưới vỏ cây. Sinh học của nhiều loài vẫn chưa được biết. Có một mức độ đặc hiệu cao đối với vật chủ , một ví dụ là Phytomyza ilicis , loài khai thác lá nhựa ruồi châu Âu không ăn các loài khác','Do có nhiều loại ký sinh trùng phổ biến, sâu vẽ bùa nói chung không phải là loài gây hại nghiêm trọng. Tuy nhiên, chúng có thể gây ra những thiệt hại lẻ tẻ. Việc tiêu diệt các loài thiên địch bằng cách sử dụng thường xuyên các loại thuốc trừ sâu được áp dụng để kiểm soát các loài gây hại khác có thể làm bùng phát sâu vẽ bùa. Trong số rất nhiều loại ký sinh trùng tấn công sâu vẽ bùa ở California, ong bắp cày, Solenotus trung gian, là loài có nhiều nhất trong khi Diglyphus spp. và Chrysocharis spp. có lẽ là quan trọng nhất để kiểm soát sâu vẽ bùa. Môi trường sống của thực vật thu hút các loài thiên địch và tránh sử dụng các loại thuốc trừ sâu phổ rộng gây hại cho các loài thiên địch.','thumbnails/cerodonta_denticornis.jpg',32,0,'Ong rùi'),(37,'Pegomya hyoscyami','beet fly','P. hyoscyami','beet fly','insect_Pegomya_hyoscyami','là một loài ruồi màu xám dài khoảng 6 mm (0,24 in). Nó xuất hiện vào tháng 4 - tháng 5 và đẻ trứng ở mặt dưới của lá củ cải đường , rau bina , cải bẹvà các loại rau xanh khác. Trứng phát triển thành ấu trùng chui vào lá làm rỗng các mảng lớn giữa các bề mặt lá, thường làm chết các phần lớn của lá.','Nam Mỹ, Châu Âu, Châu Phi, Châu Á, Châu Đại Dương','Hai đến năm quả trứng hình trụ màu trắng được đẻ ở mặt dưới của lá và nở từ bốn đến sáu ngày sau đó. Ấu trùng chui vào lá tạo ra một vệt mỏng lúc đầu và cuối cùng là một vết hoặc \"vết phồng rộp\". Ấu trùng trưởng thành từ bảy đến mười sáu ngày sau đó và thả xuống đất nơi chúng thành nhộng. Sâu non có thể di chuyển từ lá này sang lá khác trước khi xâm nhập vào đất. Sâu non cũng có thể hóa nhộng trong chính lá. Con ruồi trưởng thành xuất hiện sau hai đến bốn tuần và lặp lại chu kỳ, tạo ra nhiều thế hệ mỗi năm.','Ruồi, còn được gọi là sâu đục khoét lá củ cải, hoạt động mạnh vào tháng 4 và đầu tháng 5 và đẻ trứng ở mặt dưới của lá, nơi giòi nở ra và chui vào lá.','Kiểm soát là văn hóa, tạo rào cản bằng cách sử dụng các lớp phủ hàng nổi hoặc loại bỏ sâu bệnh ngay khi chúng xuất hiện và tiêu hủy các lá bị hại ra khỏi khu vực. Có thể dùng bẫy dính màu vàng để bẫy con trưởng thành. Thuốc trừ sâu không hiệu quả vì giai đoạn dễ bị tổn thương, giòi, được bảo vệ bên trong lá.','thumbnails/beet_fly.jpg',33,0,'Rùi củ cải'),(38,'Flea beetle','flea beetle','F. beetle','flea beetle','insect_Flea_beetle','Những con trưởng thành thuộc họ Chrysomelidae có kích thước rất nhỏ đến vừa phải (tức là trong số các loài bọ cánh cứng nói chung chúng có phần hơi nhỏ). Họ cũng giống như bọ cánh cứng lá khác, nhưng đặc trưng có chân sau xương đùi mở rộng đáng kể. Những cái mở rộng này cho phép các loài côn trùng này hoạt động khi bị quấy rầy. Bọ chét cũng có thể đi lại bình thường và bay. Nhiều bọ chét có màu sắc hấp dẫn; màu tối, sáng bóng và thường là kim loại chiếm ưu thế.Bọ chét trưởng thành ăn thực vật bên ngoài, ăn bề mặt của lá, thân và cánh hoa. Khi cho ăn nhiều, các lỗ tròn nhỏ do một con bọ chét ăn vào có thể liên kết lại thành các vùng tổn thương lớn hơn. Một số ấu trùng bọ chét (ví dụ như loài Phyllotreta ) là loài ăn rễ.','Bọ chét hoa cải và bọ chét sọc đều được du nhập từ Âu-Á và là những loài gây hại đáng kể. Theo truyền thống, bọ chét sọc phổ biến hơn ở các khu vực phía bắc của Canada và bọ chét cây thập tự phổ biến hơn ở các khu vực phía nam, cũng như loài phổ biến nhất trên khắp miền tây Canada. Tuy nhiên, phạm vi và quần thể bọ chét sọc đã tăng lên đáng kể trong vài thập kỷ qua, trở thành loài bọ chét thường xuyên gặp nhất ở trung tâm Alberta, trung tâm Saskatchewan và phần lớn Manitoba','Bọ chét sống qua mùa đông khi trưởng thành trong thảm lá, hàng rào, hàng rào chắn gió và các khu vực có cây cối rậm rạp.Bọ chét trưởng thành hoạt động mạnh vào đầu mùa xuân. Tùy thuộc vào loài, con cái đẻ trứng đơn lẻ hoặc thành cụm trong các lỗ nhỏ, trong rễ, đất hoặc lá của nhiều loại rau cũng như đôi khi trên hoa và cây bụi trang trí và cây cối.\n\nẤu trùng nhỏ màu trắng nở ra từ trứng và ăn rễ của cây con mới trồng.\n\nSau đó ấu trùng biến đổi thành nhộng trong lòng đất. Thường có một đến hai thế hệ mỗi năm.','Hầu hết bọ chét ăn các loại cây rất cụ thể, nhưng bọ chét màu xanh lá cây ( Systena blanda ) ăn nhiều loại cây khác nhau, như bí, đậu, ngô, hoa hướng dương, rau diếp, khoai tây và nhiều loại cỏ dại.','Đặt bẫy dính màu vàng trong vườn của bạn để xem bạn có bọ chét hay không.Kiểm tra cây trồng của bạn để tìm bọ chét và thiệt hại của chúng.\nNgăn ngừa thiệt hại nghiêm trọng cho cây của bạn bằng cách xử lý cây con khi có hơn năm con bọ chét trên mỗi cây.\nBảo vệ cây trồng của bạn nếu 10-30% lá trên cây con và cây cấy bị rụng.','thumbnails/flea_beetle.jpg',34,0,'bọ chét'),(39,'Spodoptera eridania','cabbage army worm','S. eridania','cabbage army worm','insect_Spodoptera_eridania','Bướm đêm bắp cải đẻ trứng hình vòm, đơn lẻ ở mặt dưới của các lá già. Một con cái có thể đẻ từ 275 đến 350 trứng. Trứng sẽ sẫm màu khi chúng già đi và sẽ nở sau 2 đến 5 ngày. Ấu trùng có màu xanh lục nhạt và có một sọc trắng đặc biệt dọc theo mỗi bên của cơ thể.','Các S. eridania được tìm thấy trong Bắc Mỹ (phía nam tiểu bang Hoa Kỳ như xa về phía tây như Kansas và New Mexico ), thông qua vùng biển Caribbean và Trung Mỹ vào Nam Mỹ (thông qua Brazil để Argentina ).','Ấu trùng có màu xanh lục nhạt với một sọc trắng nhạt dọc theo mỗi bên và hai sọc trắng mỏng ở lưng. Cơ thể thuôn về phía đầu. Có ba đôi chân mảnh ở gần đầu và hai đôi chân hình chùy hướng về đầu kia. Khi trưởng thành, ấu trùng đạt chiều dài 1-1 / 2 inch. Trứng hình tròn, màu trắng, có vân, thường được đẻ đơn lẻ ở mặt dưới của các lá bên ngoài. Nhộng có màu nâu, dài khoảng 3/4 inch và được bọc trong một cái kén mỏng manh bằng những sợi chỉ rối màu trắng. Bướm đêm trưởng thành là loài bướm đêm có đốm, màu nâu xám với sải cánh dài 1-1 / 2 inch và một đốm nhỏ màu bạc giống như một chiếc tất ở giữa mỗi cánh trước. \n\nVì ấu trùng không có chân ở vùng giữa cơ thể nên vùng này cong lên khi côn trùng di chuyển. Tất cả các giai đoạn ấu trùng của côn trùng đều di chuyển theo chuyển động lặp lại này. Sâu non lớn thường sẽ cuộn tròn lại và thả xuống gốc cây khi lá bị xáo trộn. Khi chúng phát triển, chúng di chuyển về phía trung tâm của cây. Chúng thường ăn các khu vực giữa các gân lá.','Ấu trùng là động vật làm rụng lá và kiếm ăn như đồng loại khi còn non, thường xuyên tạo xương trên lá. Khi trưởng thành, chúng trở nên đơn độc, và cũng dễ dàng đâm chồi thành quả, thường làm hỏng cà chua ở Florida. Nó có thể dẫn đến tổn thất năng suất đáng kể nếu không được kiểm soát. [4] Khi bị căng thẳng do thiếu thức ăn, chúng sẽ ăn phần đỉnh của cành, đục sâu vào mô thân và tấn công các củ gần bề mặt đất.','Dầu neem nguyên chất đã được phát hiện là chất chống cảm cúm hiệu quả nhất vào năm thứ ba. Dầu neem nguyên chất và azatrol là chất ngăn chặn thức ăn hiệu quả nhất đối với lứa thứ hai và thứ tư của sâu mọt quân phương nam. Mặc dù các sản phẩm này hoạt động theo kinh nghiệm trong phòng thí nghiệm, nhưng người ta thấy rằng mức độ ảnh hưởng tiêu cực đến tỷ lệ chết của ấu trùng và khả năng sinh thái của nhộng khác nhau đáng kể giữa các loại thuốc trừ sâu có nguồn gốc từ neem được thử nghiệm.','thumbnails/cabbage_army_worm.jpg',35,0,'sâu bắp cải'),(40,'Beet armyworm','beet army worm','S. exigua','beet army worm','insect_Beet_armyworm','Con trưởng thành là một con bướm đêm màu nâu xám hoặc xám với sải cánh dài 26–32 mm (1– 1+1 ⁄ 4  in). Cánh trước có màu xám đục, rửa sạch có màu vàng xỉn và có vảy đen. Các đường bên trong và bên ngoài là đôi, không rõ ràng, được tô màu vàng nhạt. Bóng tối ở giữa có dải phân cách có thể nhìn thấy trước nửa dưới của đường bên ngoài. Tế bào màu nâu sẫm. Vòi nhụy hình cầu có màu nhạt hoặc vàng tươi, và hình tròn, trong khi bầu dục có hình ống cong màu nâu ở trung tâm. Đường phụ có màu xám nhạt. Có bóng tối trước nó với các vệt tối giữa các đường gân. Các điểm đầu cuối có màu đen. Đá bán nguyệt của Hindwings có màu trắng, với các đường vân màu nâu sẫm. Cả ba lề đều được tô bằng màu khó hiểu.Sâu non có màu nâu hồng, vón cục màu đen. Đường xoắn ốc màu trắng đục, có mép trên sẫm màu. Chúng là những con sâu xanh có màu nâu xanh, thân mềm và phình ra với những sọc dọc sẫm màu','Nó có nguồn gốc từ châu Á, nhưng đã được giới thiệu trên toàn thế giới và hiện nay được tìm thấy ở hầu hết mọi nơi có nhiều cây chủ được trồng.','Trứng: Trứng được đẻ thành từng chùm từ 50 đến 150 trứng mỗi khối. Sản lượng trứng bình thường là khoảng 300 đến 600 mỗi con cái. Trứng thường nằm ở mặt dưới của lá, và thường ở gần hoa và đầu cành. Các quả trứng riêng lẻ có hình tròn khi nhìn từ trên xuống, nhưng khi nhìn từ bên cạnh, quả trứng hơi có đỉnh, thuôn nhọn. Trứng có màu từ xanh lục đến trắng và được bao phủ bởi một lớp vảy màu trắng làm cho khối trứng có vẻ ngoài mờ hoặc bông. Trứng nở sau hai đến ba ngày khi thời tiết ấm áp.\n\nẤu trùng: Thông thường có năm cá thể, mặc dù đôi khi các cá thể bổ sung được báo cáo. Thời gian của các hình ảnh trong điều kiện ấm áp (mùa hè) được báo cáo lần lượt là 2,3, 2,2, 1,8, 1,0 và 3,1 ngày (Wilson 1932) và ở 30 ° C thời gian phát triển không đổi được báo cáo bởi Fye và McAda (1972) tương ứng là 2,5, 1,5, 1,2, 1,5 và 3,0 ngày. Chiều rộng đầu nang trung bình lần lượt là 0,25, 0,45, 0,70, 1,12 và 1,80 mm.Con trưởng thành: Bướm đêm có kích thước vừa phải, sải cánh từ 25 đến 30 mm. Các cánh trước có màu xám và nâu lốm đốm, bình thường có dạng dải không đều và đốm hình hạt đậu màu sáng. Các cánh sau có màu xám hoặc trắng đồng đều hơn và được trang trí bằng một đường sẫm màu ở rìa. Sự giao phối xảy ra ngay sau khi bướm đêm xuất hiện, và sự đẻ trứng bắt đầu trong vòng hai đến ba ngày. Thời gian đẻ trứng kéo dài trong khoảng thời gian từ ba đến bảy ngày, và những con bướm đêm thường chết trong vòng từ chín đến 10 ngày sau khi xuất hiện. Heppner (1998) cung cấp chìa khóa cho những con trưởng thành của Spodoptera Bắc Mỹ .','Hoạt động theo mùa thay đổi đáng kể theo khí hậu. Ở những nơi ấm áp như Florida, tất cả các giai đoạn có thể được tìm thấy trong suốt cả năm, mặc dù tốc độ phát triển và sự phong phú tổng thể bị giảm trong những tháng mùa đông (Tingle và Mitchell 1977). Vòng đời có thể hoàn thành trong vòng 24 ngày, và sáu thế hệ đã được nuôi trong năm tháng thời tiết mùa hè ở Florida (Wilson 1934).','Bẫy pheromone và gắp côn trùng bằng tay cơ học đối với những con trưởng thành và sâu bướm được sử dụng rộng rãi. Các loài ký sinh trùng như Chelonus insularis , Cotesia marginiventris , Meteorus autographae , Lespesia archippivora đẻ trứng trên sâu bướm, ấu trùng của chúng kiếm ăn và xuất hiện. Các loài ăn thịt như Orius sp., Geocoris sp., Nabis sp., Podisus maculiventris cũng là biện pháp phòng trừ hiệu quả. Các giai đoạn của đồng tử có thể được loại bỏ bằng cách đưa Solenopsis invicta vào ruộng.Ngoài biện pháp kiểm soát sinh học, nhiều loại thuốc trừ sâu hóa học được sử dụng rộng rãi. Ấu trùng dễ bị ảnh hưởng bởi các sản phẩm neem . Trứng có thể bị giết bằng cách sử dụng nồng độ dầu mỏ. Bôi dầu hạt bông lên lá có thể diệt được cả trứng và ấu trùng.','thumbnails/beet_army_worm.jpg',35,0,'Bọ cánh cứng'),(41,'Tetanops myopaeformis','Beet spot flies','T.myopaeformis','Beet spot flies','insect_Tetanops_myopaeformis','Ruồi trưởng thành có màu xám đen, dài 6-9 mm và có 4 sọc đen kéo dài trên tấm lưng của các đốt ngực.','Là loài phân bố rộng, hại cây trồng ở Mỹ, Trung Quốc, Đông Nam Á, và nhiều nước khác.','Vòng đời của chúng trải qua 4 giai đọan: trứng, dòi, nhộng và ruồi trưởng thành. Tùy thuộc vào nhiệt độ môi trường mà từ trứng nở thành ruồi trưởng thành thường mất từ 3 – 5 ngày. Ruồi trưởng thành có đời sống khoảng 1-2 tháng, ở điều kiện thích hợp có thể sống đến 3 tháng.','Kiểu miệng liếm hút. Cả ruồi đực và cái đều ăn tất cả thức ăn, rác rưởi, chất thải của người và cả phân động vật. Nước là chất thường ngày không thể thiếu của ruồi, ruồi sẽ chết nếu sau 48 giờ không hút nước. Một ngày ruồi cần ăn 2-3 lần, họat động chủ yếu vào ban ngày khi chúng ăn và giao phối, về đêm bình thường ruồi đậu yên. Ban ngày, khi không tìm thức ăn, ruồi thường trú đậu ở sàn nhà, tường, trần nhà, cũng như ngoài bờ rào, gần nhà xí, thùng rác, dây phơi quần áo, thảm cây thấp … Ruồi thường tập trung ở các điểm tìm kiếm thức ăn, nơi giao phối, nơi đẻ trứng và nơi trú đậu. Ban đêm ruồi ưa đậu ở trần nhà và những cấu trúc treo cao khác, nhìn chung gần với nơi kiếm ăn, nơi đẻ và tránh được gió.','Q Ruồi đục lá (Liriomyza Sativaza Blanchard) là loài đa thực, phổ ký chủ rộng, gây hại nhiều loài cây trồng. Ruồi đục lá đục ăn mô lá làm giảm khả năng quang hợp, làm cho cây cằn vàng, cằn cỗi, lá rụng sớm đẫn đến làm giảm năng suất, chất lượng sản phẩm. Ngoài ra vết thương của lá giòi đục sẽ tạo điều kiện cho nấm và vi khuẩn sâm nhập phát sinh và phát triển gây hại làm rụng lá, chết cây. Sự gây hại của chúng rất nghiêm trọng, làm giảm hiệu quả kinh tế trong trồng nên ta phải tìm biện pháp thích hợp để phòng chống chúng vì việc nghiên cứu về các đặc điểm của loài ruồi đục lá rất cần thiết.','thumbnails/Beet_spot_flies.jpg',36,0,'Ruồi đốm'),(42,'Loxostege sticticalis','meadow moth','L. sticticalis','meadow moth','insect_Loxostege_sticticalis','vảy rìa cánh trước màu đen, tương phản với dải mỏng màu vàng nhạt dọc theo rìa ngoài; màu mặt đất nâu vàng với các mô hình chắp vá của các đốm sáng và tối; Đường PM rất lượn sóng, với một vùng nhạt cách xa đường nơi nó gặp mặt cắt; ở phần còn lại, phác thảo của bướm đêm là hình tam giác.Khoảng cánh: 2,4-2,9 cm','Manitoba đến Texas và về phía tây; lẻ tẻ về phía đông đến các bang New England','Trứng được đẻ thành từng chùm trên nhiều loại cây thân thảo thường nở trong vòng 5-10 ngày.Những con sâu bướm (ấu trùng) được đánh dấu rõ ràng ăn nhiều loại thân thảo và thường được nhìn thấy vào ban ngày.\n\nSâu bướm phát triển hoàn toàn trong vòng ba mươi ngày khi chúng thường được nhìn thấy vào ban ngày trên cây thức ăn của ấu trùng.\n\nNhững con sâu bướm chuẩn bị hóa nhộng và qua mùa đông trong một cái kén quay vòng giữa các lớp thực vật và lá.\n\nNhững con bướm đêm đầu tiên xuất hiện vào đầu tháng Năm.','Sâu bướm phát triển chiều dài lên đến 40 mm.Cơ thể có thể thay đổi màu sắc từ màu nâu nhạt đến gần như đen với những đám lông màu nâu gỉ.\n\nĐường đứt đoạn của các mảng màu trắng ở lưng và đường xoắn phụ màu trắng gợn sóng với các đốm đỏ / cam là đặc biệt.\n\nSâu bướm đuôi nâu, có lông màu nâu đặc biệt hấp dẫn, đôi khi bị nhầm lẫn với sâu bướm Knot Grass.Sâu bướm ăn nhiều loại cây thân thảo thấp bao gồm cây cỏ, bến tàu và cỏ nút, cũng như cây bìm bịp, cây bìm bịp và cây táo gai.Khi đã trưởng thành hoàn toàn, sâu bướm sẽ hóa nhộng và mùa đông trong một cái kén xoay tròn giữa cây và lớp lá.','Khi có dấu hiệu đầu tiên của sự phá hoại của sâu bọ, hãy xử lý bãi cỏ của bạn bằng Ortho® BugClear ™ Insect Killer for Grassns & Landscapes Concentrate . Nó có thể được sử dụng trong bình xịt hoặc kết nối với ống của bạn bằng Máy phun kết thúc vòi phun Ortho® Dial N \' . Nó sẽ bắt đầu giết sâu web, cũng như các loại côn trùng được liệt kê khác, trong vòng vài phút.','thumbnails/meadow_moth.jpg',37,0,'Bướm'),(43,'Tanymecus palliatus','beet weevil','T.palliatus','beet weevil','insect_Tanymecus_palliatus','Psalidium maxillosum là 6-10 mm dài. Các cơ thể là màu đen hoặc đen-xám nâu và sáng bóng; các cánh được không phát triển. Một thế hệ phát triển trong hai năm. Các mọt thiệt hại lênđến 130 loài của thực vật, trong đó, củ cải. Các con bọ cánh cứng gây ra các chính thiệt hại; các ấu trùng thức ăn chăn nuôi trên các rễ của nhiều loài thực vật, chủ yếu là cỏ dại.','Loài Palaearctic phổ biến này xuất hiện khắp Châu Âu và Tiểu Á, kéo dài về phía bắc đến Vương quốc Anh và các tỉnh miền trung của Fennoscandia và phía đông qua Nga và Ukraine đến Trung Siberia, nơi nó mở rộng trên Vòng Bắc Cực, ở đây nó phổ biến mặc dù rất địa phương và thường hiếm qua Wales và miền nam và miền trung nước Anh và có một vài bản ghi rải rác xa hơn về phía bắc đến biên giới Scotland.','Những con mọt ăn lá trưởng thành dài khoảng 1/2 inch, và đầu của chúng hơi thu hẹp về phía đỉnh thành một cái mõm rộng. Đây là đặc điểm điển hình của nhóm côn trùng mọt (hay còn gọi là bọ mõm).Mọt ăn lá có màu nâu lốm đốm đến xám nâu (Hình 1) , và cơ thể của chúng được bao phủ bởi các cấu trúc hình phút, màu xám, giống như lông. Vì loài mọt này là loài gây hại củ cải đường hiếm gặp và nó chưa được báo cáo về các loại cây trồng khác trong khu vực, nên rất ít thông tin về sinh học hoặc cách kiểm soát của chúng.Các nhà nghiên cứu tin rằng côn trùng này sinh sống khi trưởng thành trong đất hoặc trong tàn dư thực vật. Những con mọt trưởng thành xuất hiện vào mùa xuân và giao phối, còn con cái sau đó gửi trứng vào các mô của cây chủ. Các cây ký chủ được biết đến bao gồm cây cỏ heo, sò huyết, hướng dương dại và các loài cỏ phấn hương.\n\nẤu trùng (đuông chưa trưởng thành) được cho là ăn những cây này cho đến khi chúng phát triển thành con trưởng thành. Sau đó, những con trưởng thành lại phá hoại những vật chủ này hoặc đôi khi lại phá hoại những cây củ cải đường lân cận. Không thấy ấu trùng ăn củ cải đường.','Bothynoderes punctiventris có một màu xám cơ thể 10-16 mm dài. Nó tạo ra một thế hệ mỗi năm. Các con bọ cánh cứng ngủ đông trong những đất. Trước khi các củ cải nảy mầm, các mọt ăn trên hoang nhà máy của các gia đình Chenopodiaceae; sau đó chúng tấn công các cánh đồng củ cải đường . Các người lớn bọ cánh cứng ăn các lá mầm, nhai qua nhỏ thân cây, và đôi khi làm hỏng phần của các nhà máy mà đã không đẩy thông qua các đất bề mặt. Các mầm đang mỏng đi ra ngoài, và toàn bộ các lĩnh vực được đôi khi hoàn toàn bị phá hủy. Các con bọ cánh cứng là đặc biệt phàm ăn trong nóng và khô thời tiết. Các ấu trùng thiệt hại các của củ cải gốc hệ thống. Cây non thường chết; hơn phát triển các nhà máy tụt hậu đằng sau trong tăng trưởng và khô héo, những củ lấy trên biến dạng hình dạng, và các trọng lượng và đường nội dung được giảm.','Kiểm soát các biện pháp bao gồm các sử dụng của cắt xén kỹ thuật để tiêu diệt cỏ dại và thúc đẩy tốt tăng trưởng và phát triển của các cây trồng, bẫy mương xung quanh cũ và mới củ cải lĩnh vực, preplanting điều trị của hạt giống bằng cách kết hợp hạt xử, và các phun của các lĩnh vực với thuốc trừ sâu.','thumbnails/beet_weevil.jpg',37,0,'Bọ cánh cứng'),(44,'Phaeochrous emarginatus','sericaorient alismots chulsky','P. emarginatus','sericaorient alismots chulsky','insect_Phaeochrous_emarginatus','Đầu màng trắng đục, vảy vàng, chân có màu đen. Tùy vào môi trường và điều kiện sinh sống mà màu sắc cơ thể của chúng sẽ biến đổi da dạng để thích nghie. Điểm chung của hầu hết loại bọ cánh cứng là chúng có một chiếc miệng rộng to lớn và hàm răng sắc bén. Điều này giúp chung săn bắt và giữ chắc con mồi một cách thuận tiện  hơn.\n\nĐôi cánh là lá chăn kiên cố giúp chúng chống đỡ lại các cuộc tấn công từ phía đối thủ. Cùng với đó là cặp sừng to cứng giúp việc nhận biết bọ cánh cứng được dễ dàng hơn.','Đồng bằng Sông Cửu Long PHáp, Bỉ, Anh và Đức','Vòng đời của chúng dao động từ 110 - 250 ngày, gồm 4 giai đoạn Trứng có màu trắng vàng, hình bầu dục, đường kính 3 mm, khoảng 4-5 ngày sau khi đẻ, trứng chuyển thành màu trắng nâu, những quả trứng mềm và thon dài ban đầu sẽ mở rộng thành hình một quả cầu (quả bóng) (Hình 2A) và thời gian nở trong vòng 11- 13 ngày. Trứng được đẻ bên trong thân dừa và gốc dừa mục, ẩm, đống rác, phân trâu bò, rơm mục, thân bắp, lá mía xác bả hữu cơ.	Giai đoạn ấu trùng có 3 tuổi (1, 2, và 3), thường có màu trắng vàng hoặc trắng kem, có 3 đôi chân, chân và đầu có màu nâu, hình chữ C và có thể dài tới khoảng 60 - 100 mm hoặc hơn, chiều rộng tối đa là khoảng 10,6-11,4 mm (Hình 2B). Thời gian giai đoạn ấu trùng từ 82 - 207 ngày. Các vị trí ưa thích để phát triển của ấu trùng là những khúc gỗ chết hoặc sắp chết, hoặc trong gốc cây dừa, nơi có nhiều chất hữu cơ hoai mục. Chúng ăn xác bả hữu cơ trong thân cây mục và dưới đất, giai đoạn này không gây hại cho cây.Nhộng có màu nâu vàng và có chiều dài lên tới 50 mm. Chiều dài của các phần nhô ra hình sừng ở phía trước có thể chỉ ra giới tính của thành trùng. Nhộng có hầu hết các đặc điểm bên ngoài nhìn thấy ở một con trưởng thành, với lớp màng ngoài màu nâu vàng cứng, mỏng, dẻo và hơi trong suốt (Hình 2C). Từ 17-30 ngày nhộng sẽ vũ hóa thành thành trùng.Kiến vương trưởng thành là những con bọ cánh cứng lớn màu nâu sẫm đến đen, sáng bóng, dài 35-50 mm và rộng 20-23 mm, có sừng nổi bật trên đầu (Hình 2D). Con đực và con cái khác nhau về kích thước cơ thể (lên đến 40 mm) và sừng con cái ngắn hơn. Sừng cũng có thể khác nhau về kích thước giữa các con bọ cánh cứng tùy thuộc vào môi trường phát triển của ấu trùng. Con đực và cái cũng có thể được phân biệt bằng mặt dưới của cơ thể, con đực có một đầu nhẵn, bóng của bụng, con cái có một chùm lông đỏ cứng ở đầu bụng. Thời gian sống trung bình từ 5 - 10 tháng. Con cái sống lâu hơn con đực, con cái trưởng thành sống được khoảng 9 tháng, còn con đực sống được khoảng 5 tháng. Con cái sẽ giao phối với một vài con đực và sẽ đẻ 3-4 ổ trứng, 30-50 trứng. Mỗi con cái đẻ được khoảng 100 trứng.','Sâu non cắn rễ tạo thành các vết thương làm cho rễ hoạt động kém, không cung cấp đủ nước và chất khoáng cho cây . Đáng chú ý là từ các vết thương do sâu gây ra, một số loài tuyến trùng và một số loài nấm gây bệnh xâm nhập gây hại cho cây. Đặc biệt trong số này có nấm Thielaviopsis paradoxa xâm nhập và gây ra bệnh thối trái, thối gốc chồi làm cho vườn dứa tàn lụi nhanh chóng.Ấu trùng nở ra có thân cong, màu trắng sữa, đầu có mảnh sừng cứng màu nâu, trên thân có lông tơ màu trắng, dài khoảng 35mm, phá hại bộ rễ làm cây bị héo và dễ đổ ngã. Vòng đời của chúng từ 1 - 2 năm.Con trưởng thành màu nâu vàng có vân vạch ở cánh trước\n\nSau khi vũ hóa, các con trưởng thành giao phối và tìm đến  các vườn dứa xanh tốt để đẻ trứng. Sâu non khi nở ra đã có sẵn thức ăn tốt.','Nên xử lý đất trước khi trồng dứa thường xuyên, rải thuốc ngừa bọ cánh cứng bằng các loại thuốc dạng hạt như Regent, Basudin 10 H hoặc dùng thuốc nước tưới gốc cây như Pyrinex 20EC, Fenbis 25EC. Oncol 20EC. Tưới thuốc Oncol 20EC hoặc rải thuốc Lorsban 15G vào gốc  dứa.\n\nLuân canh dứa với các loại cây trồng. Thời gian trồng dứa trở lại 2 - 3 năm.\n\nCày bừa kỹ, thu dọn sạch tàn dư thực vật, phơi khô.\n\nDùng thuốc để phun trừ sâu trưởng thành. Có thể dùng thuốc Basudin, Sevidol 8G, bón vào chung quanh vùng rễ để diệt sâu non.','thumbnails/sericaorient_alismots_chulsky.jpg',38,0,'Bọ cánh cứng'),(45,'Hypera postica','alfalfa weevil','H. postica','alfalfa weevil','insect_Hypera_postica','Mọt cỏ linh lăng phát triển với chiều dài khoảng 4 đến 5,5 mm (0,16 đến 0,22 in). Râu hoặc mỏ ngắn và rộng. Các vây có chiều rộng bằng một nửa của trống trong khi pronotum rộng nhất ở trung tâm. Màu sắc chung của côn trùng là màu nâu, với một sọc đen ở giữa lưng. Ấu trùng có đầu màu đen đặc biệt và không có chân; nó có màu xanh lục vàng, với một sọc trắng ở lưng và các sọc bên màu trắng mờ nhạt. Nó dài khoảng 1 cm (0,4 in) ngay trước khi hóa nhộng. Nó nhộng trong một cái kén màu trắng, kích thước bằng hạt đậu làm bằng lụa dệt lỏng lẻo. [2] Nó giống mọt lá cỏ ba lá ( Hyperaunctata ), nhưng loài này lớn gần gấp đôi, ấu trùng có đầu màu rám nắng và chúng hiếm khi gây hại nhiều cho cây cỏ linh lăng.','nó có thể được tìm thấy trongcác cánh đồng cỏ linh lăng khắp Châu Âu. [1] Được coi là mối đe dọa hủy diệt đối với sản xuất cỏ linh lăng ở Bắc Mỹ, một số sự du nhập tình cờ đã được chống lại thành công mặc dù việc sử dụng nhiều loài kiểm soát sinh học','Trứng được đẻ thành từng đợt lên đến 25 quả bên trong thân cỏ linh lăng. Ấu trùng kiếm ăn trong ba hoặc bốn tuần, lột xác ba lần, trước khi hóa nhộng trong kén mà chúng tạo ra. Chúng xuất hiện khi trưởng thành trong khoảng một hoặc hai tuần. Sau khi thức ăn cho một hoặc hai tuần, họ có thể gặp aestivation trong phần còn lại của mùa hè, trong đó họ chứng minh một giảm chấn của trao đổi chất của họ, hoạt động hệ thống hô hấp và thần kinh. [4] [5] [6] [7]Vào mùa thu, những con trưởng thành ẩn náu trong các tán cây cỏ linh lăng hoặc di chuyển lên thảm thực vật thô trong mương hoặc hàng rào hoặc trong rừng cây gần đó.Cả ấu trùng và con trưởng thành đều ăn ngày và ăn lá cỏ linh lăng, loại ấu trùng gây hại nhiều nhất. Con trưởng thành ăn mép lá, tạo cho chúng có lông tơ. Lúc đầu, ấu trùng ăn các lá cuối để lại các vết thủng, nhưng sau đó chúng di chuyển xuống cây để ăn các lá thấp hơn. Những chiếc lá bị tấn công bị đóng xương do ấu trùng ăn giữa các gân lá và năng suất cây trồng có thể giảm tới 15%. Đôi khi ấu trùng bị giết bởi nấm gây bệnh Zoophthora phytonomi , đặc biệt là trong thời tiết ấm và ẩm ướt. Chúng cũng có thể bị ong bắp cày ichneumon , Bathylplectes anurus và B. curculionis ký sinh. Con cái của những con ong bắp cày này chỉ dài khoảng 0,125 in (0,32 cm), và đẻ một quả trứng bên trong giai đoạn đầu của ấu trùng của mọt. Ấu trùng ong bắp cày đang phát triển là một loại ký sinh trùng , sống bên trong ấu trùng mọt và ngấu nghiến nó, cuối cùng sẽ hóa nhộng ngay sau vật chủ của nó . Kén màu nâu của ong bắp cày có một dải rộng màu trắng trong trường hợp của B. curculionis , và một dải hẹp hơn, nhô ra trong trường hợp của B. anurus . Khi nó bị xáo trộn, kén của loài sau này có thể \"nhảy\" vài cm để tránh bị săn mồi . [2] [8] Cả hai loài ong bắp cày này đều đã được nghiên cứu về khả năng kiểm soát sinh học đối với mọt và B. anurusthường được coi là ưu việt hơn B. curculionis vì tốc độ sinh sản cao hơn.','Vào đầu mùa xuân, ấu trùng đuông cỏ linh lăng nở ra từ trứng gửi trong thân cây và bắt đầu kiếm ăn trong các lá gấp khúc ở ngọn đang phát triển. Khi những chiếc lá này mở ra, sự phá hoại giai đoạn đầu của ấu trùng xuất hiện dưới dạng những \"lỗ kim\" nhỏ trên lá.Khi ấu trùng lớn lên, chúng sẽ đục những lỗ lớn hơn, khiến cây cối trông như bị cắt nhỏ hoặc trơ xương. Một sự phá hoại nặng của ấu trùng có thể tiêu thụ đủ số tán lá khiến toàn bộ cánh đồng có thể có màu xám.\n\nSự phá hoại của mọt trưởng thành thường nhẹ, dưới dạng những vết cắt nhỏ, hình tròn dọc theo mép lá. Con trưởng thành thường ăn các lá thấp hơn. Người lớn ăn thân cây ngay sau lần cắt đầu tiên có thể gây ra thiệt hại được gọi là \"ăn vỏ cây\".','Thuốc diệt côn trùng để quản lý mọt cỏ linh lăng có thể được đăng ký để sử dụng cho người lớn, ấu trùng hoặc cả hai. Các loại thuốc trừ sâu nhắm vào giai đoạn ấu trùng bao gồm organophosphates, carbamat và pyrethroids ( Wright et al. 2015 ). Để điều trị cho người lớn, organophosphates và pyrethroid là phổ biến nhất ( Wright et al. 2015). Một số sản phẩm sử dụng kết hợp hai trong số các loại thuốc diệt côn trùng này. Các quyết định về việc sử dụng thuốc diệt côn trùng nên được thực hiện bằng cách dò tìm và tính toán ngưỡng kinh tế. Một lưu ý quan trọng khác trong việc sử dụng thuốc trừ sâu để điều trị mọt cỏ linh lăng là độc tính đối với ong và thiên địch. Nhiều sản phẩm được đăng ký sử dụng cho mọt cỏ linh lăng có độc tính cao hoặc trung bình đối với thiên địch và có thể gây độc cao đối với ong (Khoa Nông nghiệp và Tài nguyên Thiên nhiên của Đại học California [UCANR] 2015 ). Nguy cơ đối với ong tăng cao khi cỏ linh lăng đang nở hoa, do đó nhãn sẽ ghi rõ “tránh sử dụng khi ong đang tích cực kiếm ăn” hoặc “không áp dụng sản phẩm này cho cây trồng hoặc cỏ dại đang nở hoa” ( Wright et al. 2015). Thông tin hiện tại về các sản phẩm kiểm soát hóa chất cụ thể, khoảng thời gian trước khi thu hoạch và các ghi chú khác được đăng tải một cách đáng tin cậy nhất trên các trang web Khuyến nông khu vực cập nhật như High Plains IPM Wiki ( Peairs et al. 2016 ).','thumbnails/alfalfa_weevil.jpg',39,0,'Bọ cánh cứng'),(46,'Heliothis virescens','flax budworm','H. virescens','flax budworm','insect_Heliothis_virescens','C. virescens trưởng thành có màu nâu pha chút xanh lục nhạt. Các cánh trước có ba dải sẫm màu, mỗi dải được kết hợp với một đường viền màu trắng hoặc kem. Cánh sau có màu trắng với một dải tối ở rìa xa. Những con trưởng thành hoàn toàn có sải cánh dài từ 28 đến 35 mm (1,1 đến 1,4 inch). Con cái thường có màu sẫm hơn con đực.','được tìm thấy ở khắp miền đông và tây nam Hoa Kỳ, mặc dù nó cũng được biết đến từ California. Nó thường chỉ vượt qua mùa đông thành công ở các bang phía nam. Tuy nhiên, nó đôi khi sống sót trong khí hậu lạnh trong nhà kính và các địa điểm có mái che khác. Sâu đục búp thuốc lá phân tán hàng năm về phía bắc và có thể được tìm thấy ở New England, New York và nam Canada vào cuối mùa hè. Nó cũng xuất hiện rộng rãi ở Caribê, và rải rác ở Trung và Nam Mỹ.','Bướm đêm xuất hiện từ tháng 3 đến tháng 5 ở các bang miền nam, tiếp theo là 4 đến 5 thế hệ trong suốt mùa hè, với mùa đông bắt đầu từ tháng 9 đến tháng 11. Bốn thế hệ đã được báo cáo từ phía bắc Florida và Bắc Carolina, và ít nhất năm thế hệ từ Louisiana. Bướm đêm đã được thu thập ở New York từ tháng 7 đến tháng 9, nhưng ở các vĩ độ phía bắc như vậy nó không được coi là dịch hại. Loài này sống qua mùa đông trong giai đoạn nhộng.Trứng : Trứng được gửi vào hoa, quả và sự phát triển cuối cùng. Trứng hình cầu, đáy dẹt. Chúng có kích thước chiều rộng từ 0,51 đến 0,60 mm và chiều cao 0,50 đến 0,61 mm. Trứng ban đầu có màu từ trắng đến trắng hơi vàng, nhưng sau đó sẽ chuyển sang màu xám khi chúng già đi. Các gờ hẹp tỏa ra từ đỉnh của quả trứng, và số lượng từ 18 đến 25. Ấu trùng : Ấu trùng sâu búp thuốc lá có từ 5 đến 7 trường hợp, trong đó 5 hoặc 6 trường hợp phổ biến nhất.Con trưởng thành : Bướm đêm có màu nâu, pha chút xanh lá cây. Các cánh trước được cắt ngang bởi ba dải sẫm màu, mỗi dải thường đi kèm với một đường viền màu trắng hoặc màu kem. Con cái có xu hướng có màu sẫm hơn. Các cánh sau màu trắng, với rìa xa có dải sẫm màu. Bướm đêm có chiều dài sải cánh từ 28 đến 35 mm. Thời kỳ trước khi đẻ của con cái dài khoảng hai ngày. Tuổi thọ của bướm đêm được báo cáo là từ 25 ngày khi được giữ ở 20 ° C, đến 15 ngày ở 30 ° C. Một pheromone giới tính đã được xác định (Tumlinson et al. 1975).','Sâu non đục thành chồi và hoa (cơ sở cho tên gọi chung của loài côn trùng này), và đôi khi là sự phát triển của lá ở đầu cuối mềm, cuống lá và cuống. Trong trường hợp không có mô sinh sản, ấu trùng dễ dàng ăn các mô lá. Neunzig (1969), đã lây nhiễm thuốc lá với cả sâu tơ thuốc lá và sâu tai ngô, và quan sát thấy các mô hình và mức độ tổn thương rất giống nhau của các loài có quan hệ họ hàng gần này. Sự xâm nhập của ấu trùng vào quả làm tăng tần suất bệnh hại cây trồng. Nghiên cứu ở các cánh đồng cà chua phía nam Arkansas chỉ ra rằng mặc dù sâu đục búp thuốc lá xuất hiện từ tháng 5 đến tháng 7, nhưng chúng gần như không nhiều hoặc gây hại như sâu tai ngô (Roltsch và Mayse 1984).','Thuốc diệt côn trùng . Thuốc trừ sâu qua lá thường được sử dụng cho các loại cây trồng có khả năng xảy ra sâu bệnh hại búp thuốc lá. Tuy nhiên, việc tiêu diệt các sinh vật có ích thường dẫn đến kết quả và điều này được cho là làm trầm trọng thêm thiệt hại của sâu chồi. Ngoài ra, khả năng kháng thuốc trừ sâu cũng phổ biến, đặc biệt là ở các loại cây trồng thường xuyên sử dụng pyrethroid.Kỹ thuật văn hóa . Tiêu diệt cỏ dại vào đầu mùa bằng thuốc diệt cỏ hoặc cắt cỏ, hoặc tiêu diệt ấu trùng trên cỏ bằng cách xử lý bằng thuốc trừ sâu, có thể làm giảm kích thước quần thể sâu chồi thuốc lá vào cuối năm.\n\nKiểm soát sinh học . Thuốc trừ sâu vi sinh Bacillus thuringiensis có tác dụng trừ sâu chồi. Virus Heliothis có nhiều hạt nhân đã được sử dụng hiệu quả để ngăn chặn sâu chồi thuốc lá trên đồng ruộng và ký chủ cỏ dại đầu mùa. Giun búp thuốc lá cũng nhạy cảm với vi rút đa hạt nhân từ cỏ linh lăng looper, Autographa californica (Speyer). Sự phóng thích của ký sinh trùng trứng Trichogramma đã được chứng minh là có lợi trên một số cây rau (Martin và cộng sự. 1976).\n\nCây ký chủ kháng thuốc . Mặc dù có rất ít bằng chứng về khả năng kháng sâu chồi thuốc lá tự nhiên trong nhiều loại cây trồng, bông đang được biến đổi gen để biểu hiện tính kháng. Cải thiện khả năng chống lại sự tồn tại của ấu trùng bằng bông sẽ làm giảm áp lực côn trùng trên các cây rau gần đó.','thumbnails/flax_budworm.jpg',40,0,'Sâu đục nụ'),(47,'Adelphocoris lineolatus','alfalfa plant bug','A. lineolatus','alfalfa plant bug','insect_Adelphocoris_lineolatus','Những con bọ Lygus trưởng thành dài khoảng 0,25 inch và rộng 0,1 inch (2,5 mm), và dẹt trên lưng. Chúng có nhiều màu sắc khác nhau từ xanh lục nhạt đến nâu vàng với các mảng màu nâu đỏ đến đen, và có một hình tam giác dễ thấy ở trung tâm của lưng. Nhộng giống con trưởng thành, nhưng có màu xanh lục nhạt đồng nhất với đôi râu màu đỏ; nhộng lớn hơn có năm đốm đen ở bề mặt trên của cơ thể. Nhộng không có cánh. Các loài côn trùng khác có thể bị nhầm lẫn với bọ lygus, bao gồm cả những loài có ích như bọ bigeyed.','nguồn gốc từ Tây Âu , Bắc Phi , Châu Á và Trung Đông','Nhộng có bề ngoài tương tự như nhộng bọ chét bông có màu xanh lục nhạt và mắt đỏ. Chúng lớn hơn bọ chét bông với cá thể thứ 3 dài khoảng ¼ inch. Nhộng non của Creontiades có đốm đỏ trên râu, nhưng điều này thường không được quan sát thấy sau lần thứ 3.\n\nHiện tại, hầu như không có thông tin liên quan đến vòng đời của loài gây hại đặc biệt này, nhưng giả sử nó giống với các loài Creontiades khác, trứng sẽ nở sau 5-10 ngày sau khi được đẻ. Nó sẽ trải qua 5 giai đoạn ấu trùng trước khi lột xác thành con trưởng thành; mỗi lần xuất hiện nymphal sẽ kéo dài 2-3 ngày. Con trưởng thành có thể sống từ 3 - 4 tuần.','Rệp cây cỏ linh lăng đòi hỏi một số điều kiện tối ưu nhất định để phát triển và trở thành dịch hại ở bất kỳ quốc gia nào. A. lineolatus chủ yếu nằm trong môi trường ẩm ướt với nhiệt độ lạnh. [6] Thông thường, người ta có thể tìm thấy những con bọ thực vật này trên cánh đồng hoặc đồng cỏ, ở cả khu vực khô và ẩm ướt. [7] Tuy nhiên, bọ xít hại cây cỏ linh lăng không thành công ở các hồ nước mặn, sa mạc, cồn cát, thời tiết gió hoặc khí hậu quá ấm. [6] Adelphocoris lineolatus sẽ dễ dàng thích nghi với điều kiện môi trường mát mẻ hơn, điều này đã cho phép chúng xâm chiếm một lượng lớn lãnh thổ ở Canada','Hàng ngày cần quan sát vườn cây cảnh nếu thấy có rệp là bắt giết ngay hoặc cắt nhánh cây có rệp rồi bỏ đi không để chúng nhân mật số lên  cao.\n\n- Nếu mật độ rệp cao hơn bạn có thể dùng miếng dẻ lau có nhúng cồn rồi chấm vào những chố rệp bột bám vào hoặc dùng nước xà phòng phun lên các khu vực bị rệp tấn công, cách hiệu quả hơn bạn có thể áp dụng là hòa nước rửa chén (loại bất kỳ) cùng với thuốc thuốc Ditarex theo tỷ lệ: 50g thuốc Ditarex + 10ml nước rửa chén hòa trong bình 15 nước phun trực tiếp và phần lá và thân cây có rệp lúc trời nắng to (tốt nhất lúc 9 - 10h sáng), phun liên tục 5 lần (mỗi lần cách nhau 5 ngày) đến khi rệp chết hẳn.\n\n- Hoặc có thể dùng một trong các loại thuốc sau đây để phun xịt: Supracide 40ND, Suprathion 40ND, Applaud-Bas 27BTN, Applaud-Mipc 25BTN, Sherpa 10EC, Bi 58 40EC, DC- Tron Plus 98,8EC…. (về liều lượng và cách sử dụng thuốc có thể đọc kỹ hướng dẫn của nhà sản xuất có in sẵn trên vỏ bao bì).','thumbnails/alfalfa_plant_bug.jpg',41,0,'Bọ cánh cứng'),(48,'Tarnished plant bug','tarnished plant bug','L. lineolaris','tarnished plant bug','insect_Tarnished_plant_bug','Loài côn trùng này có thể được tìm thấy trên khắp Bắc Mỹ , từ bắc Canada đến nam Mexico. Con trưởng thành có chiều dài lên đến 6,5 mm và có màu nâu với các điểm nhấn là vàng, cam hoặc đỏ, với chữ \"V\" màu nhạt trên lưng (lưng).','tìm thấy nhiều nhất ở nửa phía đông của Bắc Mỹ  Bắc Mỹ , từ bắc Canada đến nam Mexico','L. lineolaris sử dụng cây bông như một trong những vật chủ sinh sản chính của chúng. Con cái đẻ trứng ở hàng cây đầu tiên của cây bông và sau đó chiếm nhiều cây hơn trên đồng ruộng. [5] Những con cái thường đẻ trứng vào tháng 5 sau thời kỳ trú đông . Trứng nở và nhộng bắt đầu phát triển vào khoảng tháng Sáu. [7] Mức độ quần thể cao nhất của L. lineolaris thường được đánh dấu vào tháng 10 và tháng 6, và nó cũng được coi là nguyên nhân dẫn đến sự gia tăng mức độ quần thể của Pisaurina mira , một loài nhện mạng săn mồi trên L. lineolaris','Bọ Lygus được biết đến với thói quen kiếm ăn phá hoại của chúng - chúng chọc thủng các mô thực vật bằng mũi xỏ lỗ của chúng và ăn bằng cách hút nhựa cây . Cả tổn thương vật lý và phản ứng của chính cây trồng đối với nước bọt của bọ đều gây ra thiệt hại cho cây trồng. Những con cái đưa trứng của chúng trực tiếp vào các mô thực vật bằng cách sử dụng vòi trứng đâm xuyên , và những con nhộng mới xuất hiện là những người phàm ăn của nước ép mô thực vật. Các dấu hiệu cho thấy cây đã bị bọ lygus tấn công bao gồm biến màu, biến dạng chồi và thân, lá quăn lại và các vết bệnh trên mô cây','Người trồng thường xuyên thực hiện 3-5 lần phun thuốc trừ sâu mỗi năm để kiểm soát loài côn trùng này. Xem xét tỷ suất lợi nhuận hẹp đối với nông dân ngày nay, chi phí của các ứng dụng như vậy là đáng kể. Tại Hoa Kỳ, đã có tổng cộng 38% vụ mất bông do dân số TPB.Việc nhổ và duy trì các cây cỏ dại có thể kiểm soát số lượng L. lineolaris trưởng thành trong các ruộng trồng trọt và vườn nho. [1] Lượng mưa có thể được phân loại như một hình thức kiểm soát cơ học đối với L. lineolaris vì những giọt mưa có thể làm chết các cá thể thực vật và làm giảm khả năng sống sót của chúng. [7] Kết quả từ một nghiên cứu điều tra ảnh hưởng của lượng mưa đến quần thể nhộng trùng L. lineolaris chỉ ra rằng số lượng nhộng trùng giảm trong những năm mưa nhiều. Trong những năm có lượng mưa lớn, L. lineolaris cũng ít bị ong bắp cày P. digoneutis ký sinh . Do kết quả của chúng mà lượng mưa giảmQuần thể L. lineolaris , các nhà nghiên cứu cho rằng nên sử dụng hệ thống tưới phun sương trên các cánh đồng cỏ linh lăng vì nó mô phỏng lượng mưa.','thumbnails/tarnished_plant_bug.jpg',42,0,'Bọ cánh cứng'),(49,'Grasshopper','Locustoidea','','Locustoidea','insect_Grasshopper','Châu chấu có cơ thể côn trùng điển hình là đầu, ngực và bụng . Đầu được giữ thẳng đứng một góc với thân, với miệng ở phía dưới. Đầu có một cặp mắt kép lớn cho khả năng nhìn toàn diện, ba mắt đơn giản có thể phát hiện ánh sáng và bóng tối, và một cặp râu giống sợi chỉ nhạy cảm với xúc giác và khứu giác. Phần miệng hướng xuống được sửa đổi để nhai và có hai bàn tay cảm giác ở phía trước hai hàm.Ngực và bụng được phân đoạn và có một lớp biểu bì cứng được tạo thành từ các tấm chồng lên nhau bao gồm kitin . Ba đoạn ngực hợp nhất mang ba cặp chân và hai đôi cánh. Các cánh trước, được gọi là tegmina , hẹp và nhiều da trong khi cánh sau lớn và có màng, các tĩnh mạch cung cấp sức mạnh. Các chân được kết thúc bằng móng vuốt để nắm chặt. Chân sau đặc biệt mạnh mẽ; xương đùi là mạnh mẽ và có nhiều rặng núi nơi các bề mặt khác nhau tham gia và các rặng núi bên chịu stridulatorychốt ở một số loài. Mép sau của xương chày có một hàng gai kép và có một đôi cựa khớp ở gần đầu dưới của nó. Phần bên trong lồng ngực chứa các cơ điều khiển cánh và chân.','Phân bộ Caelifera chủ yếu phân bổ ở khu vực nhiệt đới nhưng phần lớn các siêu họ thì phân bổ rộng khắp thế giới.','Ở Việt Nam, châu chấu sống khắp nơi trên ruộng lúa, nương ngô, lạc, đậu, trong lùm bụi, đám cỏ, cây ăn quả và cây công nghiệp. Đẻ trứng trong đất nhất là đất cát, đất xốp sâu khoảng 10 cm, nơi có nhiều cỏ dại thành từng ổ, mỗi ổ có rất nhiều trứng màu vàng, giống như hạt gạo. Khoảng 12 ngày (mùa hè), 21 – 28 ngày (mùa thu, xuân) và 45 ngày (mùa đông), trứng nở rải rác trong thời gian 3 – 5 ngày.','Hầu hết châu chấu là loài đa pha , ăn thực vật từ nhiều nguồn thực vật, [20] nhưng một số loài ăn tạp và cũng ăn mô động vật và phân động vật. Nhìn chung, sở thích của chúng là dành cho các loại cỏ, bao gồm nhiều loại ngũ cốc được trồng làm hoa màu. [21] Hệ tiêu hóa đặc trưng của côn trùng, với các ống Malpighian thải vào ruột giữa. Carbohydrate được tiêu hóa chủ yếu trong cây trồng, trong khi protein được tiêu hóa ở manh tràng của ruột giữa. Nước bọt dồi dào nhưng phần lớn không chứa enzym, giúp di chuyển thức ăn và dịch tiết Malpighian dọc theo đường ruột. Một số loài châu chấu có cellulase , bằng cách làm mềm thành tế bào thực vật làm cho các chất trong tế bào thực vật có thể tiếp cận được với các enzym tiêu hóa khác.','Xác định khu vực châu chấu co cụm, đẻ trứng vào khoảng cuối mùa thu để tổ chức diệt trừ. Khi những ổ nhỏ châu chấu mới nở, còn co cụm thì dùng vợt bắt thủ công đem tiêu hủy. Những ổ lớn và khi châu chấu bắt đầu phát tán gây hại lúa, ngô thì cần áp dụng biện pháp phun thuốc hóa học để tiêu diệt. Sử dụng một trong các loại thuốc phòng trừ châu chấu tre như: Lufen extra 1005EC, Neretox 95WP, Victory 585EC...','thumbnails/Locustoidea.jpg',NULL,0,'Bọ xít'),(50,'lytta polita','lytta polita','L. polita','lytta polita','insect_lytta_polita','Con trưởng thành là những con bọ chân dài, thân mềm với đầu lệch, lộ ra ngoài hoàn toàn và đột ngột bị thắt lại phía sau để tạo thành một cái cổ hẹp bất thường, pronotum ở đầu trước hẹp hơn nhiều so với đuôi sau và không có vân (keeled) ở bên, các khoang ở trước mở ra phía sau, và (ở tất cả các loài ở Florida), mỗi móng vuốt ở đuôi lại tách ra thành hai lưỡi. Chiều dài cơ thể thường dao động từ 3/4 đến 2 cm ở các loài Florida. Bọ cánh cứng (họ Meloidae) thường bị nhầm lẫn với các loài bọ trong họ Oedemeridae (bọ phồng giả) (Arnett 2008) và phân họ Tenebrionidae Lagriinae (bọ có khớp dài).','Bắc Mỹ, chỉ chiếm một phần nhỏ trong tổng số ở Hoa Kỳ, nhưng gần gấp ba lần so với Tây Ấn','Trứng được đẻ thành khối dưới đất hoặc dưới đá (Meloinae) hoặc trên cây thức ăn của người trưởng thành (Nemognathinae). Sự phát triển của ấu trùng là siêu biến hình, với bốn giai đoạn riêng biệt.Trong giai đoạn đầu tiên hoặc triungulin (T), ấu trùng tự đến nơi kiếm ăn (hầu hết Meloinae) hoặc bám vào ong trưởng thành và được mang đến đó (Meloini (không phải ở Florida) và Nemognathinae). Sau khi cho ăn để bổ sung, ấu trùng, qua quá trình lọc sinh thái, trở thành dạng bọ hung và bước vào thời kỳ phát triển nhanh chóng (giai đoạn đầu tiên, FG) kéo dài cho đến cuối năm hoặc sáu tuổi. Ở một số loài săn ong, ấu trùng FG chỉ sử dụng một tế bào duy nhất, trong khi ở một số loài khác, nó đào sâu vào các tế bào lân cận và nuốt chửng bên trong của chúng. Ở Meloinae, ấu trùng FG được cho ăn đầy đủ thường đào một khoang ngoài nơi cho ăn. Trong trường hợp sáu hoặc bảy, ấu trùng thường trở nên xơ cứng nặng và bất động (giai đoạn coarctate, C). Trong giai đoạn này, cơ bắp trải qua quá trình thoái hóa sâu sắc và quá trình hô hấp bị giảm xuống mức cực kỳ thấp, cho phép tồn tại hơn một năm, nếu cần thiết. Khi sự phát triển tiếp tục, các cơ sẽ tái sinh và, qua quá trình lọc sinh thái, ấu trùng một lần nữa trở thành dạng bọ hung (giai đoạn grub thứ hai, SG); tại thời điểm này, nó có thể khai quật hoặc không thể khai quật một buồng nhộng. Nemognathinae khác thường ở chỗ ấu trùng SG và nhộng sau cùng và con trưởng thành được bao bọc bởi lớp da nguyên vẹn nhưng còn nguyên vẹn của ấu trùng FG và ấu trùng C.','Trong suốt vòng đời của chúng. bọ cánh cứng nâu gây ra sự tàn phá cho thực vật. Trong thời kỳ nhộng chúng ăn rễ cây.\n\nVào mùa xuân hoặc đầu mùa hè, bọ cánh cứng trưởng thành đẻ trứng trong đất. Những quả trứng này nở ra và trở thành ấu trùng. Những con sâu trắng hình chữ C có đầu sẫm màu và ăn rễ cây, thường gây ra thiệt hại nghiêm trọng. Ấu trùng ở trong đất cho đến mùa xuân năm sau, khi chúng nhộng và trưởng thành. Căn cứ vào đặc điểm này ta cần diệt những con sâu này trước khi nó gây ra thiệt hại đáng kể cho vườn bưởi !','Nên xử lý đất trước khi trồng thường xuyên, rải thuốc ngừa bọ cánh cứng. Các loại thuốc như Regent, Configent hoặc dùng thuốc nước tưới gốc cây như Pyrinex, Sairifos,…Luân canh với các loại cây trồng. Cày bừa thật kỹ, thu dọn sạch tàn dư thực vật và phơi ải.\nChăm sóc, thường xuyên kiểm tra lá đọt để phát hiện sớm và phòng trừ.\nBảo vệ thiên địch (kiến, đuôi kiềm), thiên địch ký sinh (ong ký sinh ấu trùng), nấm ký sinh…\nCây bị bọ gây hại nên tiêu huỷ các lá non để tiêu diệt trứng, ấu trùng nhộng và thành trùng.','thumbnails/lytta_polita.jpg',43,0,'Bọ cánh cứng'),(51,'Ceroctis capensis','legume blister beetle','C. capensis','legume blister beetle','insect_Ceroctis_capensis','Nó có chiều dài cơ thể khoảng 12 mm trong khi elytra của nó có màu đen với những đốm vàng, và đầu, râu và chân có màu đen.','Nam phi','Biến thái hoàn toàn; siêu biến hình. Mùa đông được dành cho giai đoạn ấu trùng sau này và nhộng xảy ra vào mùa xuân. Giai đoạn nhộng kéo dài khoảng 2 tuần và con trưởng thành xuất hiện vào đầu mùa hè. Bọ cánh cứng cái đẻ từng chùm trứng trong đất. Ấu trùng giai đoạn đầu (instar) nở ra từ trứng (triungulin) là một ấu trùng chân dài, hoạt động, nhỏ bé tìm kiếm vật chủ thích hợp. Sau khi ở đó, ấu trùng phát triển qua một số giai đoạn, mỗi giai đoạn có các phần phụ giảm dần và ngày càng trông giống như bụi rậm. Số lượng giai đoạn ấu trùng đầu tiên phát triển trong vòng khoảng tháng, nhưng giai đoạn thứ hai đến giai đoạn cuối cùng (pseudopupa) có thể tồn tại trong khoảng 230 ngày trước khi lột xác thành giai đoạn ấu trùng cuối cùng (thứ sáu) vào mùa xuân. Nói chung, một thế hệ xảy ra mỗi năm mặc dù một số phát triển trong 35 đến 50 ngày trong khi ở những thế hệ khác, quá trình phát triển mất 3 năm.','Con cái đẻ trứng vào đất, dùng hàm và chân để đào lỗ. Trứng nở thành ấu trùng sáu chân nhỏ và hoạt động rất tích cực tìm kiếm vỏ trứng châu chấu và châu chấu bị chôn vùi. Sau khi định vị được những vị trí này, ấu trùng chui xuống và chui vào vỏ, bong tróc da và thay đổi hình dạng của chúng thành loài sên béo với đôi chân rất ngắn. Chúng sẽ ăn trứng, hạn chế số lượng Orthoptera một cách hiệu quả . Khi phát triển đầy đủ, ấu trùng Ceroctis sẽ hóa nhộng trong một khoang ngầm mà từ đó bọ trưởng thành xuất hiện. Một loài Ceroctis , C. groendali là một loài ký sinh trong tổ của ong bắp cày Ceramius lichtensteinii','Dùng máy hút bụi cầm tay hoặc cầm đầu ống hút bụi gia dụng để hút bọ phấn . Đi xung quanh các cây bị nhiễm bọ phấn và hút loài dịch hại bên dưới lá cây và tán lá cây. -Xịt dungk dịch xà phòng lên cây. -Dầu neem.- Sử dụng phân trùng huế.-Dùng vật liệu phản xạ','thumbnails/legume_blister_beetle.jpg',44,0,'Bọ cánh cứng'),(52,'blister beetle','blister beetle','B.beetle','blister beetle','insect_blister_beetle','Bọ cánh cứng thuộc họ côn trùng Melòidae. Chúng có thể được tìm thấy với nhiều màu sắc khác nhau và một số kích cỡ và hình dạng cơ thể. Đặc điểm đặc biệt nhất của chúng là phần ngực hẹp và đầu rộng hơn, một đặc điểm khác biệt giữa chúng với phần lớn các loài bọ khác. Hầu hết các loài bọ phồng rộp đều có phần bụng dài, hình trụ, nhưng một số loài trông rất khác. Một số loài có bụng tròn \"giống quả bóng\" hoặc cánh ngắn và bụng dạng ấu trùng. Tuy nhiên, tất cả các loài bọ phồng rộp đều có “cổ” hẹp đặc biệt, tương phản với phần đầu và bụng rộng hơn.','Mỹ,Tây Ấn','Bọ cánh cứng trải qua mùa đông trong giai đoạn ấu trùng. Chúng phát triển thành nhộng vào mùa xuân, và sau khoảng 2 tuần, bọ phồng rộp trưởng thành xuất hiện vào đầu mùa hè. Con trưởng thành kiếm ăn, giao phối và con cái bắt đầu đẻ các cụm trứng trong đất. Trứng nở ra dưới dạng ấu trùng triungulin nhỏ, di động tìm kiếm vật chủ là ong hoặc châu chấu của chúng. Khi tìm thấy vật chủ mà ấu trùng có thể kiếm ăn, ấu trùng có vẻ ngoài ngày càng giống sâu bọ, trước khi hóa nhộng vào mùa xuân. Hầu hết các loài bọ cánh cứng chỉ có một thế hệ mỗi năm','Bọ cánh cứng trưởng thành ăn thực vật lá rộng, đặc biệt là các loài thuộc họ Dền, Asteraceae, Leguminosae và Solanaceae. Hầu hết những con trưởng thành chỉ ăn các bộ phận của hoa, nhưng một số cũng ăn cả  lá.\n\nỞ giai đoạn ấu trùng, bọ phồng rộp săn mồi ở giai đoạn chưa trưởng thành của ong đơn độc hoặc trứng của châu chấu trong họ Acrididae (châu chấu sừng ngắn), châu chấu phổ biến ở các đồng cỏ và đồng cỏ được tìm thấy.','Nếu bạn đang làm việc, vui chơi hoặc thư giãn ngoài trời, hãy lưu ý đến những khu vực có thể có bọ phồng rộp. Chúng bao gồm các sân cỏ, bồn hoa và đèn chiếu sáng. Mặc áo sơ mi dài tay và quần dài nếu bạn có khả năng gặp phải những con bọ này.\n\nNếu một con bọ phồng rộp đậu trên da của bạn, đừng bóp nát nó. Nhẹ nhàng loại bỏ bọ cánh cứng bằng cách thổi nó ra khỏi da của bạn. Sau khi da tiếp xúc với bọ cánh cứng, rửa vùng da tiếp xúc với xà phòng và nước.','thumbnails/blister_beetle.jpg',45,0,'Bọ cánh cứng'),(53,'Therioaphis trifolii','therioaphis maculata Buckton','Therioaphis Trifolii','therioaphis maculata Buckton','insect_Therioaphis_trifolii','Rệp cỏ linh lăng đốm dài khoảng 2 mm, màu vàng nhạt và có bốn đến sáu hàng đốm đen trên lưng. Nó thường được tìm thấy trên thân và lá ở phần dưới của cây. Nó hút nhựa cây và tiết ra một lượng lớn mật ong. Nước bọt độc hại của nó giết chết các cây con và có thể làm giảm năng suất của các cánh đồng đã trồng.','Châu Âu, Bắc Phi, Trung Đông, Ấn Độ và Pakistan','Ấu trùng và thành trùng tập trung mặt dưới lá, nhất là đọt non, bông, chồi, hút nhựa làm cho các phần này bị héo hoặc để lại những vết thâm đen trên lá, và truyền bệnh virus cho cây. Trên dưa, rầy gây hại trầm trọng nếu tấn công các dây chèo hay đỉnh sinh trưởng, nếu tập trung số lượng lớn ở đọt sẽ làm cho lá bị quăn queo. Phân thải ra thu hút nhiều nấm đen bao quanh làm ảnh hưởng sự phát triển trái và ảnh hưởng đến quang hợp của cây.','Rệp cỏ linh lăng đốm thích ăn cỏ linh lăng, mặc dù chúng sẽ phá hoại một số\ncỏ ba lá. Những con rệp này chích một chất độc tiết nước bọt vào cây, gây ra\núa vàng ở chỗ ăn và dọc theo gân lá. Vị trí của đốm\nRệp cỏ linh lăng trên cây chịu ảnh hưởng lớn bởi độ ẩm tương đối. Nói chung, họ\nđược tìm thấy ở mặt dưới của những chiếc lá thấp hơn nhưng sẽ di chuyển lên trên cây như những chiếc lá này\nbị giết. Các quần thể không được kiểm soát đã làm giảm một nửa năng suất và hàm lượng protein trên\nkhán đài đã thành lập và đã phá hủy khán đài mới. Ngoài ra, mật ong tiết ra và\nnấm mốc phát triển sau đó trên lá làm giảm chất lượng cỏ khô và làm cho\nthu hoạch khó khăn. Các giống nhạy cảm có thể bị hư hại nghiêm trọng bởi ít hơn\nmột con rệp trên mỗi cây con, nhưng tính kháng của cây ký chủ có thể làm giảm thiệt hại. May mắn là nhiều\ncác giống hiện đại có khả năng chống lại rệp cỏ linh lăng đốm.','Trên giá thể cây con, thuốc trừ sâu nên được áp dụng khi có hai đến ba con rệp trên mỗi cây\ncây con có mặt. Cây cao từ 2 đến 3 inch có thể chịu được 4 đến 5 rệp trên mỗi cây. Sử dụng tại\nít nhất 12 gallon nước trên mỗi mẫu Anh và áp dụng khi nhiệt độ ban ngày dự kiến ​​sẽ\ntrên 65 ° F. Ở cỏ linh lăng lâu đời, cần có quần thể cao hơn để biện minh cho việc điều trị.\nTrên cỏ linh lăng cao 10 inch, thường không cần điều trị cho đến khi có 50 con rệp trên mỗi thân\nMón quà. Trên cỏ linh lăng cao 20 inch, số lượng rệp trên mỗi thân cây nhiều gấp đôi sẽ cần thiết để bảo vệ\nsự đối xử.','thumbnails/therioaphis_maculata_Buckton.jpg',46,0,'Rầy'),(54,'odontothrips loti','odontothrips loti','O.loti','odontothrips loti','insect_odontothrips_loti','Cả hai giới hoàn toàn có cánh. Thân và chân màu nâu sẫm, nhạt màu hơn, đoạn III màu vàng, đoạn IV màu nâu nhạt; cánh trước màu nâu với dải màu trắng dưới đáy. Đầu rộng hơn dài; có ba cặp bộ phận tế bào, cặp III dài bằng khoảng cách giữa các mắt kép, phát sinh ở hoặc ngay bên ngoài rìa trước của tam giác tế bào. Ăng-ten 8 phân đoạn; các phân đoạn III – IV bị thắt chặt vào đỉnh, giác quan được chia đôi; cảm giác phân đoạn VI với đế hình bầu dục mở rộng. Pronotum với hai cặp lá dài hình chữ nhật. Đỉnh trước xương chày có móng vuốt nhỏ gần bờ ngoài, cũng có bao lao gần bờ trong. Metanotum lọc yếu; giữa các đốt dài, phát sinh ở rìa trước; hiện tại campaniform sensilla. Tĩnh mạch thứ nhất của cánh trước với hàng định vị thay đổi, thường có khoảng trống dưới đỉnh nhỏ; hàng setal hoàn thành trên tĩnh mạch thứ hai. Bụng mối không có điêu khắc trung gian; tergite VIII với lược sau gốc rộng ngắt quãng ở giữa, với microtrichia mảnh dài ở bên; ctenidium không được phát triển, nhưng đối diện với spiracle là một nhóm nhỏ của microtrichia. Sternites không có đĩa đệm.','vùng Holarctic, bao gồm Iran và Trung Quốc, nhưng một loài được mô tả từ Rajasthan, Ấn Độ và một loài khác từ Guinea,Châu Á, Châu Âu, Bắc Mỹ','Bọ trĩ đẻ những quả trứng cực nhỏ, dài khoảng 0,2 mm. Những con cái của phân bộ Terebrantia cắt các khe trong mô thực vật bằng ovipositor của chúng và đưa trứng của chúng vào, mỗi cái một cái vào khe. Những con cái thuộc phân bộ Tubulifera đẻ trứng đơn lẻ hoặc thành từng nhóm nhỏ trên bề mặt bên ngoài của thực vật. Bọ trĩ dị hóa, biến chất dần dần sang dạng trưởng thành. Việc đầu tiên hai instars , được gọi là ấu trùng hoặc nhộng, giống như người lớn không cánh nhỏ (thường bị nhầm lẫn với bọ đuôi bật ) mà không cơ quan sinh dục; chúng ăn vào mô thực vật. Ở Terebrantia, cá thể thứ ba và thứ tư, và ở cá thể Tubulifera cũng là cá thể thứ năm, là giai đoạn nghỉ ngơi không cho ăn tương tự như nhộng : trong những giai đoạn này, các cơ quan của cơ thể được định hình lại, chồi cánh và cơ quan sinh dục được hình thành. [60] Giai đoạn trưởng thành có thể đạt được sau khoảng 8–15 ngày; con trưởng thành có thể sống trong khoảng 45 ngày. [61] Con trưởng thành có cả dạng có cánh và không có cánh; trên cỏ bọ trĩ Anaphothrips obscurusVí dụ, dạng có cánh chiếm 90% dân số vào mùa xuân (ở đới ôn hòa), trong khi dạng không cánh chiếm 98% dân số vào cuối mùa hè. [62] Bọ trĩ có thể sống sót trong mùa đông như người lớn hoặc thông qua trứng hoặc nhộng diapause .','Cũng như các loài bọ trĩ khác, vòng đời từ trứng đến trưởng thành phụ thuộc vào nhiệt độ. Chu kỳ đầy đủ có thể mất khoảng 15 ngày ( Lewis, 1973 ) đến hơn một tháng và con trưởng thành có thể sống hơn một tháng để tạo ra nhiều thế hệ trong một năm tùy thuộc vào thời tiết theo mùa. Với nhiệt độ nhà kính, thời gian phát triển từ trứng đến trưởng thành có thể giảm xuống còn khoảng một tuần.','Do kích thước nhỏ và tốc độ sinh sản cao nên rất khó kiểm soát bọ trĩ bằng biện pháp kiểm soát sinh học cổ điển . Những kẻ săn mồi thích hợp phải đủ nhỏ và mảnh để xâm nhập vào các kẽ hở nơi bọ trĩ ẩn náu trong khi kiếm ăn, đồng thời chúng cũng phải săn mồi rộng rãi trên trứng và ấu trùng để có hiệu quả. Chỉ có hai gia đình của ký sinh Hymenoptera trứng ký sinh và ấu trùng, các Eulophidae và Trichogrammatidae . Các tác nhân kiểm soát sinh học khác của người lớn và ấu trùng bao gồm bọ anthocorid thuộc chi Orius , và bọ ve phytoseiid . Thuốc trừ sâu sinh học như nấm Beauveria bassiana và Verticillium lecaniicó thể diệt bọ trĩ ở tất cả các giai đoạn của vòng đời. [74] Xịt xà phòng diệt côn trùng có hiệu quả đối với bọ trĩ. Nó có bán trên thị trường hoặc có thể được làm bằng một số loại xà phòng gia dụng. Các nhà khoa học ở Nhật Bản báo cáo rằng sự giảm đáng kể ấu trùng và bọ trĩ dưa trưởng thành xảy ra khi cây được chiếu sáng bằng ánh sáng đỏ','thumbnails/odontothrips_loti.jpg',47,0,'Rệp'),(55,'Stenchaetothrips biformis','Thrips','S. biformis','Thrips','insect_Stenchaetothrips_biformis','Con trưởng thành và nhộng trong mùa đông trong đất vườn. Vào mùa xuân, những con cái mới xuất hiện sẽ nhét trứng vào các mô của hoa, lá hoặc thân. (Chúng không cần giao phối để sinh sản.) Mỗi ​​con cái có thể sản xuất tối đa 80 quả trứng, chúng nở trong vòng vài ngày khi thời tiết ấm áp hoặc vài tuần đến vài tháng khi thời tiết lạnh hơn. Chúng trở thành ấu trùng không cánh (nhộng), ăn nhựa cây. Sau hai hoặc nhiều giai đoạn nhộng, nhiều bọ trĩ rơi xuống đất để hóa nhộng. Những con trưởng thành mới xuất hiện bay đến nhà máy và lặp lại chu kỳ. Có thể có 12-15 thế hệ mỗi năm với toàn bộ chu kỳ từ trứng đến trưởng thành chỉ cần ít hơn 16 ngày trong điều kiện thời tiết ấm áp.','xuất hiện ở Afghanistan, Ấn Độ, Miến Điện, Campuchia, Triều Tiên, Indonesia, Lào, Malaysia, miền Nam nước Nhật, Philippines, Sri Lanka, Thái Lan và Việt Nam.','Con trưởng thành là loài côn trùng mảnh mai màu vàng rơm hoặc đen rất nhỏ (dưới 1/25 inch) với hai cặp cánh lông vũ. Nếu không sử dụng ống kính cầm tay, chúng giống như những sợi nhỏ tối màu.','Đây là loài côn trùng chích hút nhựa cây để phát triển, chúng có thể gây ra một số thiệt hại to lớn cho cây trồng, gây ảnh hưởng nghiêm trọng trong hoạt động trồng trọt.','Để diệt bọ trĩ, loại bỏ cỏ và cỏ xung quanh khu vực vườn để loại bỏ các ký chủ thay thế. Dọn sạch các mảnh vụn cây trồng trong vườn, đặc biệt là lá hành sau khi thu hoạch. (Lớp mùn khô sẽ không thu hút bọ trĩ. Lớp mùn xanh sẽ không thu hút được bọ trĩ).Kiểm tra tất cả các cây bạn nhập vào vườn để tìm dấu hiệu của bọ trĩ hoặc sự phá hại của chúng. Vứt bỏ những cây bị nhiễm bệnh bằng cách đóng bao chắc chắn và cho vào thùng rác.Các loại xà phòng diệt côn trùng an toàn, dịu nhẹ  được làm từ dầu  và mỡ thực vật tự nhiên , cũng có hiệu quả để tiêu diệt các loài côn trùng gây hại nặng (và sẽ không gây hại cho hầu hết các loài côn trùng có ích tự nhiên). Spinosad và  dầu neem  có thể được sử dụng để điều trị tại chỗ các khu vực bị nhiễm trùng nặng.','thumbnails/Thrips.jpg',48,0,'Rệp'),(56,'Bruchophagus roddi(alfalfa seed chalcid)','alfalfa seed chalcid','E. spp.','alfalfa seed chalcid','insect_Bruchophagus_roddi(alfalfa_seed_chalcid)','Màu đen toàn thân; xương chày trước, đầu gối và gân khoeo vàng nhạt. Đầu và ngực có lông mọc ngắn và thưa. Đầu hơi rộng hơn pronotum; genae ngắn hơn một chút so với đường kính mắt dọc. Ăng-ten nhô ra giữa mặt; clava 3 phân đoạn, rộng hơn funicle; lông cái 5 đoạn, con đực 4 đoạn. Các đoạn lông tơ hơi dài ở con cái. Mỗi đoạn đường cong của con đực thu hẹp về phía gốc và đỉnh. Thorax lồi yếu, pronotum rộng hơn chiều dài khoảng 3 lần và ngắn hơn mesonotum một chút. Hình dạng của đầu và ngực với lưới bề mặt. Propodeum dẹt, không có rãnh ở giữa, vùng trung tâm có lỗ thủng. Cánh trong suốt, gân lá màu vàng nâu. Tĩnh mạch sau biên trên cánh trước dài hơn một chút so với tĩnh mạch hướng tâm và ven. Bụng cá cái ngắn hơn ngực, hình trứng, nhọn về phía đỉnh và nhô cao yếu ở phần đỉnh. Cuống lá ngang. Ovipositor nổi rõ yếu ngoài bụng. Chiều dài cơ thể 1,3-1,8 mm ở con cái, 1,2-1,7 mm ở con đực.','Loài phân bố ở Châu Âu, Trung Đông, Ấn Độ, Bắc Mỹ, Úc và New Zealand. Nó sinh sống ở phần châu Âu của Liên Xô cũ ở phía bắc đến Karelia, Caucasus, Tây và Đông Siberia, Viễn Đông, Trung Á và Kazakhstan.','Ấu trùng của cây cuối cùng ngủ đông bên trong hạt cỏ linh lăng. Thời gian chết của một số ấu trùng kéo dài đến 3 năm. Có tới 35% dân số chết trong quá trình ngủ đông. Sâu non hóa nhộng bên trong hạt từ cuối tháng 4; con trưởng thành bay từ giữa tháng Năm cho đến cuối tháng Sáu. Con đực bắt đầu bay sớm hơn. Về sau, số lượng cá cái tăng lên, và vào cuối mùa hè, chỉ có cá cái. Sự kết đôi bắt đầu ngay lập tức hoặc 2-3 ngày sau khi cá cái xuất hiện. Khả năng sinh sản khoảng 65 trứng. Trứng hình trứng, bóng, màu trắng, có cuống dài và ngắn. Những quả cỏ linh lăng được 8-9 ngày tuổi sẽ hấp dẫn hơn cho việc đẻ trứng.','Con cái trưởng thành của hạt cỏ linh lăng (dài khoảng 1/8 inch) có cấu trúc giống như cây kim được sử dụng để cấy trứng vào hạt cỏ linh lăng chưa trưởng thành. Một ấu trùng duy nhất phát triển trong mỗi hạt và phá hủy tất cả các chất bên trong, chỉ để lại lớp vỏ hạt.','. Các biện pháp kiểm soát bao gồm sử dụng phân bón, gieo những cánh đồng cỏ linh lăng mới ở khoảng cách hơn 7 km so với những cánh đồng cỏ linh lăng cũ, cày sâu vào mùa thu, loại bỏ những hạt bị nhiễm bệnh khỏi thu hoạch và sử dụng cỏ linh lăng trước mùa xuân năm sau. Alfalfa trồng trong luân canh không phải là mong muốn trong 2-3 năm hoặc hơn. Điều trị bằng thuốc trừ sâu đối với Alfalfa Seed Chalcid là cần thiết vào buổi tối, khi hầu hết ong nghỉ hưu trên cánh đồng. Hóa chất có mức độ độc hại thấp đối với ong mật được sử dụng làm thuốc trừ sâu.','thumbnails/alfalfa_seed_chalcid.jpg',49,0,'Ruồi đen'),(57,'Pieris canidia','Pieris canidia','P. canidia','Pieris canidia','insect_Pieris_canidia','Con đực có màu kem từ trắng đến nhạt ở mặt trên của nó. Phần đáy của cánh trước, phần đáy của chi phí, và phần đáy và rìa trên của ô có một lớp vảy đen rải rác. Nó có màu đen từ đỉnh đến khoảng giữa của lề đầu cuối. Ở mặt sau, màu đen kéo dài một khoảng rất ngắn theo hình tam giác dọc theo các tĩnh mạch. Có một đốm đen tròn ở khoảng trống 3. Cánh sau có một đốm đen dưới màng xương như ở Pieris rapae nhưng nhìn chung lớn hơn và dễ thấy hơn, và một loạt bốn hoặc năm đốm đen cuối có kích thước khác nhau ở các đỉnh của gân.Mặt dưới: cánh trước màu trắng; tế bào và chi phí được chiếu xạ nhẹ (lốm đốm) với các vảy đen; đỉnh có màu hơi rộng với màu vàng đục. Các giao điểm 1, 3 và 5 có các đốm đen phụ dễ thấy; vị trí trong khoảng trống 1 đôi khi mở rộng ra ngoài khoảng trống 1. Vị trí đó trong khoảng cách 5 không được xác định rõ. Mặt sau: từ màu trắng nhạt, gần như trắng, đến sẫm màu, toàn thân dày đặc (ngoại trừ một vệt dọc trong tế bào, và ở các mẫu vật sẫm màu hơn, các vệt dọc tương tự ở các kẽ) có vảy đen; costa trên vân 8 có màu vàng chrome. Ăng-ten có màu đen với các đốm trắng nhỏ; các lông dài trên đầu và ngực có màu xám lục; phần bụng màu đen. Bên dưới, đầu, ngực và bụng có màu trắng. [3]\n\nCon cái tương tự con đực ở mặt dưới nhưng rải rác có vảy đen nổi rõ hơn; màu đen trên đỉnh và đầu của cánh trước và các đốm đen trên đầu của cánh sau rộng hơn và kéo dài hơn vào phía trong; ở mặt trước có thêm một đốm ở khoảng trống 1, và cả đốm này và đốm ở khoảng trống 3 trong nhiều mẫu vật được nối với nhau bằng một đường vảy đen dọc theo các đường gân với đường viền đen bên ngoài; còn điểm trong khoảng trống 1 thường kéo dài qua tĩnh mạch 1 vào khoảng trống bên dưới. [3] [4]\n\nNó có sải cánh dài 42–60 mm.','Nó sống ở cận Himalaya Ấn Độ và Pakistan từ Chitral, Kashmir đến Sikkim và Bhutan, độ cao từ 2.000 đến 11.000 ft (610 đến 3.350 m); những ngọn đồi ở miền nam Ấn Độ; Assam; Thượng Mianma : các bang Shan; mở rộng sang Trung Quốc.','Trứng bướm được bảo vệ bởi một lớp vỏ cứng bên ngoài, được gọi là màng đệm . Lớp này được lót bằng một lớp sáp mỏng giúp trứng không bị khô trước khi ấu trùng có thời gian phát triển đầy đủ. Mỗi quả trứng chứa một số lỗ nhỏ hình phễu ở một đầu, được gọi là các lỗ nhỏ ; mục đích của các lỗ này là để cho tinh trùng đi vào và thụ tinh với trứng. Trứng bướm rất khác nhau về kích thước và hình dạng giữa các loài, nhưng thường thẳng đứng và được điêu khắc tinh xảo. Một số loài đẻ trứng đơn lẻ, một số loài khác đẻ theo đợt. Nhiều con cái đẻ từ một trăm đến hai trăm trứng.Ấu trùng bướm, hoặc sâu bướm, tiêu thụ lá cây và hầu như dành toàn bộ thời gian để tìm kiếm và ăn thức ăn. Mặc dù hầu hết các loài sâu bướm là động vật ăn cỏ, một số loài là động vật ăn thịt : Spalgis epius ăn côn trùng có vảy , [45] trong khi các loài lycaenids như Liphyra brassolis là myrmecophilous , ăn ấu trùng kiến.Giai đoạn sinh sản của côn trùng là con trưởng thành có cánh hoặc cánh chuồn','Loài này xuất hiện ở các khu vực có cỏ và ruồi trong nhóm của Chim hải âu sọc và Psyche, cả hai đều có chung cây ký chủ địa phương với Bắp cải trắng. Nó là một loài bay yếu ớt, và bám sát mặt đất để tìm kiếm những bông hoa để kiếm ăn. Vào những ngày nắng, nó bay không ngừng nghỉ, và hiếm khi dừng lại lâu. Loài này thỉnh thoảng có thể được tìm thấy ở các vùng đất hoang, các cách trang trại và đất công viên và đôi khi phổ biến ở những nơi nó xuất hiện. Thông thường, một số cá thể được nhìn thấy cùng một lúc, đặc biệt là ở vùng lân cận của cây chủ. Con đực có thói quen bơi lội trong vũng nước để hút khoáng chất. Mặc dù C & P4 đã mô tả Bắp cải trắng không phải là hiếm ở Singapore, tuy nhiên, việc nhìn thấy loài này đã trở nên ít thường xuyên hơn trong những năm qua.','Trải qua vô số các thử nghiệm về phòng trừ bướm đêm như: dùng thuốc sinh học, dùng bẫy nhử, dùng keo, dùng đèn cao áp đuổi bướm nhưng không hiệu quả. Lão nông chủ trang trại cam khe mây Phương Oánh đã thử nghiệm và thành công với phương pháp ”Mắc màn cho cây ngủ” . Hai năm nay ông đã không còn phải thức đêm ngủ ngày để bắt bướm.','thumbnails/Pieris_canidia.jpg',15,0,'Bướm trắng'),(58,'Apolygus lucorum','Apolygus lucorum','A. lucorum','Apolygus lucorum','insect_Apolygus_lucorum','Các loài Apolygus có màu xanh lục và hình bầu dục khá rộng. Các gai đen không phát sinh từ các đốm đen và đoạn anten thứ 2 thường ngắn hơn chiều rộng của pronotum ở gốc.Trưởng thành: Tháng 7-10\nChiều dài 5-6 mm','Được tìm thấy phổ biến trên khắp nước Anh trên nhiều loại cây bao gồm tansy, tầm ma, cây gai dầu và đặc biệt là ngải cứu','Hemipterans là dị hóa , có nghĩa là chúng không trải qua quá trình biến thái , sự thay đổi hoàn toàn về hình thức giữa giai đoạn ấu trùng và giai đoạn trưởng thành . Thay vào đó, con non của chúng được gọi là nhộng , và giống con trưởng thành ở mức độ lớn hơn hoặc thấp hơn. Các nymphs thay lông nhiều lần khi chúng lớn, và mỗi instar giống người lớn hơn so với trước đó. Chồi cánh phát triển ở giai đoạn sau nhộng; việc chuyển đổi thức phức tạp hơn là sự phát triển của cánh chức năng (nếu họ có mặt tại tất cả) và chức năng cơ quan sinh dục, không có can thiệp nhộng sân khấu như trong holometabolous côn trùng.','A.lucorum ăn nhiều loại thực vật bao gồm tansy , tầm ma , Eupatorium , bao da cáo , cây kế chà là ( Cirsium ), cây liễu ( Epilobium ) và đặc biệt là ngải cứu xuyên qua các mô thực vật và ăn nhựa cây. Con trưởng thành được tìm thấy từ tháng bảy đến tháng mười.','Các thành viên của các họ Reduviidae , Phymatidae và Nabidae là những kẻ săn mồi bắt buộc. Một số loài săn mồi được sử dụng trong kiểm soát dịch hại sinh học ; chúng bao gồm các loài nabids khác nhau , [74] và thậm chí một số thành viên của các họ chủ yếu là thực vật, chẳng hạn như chi Geocoris trong họ Lygaeidae . [75] Các loài hemipterans khác là động vật ăn tạp , xen kẽ giữa chế độ ăn dựa trên thực vật và động vật. Ví dụ, Dicyphus hesperus được sử dụng để kiểm soát ruồi trắng trên cà chuamà còn hút nhựa cây, và nếu bị tước đoạt các mô thực vật sẽ chết ngay cả khi có ruồi trắng.','thumbnails/Apolygus_lucorum.jpg',50,0,'Bọ cánh cứng'),(59,'Limacodidae','Limacodidae','','Limacodidae','insect_Limacodidae','Sâu bướm trưởng thành thường có màu xanh lá cây nhưng cũng có thể có màu cam, đỏ và các màu khác. Sự đa dạng về màu sắc này là đặc trưng của loài sâu bướm đa pha . Trong sâu bướm màu xanh lá cây, ít nhất, các vây lưng bên có giữa nổi bật lưng , ban nhạc màu hoa cà giáp với một sọc màu xanh đậm. Dải màu hoa cà bị phá vỡ bởi các đốm màu xanh lam lớn được bao bọc trực tiếp bởi một đường sọc sẫm màu ngắn và sau đó là một đốm màu vàng. Các gai lớn, hình bầu dục và xiên. Như là một điển hình cho gia đình, prolegs và crochets vắng  mặt.\n\nMặt lưng của cơ thể được trang bị các gai nổi trên các nốt sần nổi bật , các gai này lớn hơn ở ngực và A7. Các đốt cuối này hướng về phía trước và phía sau, giống như sừng; gai của chúng có màu sẫm hơn những phần còn lại. Nọc độc của gai đặc biệt đau đớn. Vì vậy, những con sâu bướm nên được xử lý một cách thận trọng. Chiều dài khoảng 20-39 mm (Cock et al . 1987).','Indonesia nước Thái Lan\nViệt Nam (3 trên từ Bộ Nông nghiệp và Nguồn nước của Chính phủ Australia, 2015)\nbán đảo Malaysia\nJava\nSumatra (trên ba từ Cock và cộng sự . 1987)','mùa đông như một ấu trùng trong kén hình bầu dục lỏng lẻo','Thường cho ăn nhiều loại cây lương thực Biến về hình thức. Nhiều loài urticating với gai trên scoli hoặc trũng verrucae , mọc dài ra và nốt sần đôi khi có thể tháo rời, và mịn loài (được gọi là gelatines) hoặc những người có mụn cóc gelatin. Tất cả đều nằm trên T2, T3 và các đoạn bụng A1-A9. (Hình 1, Hình 2, Hình 3)\nStemma 6 là loại cây bị cô lập nhất trong số các thân cây .\nLabrum thường có nhiều lông (không có ở Chrysopolominae).\nT1 chỉ với setae sơ cấp .\nLồng ngực chân nhỏ đến từng phút.\nNhững kẻ hút máu thay vì cố chấp trên A1-A8 hoặc A1-A7. Crochets thường vắng mặt, với một ngoại lệ ở châu Phi chi taeda (= Pantoctenia ) và Crothaema .\nFrass -flipping lông cứng có thể có mặt.','Để điều trị kích ứng do sâu bướm quấy rầy, hãy cởi bỏ tất cả quần áo bị ảnh hưởng và dán một miếng băng dính vào từng khu vực bị ảnh hưởng, sau đó kéo băng ra ngay lập tức. Điều này sẽ loại bỏ một số sợi lông và chất gây kích ứng và giảm tác động của kích ứng. Việc sử dụng thuốc giảm đau, kem, thuốc kháng histamine và kem dưỡng da có steroid cũng sẽ hỗ trợ làm giảm các triệu chứng.\n\nTránh tiếp xúc với sâu bướm có lông hoặc vật liệu mà chúng đã tiếp xúc. Phải luôn mặc quần áo bảo hộ thích hợp, bao gồm cả kính mắt và găng tay khi tiếp xúc với những côn trùng này. Hầu hết các sự phá hoại của sâu bướm thường tồn tại trong thời gian ngắn và nên được để yên, trừ khi chúng đang gây ra vấn đề, khi đó sẽ được khuyến nghị bởi một cán bộ kiểm soát dịch hại có uy tín. Nhiều loài phá hoại sẽ chết đi do ăn thịt hoặc khi tất cả các nguồn thức ăn cạn kiệt. Tuy nhiên, một số biện pháp kiểm soát phòng ngừa nên được áp dụng để đề phòng sự xâm nhập của Mistletoe browntail đặc biệt là trong hoặc gần các sân trường. Việc loại bỏ tất cả các cây tầm gửi khỏi cây Bạch đàn trong sân trường hoặc các khu vực lân cận trước mùa xuân sẽ ngăn chặn sự xâm chiếm thuộc địa. Làm đất trống hoặc phủ đá cuội ở gốc các thân cây bạch đàn hiện có sẽ giúp ngăn chặn giai đoạn sâu bướm hình thành nhộng và nghỉ ngơi. Trồng các loài cây không thu hút sâu bệnh, khi cần có bóng râm trong sân trường hoặc sân sau, là một biện pháp khác để tránh vấn đề này.','thumbnails/Limacodidae.jpg',NULL,0,'Bọ xít'),(60,'Viteus vitifoliae (grapevine phylloxera)','Viteus vitifoliae','D. vitifoliae','Viteus vitifoliae','insect_Viteus_vitifoliae_(grapevine_phylloxera)','Các dạng không có cánh của côn trùng rất nhỏ, màu nâu vàng, hình bầu dục hoặc hình quả lê và giống như rệp. Các dạng có cánh, ít được nhìn thấy hơn, cũng giống rệp, ngoại trừ các cánh được giữ phẳng trên lưng. Cả hai dạng có cánh và không có cánh đều không có nút chai, cấu trúc giống như ống đuôi ở phía trên bụng, giống như rệp','Phylloxera có nguồn gốc từ miền đông Bắc Mỹ, nơi nó sống trên các cây nho bản địa. Tuy nhiên, loài côn trùng này hiện có mặt ở hầu hết các vùng trồng nho trên thế giới do sự di chuyển của những cây nho nhiễm phylloxera, đặc biệt là vào cuối những năm 1800.','Phylloxera có một vòng đời phức tạp lên đến 18 giai đoạn, có thể được chia thành 4 dạng chính: dạng hữu tính, dạng lá, dạng rễ và dạng có cánh.Các hình thức tình dục bắt đầu với trứng nam và nữ nằm trên mặt dưới của lá nho nhỏ. Cá đực và cá cái ở giai đoạn này thiếu hệ thống tiêu hóa, khi nở ra chúng giao phối rồi chết. Trước khi con cái chết, nó đẻ một quả trứng mùa đông trong vỏ thân cây nho. Trứng này phát triển thành dạng lá . Nymph này, fundatrix (mẹ gốc), trèo lên một chiếc lá và đẻ trứng parthenogenetically trong một túi mật lá mà cô tạo ra bằng cách tiêm nước bọt vào lá. Nhộng nở ra từ những quả trứng này có thể di chuyển sang các lá khác hoặc di chuyển đến rễ nơi chúng bắt đầu nhiễm trùng mới ở dạng rễ. Ở dạng này, chúng đục vào rễ để tìm chất dinh dưỡng, làm nhiễm độc vào rễ bằng một chất độc khiến nó không thể chữa lành. Chất độc này cuối cùng giết chết cây nho. Nhộng này sinh sản bằng cách đẻ trứng đến bảy thế hệ nữa (cũng có thể sinh sản dị biệt) vào mỗi mùa hè. Những con này lây lan sang các rễ khác của cây nho, hoặc sang rễ của các loài dây leo khác qua các vết nứt trên đất. Thế hệ nhộng nở vào mùa thu ngủ đông trong rễ và xuất hiện vào mùa xuân năm sau khi nhựa cây bắt đầu trồi lên. Ở những nơi ẩm ướt, nhộng phát triển thành dạng có cánh, nếu không chúng thực hiện vai trò tương tự mà không cần có cánh. Những con nhộng này bắt đầu lại chu kỳ bằng cách ở trên cây nho để đẻ trứng đực và cái ở mặt dưới của lá nho non, hoặc bay đến một cây nho chưa bị nhiễm bệnh để làm điều tương tự.','Vào mùa thu, nhộng di cư đến rễ nơi chúng ngủ đông trong suốt mùa đông. Mùa xuân năm sau, chúng hoạt động trở lại và tạo ra rễ trên các giống nho nhạy cảm. Những con cái không cánh này có thể quay vòng vô định trên rễ năm này qua năm khác. Vào cuối mùa hè và mùa thu, ở miền đông Hoa Kỳ, một số loài phylloxera sống ở rễ đẻ trứng phát triển thành những con cái có cánh. Những con cái này di cư từ rễ lên thân, nơi chúng đẻ trứng với hai kích cỡ, những con nhỏ hơn phát triển thành con đực và những con lớn hơn thành con cái. Giao phối xảy ra và con cái sau đó đẻ một quả trứng đã thụ tinh duy nhất qua mùa đông trên thân nho. Chính quả trứng này đã làm nảy sinh các thế hệ sinh sống trên lá.','Hiện tại chỉ có một loại thuốc trừ sâu được đăng ký có thể xâm nhập vào túi mật (một sản phẩm có tên Movento, loại thuốc này không có sẵn cho chủ nhà), vì vậy việc kiểm soát phải tập trung vào việc ngăn chặn côn trùng tiếp cận và bám vào bề mặt lá. Một số loại thuốc diệt côn trùng được dán nhãn cho dạng lá của phylloxera nho ở Nam Dakota, nhưng chúng sẽ có hiệu quả khác nhau và chỉ nên được sử dụng khi sự hiện diện của phylloxera đã được xác nhận (tìm những vết ban đầu trên ba chiếc lá già nhất). Hầu hết là thuốc xịt tiếp xúc, sẽ không kiểm soát được phylloxera khi chúng ở trong túi mật, vì vậy chúng cần được áp dụng bắt đầu từ khi chồi có 5 đến 10 lá. Sản phẩm có một số tác dụng còn lại sẽ có hiệu quả nhất. Một trong những sản phẩm chống thấm hiệu quả nhất hiện có cho chủ nhà hoặc các ứng dụng quy mô nhỏ là “Surround”, một sản phẩm có chứa đất sét cao lanh cũng được chấp thuận sử dụng trong các vườn nho hữu cơ được chứng nhận. Nó phải được bón lại sau khi mưa, và lặp đi lặp lại miễn là các lá mới xuất hiện, cho đến khi có 10-12 lá trên mỗi chồi. Xử lý nấm phylloxera vào mùa muộn (khi chồi có hơn 12 lá) không hiệu quả và lãng phí thời gian và tiền bạc.','thumbnails/Viteus_vitifoliae.jpg',51,0,'Rệp'),(61,'Eriophyes vitis','Colomerus vitis','E. vitis','Colomerus vitis','insect_Eriophyes_vitis','Loại bọ này có hình thái tương tự như bọ xít búp nho. Nó có kích thước siêu nhỏ, giống hình con sâu và có màu vàng trắng. Nó mọc đè lên giữa các vảy chồi bên ngoài và mô chồi và ăn lá trong suốt mùa xuân và mùa hè. Mặt trên của lá bị phồng rộp, và mặt dưới của vết phồng rộp có lông và màu trắng, gần giống như sự phát triển của nấm. Mặt dưới lá chuyển từ màu trắng vào đầu mùa và chuyển sang màu vàng hoặc nâu vào cuối mùa. Trong một số trường hợp nghiêm trọng, những con ve này trong một số trường hợp hiếm hoi có thể xâm nhập vào các cụm vào đầu mùa xuân. Virus Grapevine Pinot Gris ( GPGV ) được biết đến là loài vectơ của loài bọ này; tuy nhiên, mức độ lây lan của vi rút này trong PNW vẫn chưa được biết.','Grabouw , Nam Phi .','Mạt rỉ nho rất nhỏ (dài 0,15 mm hoặc 1/100 inch). Chúng là loài thực vật (ăn thực vật), thích ăn các mô nho non vào đầu mùa xuân, gây tổn thương dẫn đến biến dạng  chồi  và  lá  và dẫn đến hoại tử bề mặt được mô tả như sẹo. Người ta tin rằng ve thích các mô mới phát triển, có khả năng do nồng độ chất dinh dưỡng cao hơn; tuy nhiên, tùy chọn này không được xác minh. Bọ ve ăn các tế bào thực vật bằng cách đưa ống định hình (phần miệng) của nó vào một tế bào và tiêu thụ các chất bên trong, mất 10 đến 20 phút để kiếm ăn. Nước bọt của một số loài bọ xít Eriophyid được phát hiện có chứa hormone thực vật  chẳng hạn như các chất tương tự auxin và cytokinin. Khi lắng đọng vào hoặc vào tế bào thực vật, những hormone này gây ra dị dạng trong việc mở rộng mô thực vật (Petanović và Kielkiewicz, 2010). Nói chung, mạt rỉ được tìm thấy chỉ ăn các tế bào ở lớp biểu bì (bề mặt) của mô, không bao giờ xâm nhập vào   lớp phloem .','Trong mùa hè, các đàn ve erineum sống trong các mụn nước ( erinea ) được hình thành khi chúng ăn các bề mặt dưới lá. Các mụn nước bao gồm các đám lông lá phình to. Những vỉ này bảo vệ bọ ve khỏi những kẻ thù tự nhiên và sự tiếp xúc trực tiếp của bình xịt thuốc trừ sâu. Khi dân số tăng lên, một số di chuyển đến các khu vực mới hoặc các lá khác và hình thành các erinea mới. Từ giữa tháng 8 cho đến khi lá rụng, có một sự di chuyển từ erinea trở lại các vị trí trú đông bên dưới vảy chồi.','Các loài ve ăn thịt và bọ cánh cứng là tác nhân kiểm soát sinh học quan trọng đối với các loài ve này.Các loại dầu và thuốc diệt côn trùng mùa sâu được sử dụng cho các loài gây hại khác và các ứng dụng lưu huỳnh đối với bệnh phấn trắng thường kiểm soát loài gây hại này. Các biện pháp kiểm soát trực tiếp dành riêng cho bọ ve thường không cần thiết.Dầu mùa sâu và thuốc diệt côn trùng được sử dụng cho các loài gây hại khác thường kiểm soát loài gây hại này. Ngoài ra, các ứng dụng lưu huỳnh cho bệnh phấn trắng nho thường giữ cho các quần thể bọ ve trong tầm kiểm soát. Lưu huỳnh ướt có hiệu quả hơn so với các công thức lưu huỳnh có thể chảy được. Các biện pháp kiểm soát hóa chất thường không hiệu quả do khả năng bảo vệ bọ ve trong vòng galls.','thumbnails/Colomerus_vitis.jpg',52,0,'Rệp'),(62,'Brevipalpus lewisi(citrus flat mite)','Brevipoalpus lewisi McGregor','B.lewisi','Brevipoalpus lewisi McGregor','insect_Brevipalpus_lewisi(citrus_flat_mite)','Ve phẳng có múi nhỏ hơn ve tetranychid (nhện). Nó di chuyển chậm, phẳng và hình dạng thuôn dài, rộng hơn ở đầu trước. Màu sắc dao động từ nâu đỏ đến đỏ.','Trung Đông, Nam Âu, Viễn Đông, Úc và Bắc Mỹ đến Mexico.','Sâu bọ thích điều kiện ấm áp và khô ráo, quần thể của chúng đạt đỉnh điểm trong những tháng ấm nhất và khô hạn nhất. Khi được nuôi trên lá nho, con ve hoàn thành một thế hệ trong khoảng năm tuần ở 28 ° C và gửi tới 20 quả trứng. Rất ít con đực được biết đến, cho thấy rằng nó chủ yếu sinh sản bằng cách sinh sản .','Loài bọ này thường định cư ở đầu cuống của trái cây họ cam quýt, gần hoặc dưới nút. Quả xanh được ưu tiên hơn quả trưởng thành (đặc biệt là trên tán cây), và cả hai vị trí trên cành và lá.','Thuốc xịt lưu huỳnh được chấp nhận để sử dụng trong vườn cây ăn quả được quản lý hữu cơ.Trong quá trình phát triển của trái, theo dõi sự phát triển của trái để biết trái bị đóng vảy và thâm đen do bọ cánh cứng trên cây có múi gây ra. Trước khi thu hoạch, theo dõi sự phá hại của ve bẹt đối với các cụm hạt, đồng thời theo dõi các loài gây hại khác. Nếu phát hiện, hãy xem xét một ứng dụng thuốc trừ sâu. Bắt đầu điều trị trước khi hạt bị teo.','thumbnails/Brevipoalpus_lewisi_McGregor.jpg',53,0,'Rệp'),(63,'oides decempunctata','oides decempunctata','O. decempunctata','oides decempunctata','insect_oides_decempunctata','Hầu hết các loài cầu trùng có cơ thể từ tròn đến elip, hình vòm với sáu chân ngắn. Tùy thuộc vào loài, chúng có thể có đốm, sọc hoặc không có dấu hiệu nào cả. Cầu gai bảy đốm có màu đỏ hoặc cam với ba đốm ở mỗi bên và một ở giữa; chúng có một đầu đen với các mảng trắng ở mỗi bên.','Châu Âu, Bắc Phi, Châu Âu Nga, Caucasus, Siberia, Belarus, Ukraine, Moldova, Transcaucasia và tây Á.','Cầu trùng ăn thịt thường được tìm thấy trên các loài thực vật chứa con mồi của chúng. Chúng đẻ trứng gần con mồi, để tăng khả năng ấu trùng dễ dàng tìm thấy con mồi. Ở Harmoniac axyridis , trứng nở trong vòng ba đến bốn ngày với số lượng từ vài cái đến vài chục cái. Tùy thuộc vào nguồn tài nguyên sẵn có, ấu trùng trải qua bốn giai đoạn trong 10–14 ngày, sau đó sẽ xuất hiện nhộng . Sau một teneral thời gian vài ngày, người lớn trở thành sinh sản hoạt động và có khả năng tái tạo lại sau, mặc dù họ có thể trở thành sinh sản hoạt động gì nếu eclosing cuối mùa giải. Tổng tuổi thọ trung bình là một đến hai năm.','Nó xuất hiện ở các khu rừng lá rộng Tây Âu, rừng rụng lá phía đông, rừng hỗn giao Sarmatic , ở bìa rừng, đất hoang công viên và vườn và ở thảo nguyên Á-Âu , thảo nguyên Pannonian . Nó được tìm thấy trên bụi rậm và cây rụng lá, trên cỏ, dưới vỏ cây, trong rêu trên cây, trong lớp lá, trên gỗ cọ, mảnh vụn thân gỗ thô và trong đất phù sa .Các loài côn trùng này ăn rệp trên cây và bụi rậm. [6] Những con trưởng thành rải rác trong đám đông và giữa những chiếc lá rụng.','- Ngắt bỏ lá bị hại và lá có nhộng bám, bắt giết bọ non và bọ trưởng thành. - Vệ sinh đồng ruộng, tiêu diệt ký chủ phụ, thu dọn tàn dư thực vật, phơi và đốt bỏ. - Phun thuốc vào lúc sáng sớm hay chiều mát.','thumbnails/oides_decempunctata.jpg',54,0,'Bọ cánh cứng'),(64,'Polyphagotarsonemus latus','Polyphagotars onemus latus','P. latus','Polyphagotars onemus latus','insect_Polyphagotarsonemus_latus','Con trưởng thành: Ve cái dài khoảng 0,2 mm và có đường viền hình bầu dục. Cơ thể của chúng phồng lên và có màu từ vàng nhạt đến hổ phách hoặc xanh lục với một đường sọc ở giữa, nhạt, không rõ ràng, ở gần phần cuối của cơ thể. Con đực có màu tương tự nhưng không có sọc. Hai chân sau của con cái trưởng thành tiêu giảm thành phần phụ giống roi. Con đực nhỏ hơn (0,11mm) và di chuyển nhanh hơn con cái. Chân sau mở rộng của con đực được sử dụng để nhấc nhộng cái và đặt nó ở góc vuông với cơ thể của con đực để giao phối sau này (Peña và Campbell 2005).Trứng: Trứng không màu, trong mờ và có hình elip. Chúng dài khoảng 0,08 mm và được bao phủ bởi 29 đến 37 búi trắng rải rác ở bề mặt trên (Đan Mạch 1980, Peña và Campbell 2005, Baker 1997).\n\nẤu trùng: Những con ve non rộng chỉ có ba cặp chân. Chúng di chuyển chậm và có vẻ hơi trắng do những đường gờ nhỏ trên cơ thể (Peña và Campbell 2005). Khi lớn lên, chúng có kích thước dài từ 0,1 đến 0,2 mm (Ẩn danh a). Giai đoạn tĩnh lặng xuất hiện như một ấu trùng bất động, căng sữa (Baker 1997).\n\nNhộng: Sau một ngày, ấu trùng trở thành một nhộng tĩnh lặng, rõ ràng và nhọn ở cả hai đầu. Giai đoạn nymphal kéo dài khoảng một ngày. Nhộng thường được tìm thấy ở những chỗ lõm trên quả, mặc dù nhộng cái thường do con đực mang theo (Peña và Campbell 2005).','Polyphagotarsonemus latus có phân bố trên toàn thế giới và được biết đến với một số tên thông thường. Ở Ấn Độ và Sri Lanka, nó được gọi là mạt trà vàng, trong khi những người ở Bangladesh gọi nó là mạt đay vàng. Ở một số nước châu Âu, nó được gọi là nhện rộng. Ở các vùng của Nam Mỹ, nó được gọi là mạt nhiệt đới hoặc mạt gỉ rộng (Ẩn danh a).','Ve rộng có bốn giai đoạn trong vòng đời của nó: trứng, ấu trùng, nhộng và trưởng thành. Con cái trưởng thành đẻ từ 30 đến 76 trứng (trung bình năm quả mỗi ngày) ở mặt dưới của lá và ở chỗ lõm của quả nhỏ trong thời gian từ 8 đến 13 ngày rồi chết. Con đực trưởng thành có thể sống từ năm đến chín ngày. Trong khi những con cái chưa giao phối đẻ trứng trở thành con đực, những con cái giao phối thường đẻ 4 quả trứng cho mỗi quả trứng của con đực.Trứng nở sau hai hoặc ba ngày và ấu trùng chui ra khỏi trứng để kiếm ăn. Ấu trùng di chuyển chậm và không phân tán xa. Sau hai hoặc ba ngày, ấu trùng phát triển thành giai đoạn ấu trùng (nhộng) tĩnh lặng. Ấu trùng cái chưa trưởng thành trở nên hấp dẫn đối với những con đực nhặt chúng và mang chúng đến những tán lá mới.','Con đực và con cái rất hiếu động, nhưng những con đực dường như chiếm phần lớn trong việc phát tán một quần thể bọ ve rộng lớn trong sự điên cuồng của chúng để mang những ấu trùng cái đang yên lặng chuyển sang những chiếc lá mới. Khi con cái xuất hiện từ giai đoạn tĩnh lặng, con đực ngay lập tức giao phối với chúng (Anonymous a, Baker 1997, Peña và Campbell 2005). Cũng có những báo cáo về loài ve rộng sử dụng vật chủ là côn trùng, đặc biệt là một số loài ruồi trắng, để di chuyển từ cây này sang cây khác (Palevsky et al. 2001).Các con ve có thể tụ tập thành các kẽ hở và chồi (Đan Mạch 1980). Bọ ve thích mặt bóng râm của trái cây, mặt này thường hướng về phía cây trồng, vì vậy phải dành thời gian và công sức để kiểm tra trái cây thích hợp','Trong khi một số loại thuốc diệt côn trùng được dán nhãn để kiểm soát loài gây hại này, các loại dầu hoặc xà phòng diệt côn trùng thường hiệu quả và ít độc hại hơn đối với môi trường. Để kiểm soát diện tích lớn hoặc trong nhà kính, có sẵn các chất kiểm soát sinh học, bao gồm một số loài ve ăn thịt (Wilkerson 2005, Peña và Campbell 2005, Fan và Petitt 1994, Peña et al. 1996). Ngoài ra, có thể sử dụng phương pháp xử lý nước nóng để kiểm soát bọ ve mà không làm cây bị thương. Điều này liên quan đến việc hạ thấp cây trồng xuống nước được giữ ở 43 đến 49 ° C (109,4-120,2 ° F) trong 15 phút (Ẩn danh a).','thumbnails/Polyphagotars_onemus_latus.jpg',55,0,'Rệp'),(65,'Pseudococcus comstocki(Comstock mealybug)','Pseudococcus comstocki Kuwana','P. comstocki','Pseudococcus comstocki Kuwana','insect_Pseudococcus_comstocki(Comstock_mealybug)','Rệp sáp Comstock cái trưởng thành dài từ 3 đến 5 mm (0,12 đến 0,20 in), không có cánh và có \"17 đôi sợi\" kéo dài từ rìa cơ thể với một đôi dài hơn ở phía sau. Con đực trưởng thành rất nhỏ, tương tự như kích thước của gặm nhấm, và có tuổi thọ ngắn. Các ấu trùng giống như người lớn nữ ngoại trừ \"là nhỏ hơn với ít sáp và không có sợi dài\". Trứng của nó có hình bầu dục dài 0,3 mm (0,012 in) màu cam, tụ lại với nhau trên cành cây, vết cắt trên cây và trên quả vào mùa hè. Trong suốt mùa thu, các cụm trứng được đẻ trong các kẽ hở của vỏ cây. Mỗi khối trứng được gọi là trứng hoặc ổ và nó được bao phủ bởi các sợi trắng giống như bông','Loài này có nguồn gốc từ Đông Á và nó được đưa vào Trung Á, Đông Âu, Hoa Kỳ, Canada, Brazil và Argentina','Trứng nở vào cuối mùa xuân và nhộng ăn lá và chồi non cho đến khi hoàn thành sự phát triển vào khoảng đầu tháng Bảy. Những con trưởng thành này sau đó đẻ trứng nở trong khoảng 11 ngày, và ấu trùng thế hệ thứ hai phát triển thành con trưởng thành vào đầu mùa thu. Những con trưởng thành này đẻ trứng quá đông và trong một số trường hợp, chính chúng đẻ quá đông.','Tấn công chủ yếu là lê, táo và đào. Con trưởng thành và nhộng (con bò) là những loài ăn nhựa sống trên mô xanh, và tụ tập ở đài hoa và đầu cuống của quả gần khi thu hoạch. Tình trạng dịch hại của rệp sáp Comstock bắt nguồn từ sự phát triển của nấm mốc trên mật ong mà nó tiết ra (C), và từ các vấn đề thẩm mỹ và ô nhiễm do sự hiện diện của nó trong quá trình chế biến.','Hóa chất đã được sử dụng để giảm dân số của loài này với hiệu suất 80% mặc dù nó không thành công ở Trung Á. Một hỗn hợp kiểm soát dịch hại sinh học và hóa chất đã loại bỏ thành công các loài này khỏi vườn cây ăn quả và ruộng rau ở nơi từng là một phần của Liên Xô. Parasitoidsvà những kẻ săn mồi được đưa vào California để kiểm soát quần thể loài bao gồm Pseudaphycus malinus , Allotropa aimxifrons , Allotropa burrelli , và Zarhopalus corvinus . [2] Trong một nghiên cứu ở Nhật Bản năm 1980, những con cái trưởng thành còn trinh được lấy từ bí ngô để các nhà khoa học có thể chiết xuất pheromone giới tính của chúng để bắt những con đực.','thumbnails/Pseudococcus_comstocki_Kuwana.jpg',56,0,'Rệp'),(66,'Paranthrene tabaniformis','parathrene regalis','P. tabaniformis','parathrene regalis','insect_Paranthrene_tabaniformis','Các sải cánh là c. 30 mm. Chiều dài của cánh trước là c. 14 mm. Meyrick mô tả nó - Đầu có vạch dọc màu trắng trước mỗi mắt và vòng sau màu vàng. Bụng có các vòng màu vàng trên 2, 4, 6, và đôi khi 7. Xương chày giữa và sau màu cam, có dải đen. Các cánh tiên khá tối, với các mảng hyalin dài che khuất về phía cơ sở; vệt đen hơi tím. Hyaline của Hindwings; tĩnh mạch và lông tơ tối màu termen. [1] Bướm đêm bay từ tháng 5 đến tháng 8 tùy thuộc vào vị trí.','Nó được tìm thấy ở Croatia , Bosnia và Herzegovina , Serbia và Montenegro , Cộng hòa Macedonia và Bulgaria , [2] cũng như Thổ Nhĩ Kỳ , Azerbaijan và Iran .','Ấu trùng có 6 - 7 giai đoạn. Ấu trùng trưởng thành hóa nhộng trong các khoang trong phòng trưng bày ấu trùng. Nhộng được tìm thấy ở trung tâm của cây dương một năm tuổi, hoặc bên dưới vỏ thân và cành của những cây già nhất.','ấu trùng đào kho trong thân và cành cây khi kiếm ăn. Việc cành cây bị hư hại khiến chúng yếu đi và chúng có thể gãy khi gặp gió. Nói chung, các phòng trưng bày ảnh hưởng đến chất lượng của gỗ, khiến nó không thể sử dụng cho mục đích thương mại. Các vết thương cũng tạo điều kiện cho các mầm bệnh thứ cấp xâm nhập.','','thumbnails/parathrene_regalis.jpg',57,0,'Bướm'),(67,'Ampelophaga rubiginosa','Ampelophaga','A. rubiginosa','Ampelophaga','insect_Ampelophaga_rubiginosa','Các sải cánh là 72-100 mm.Ấu trùng của bướm đêm thuộc họ này thường có cơ thể ngắn, nhiều thịt, và có nhiều loài có dạng như con sên. Chân ngực nhỏ, không có chân bụng và ấu trùng chủ yếu bò, trườn. Ấu trùng thường có dạng rất đặc biệt, cơ thể có nhiều gai cứng, gây ngứa, đặc biệt là ở loài Parasa lepida. Ngài (sinh học) được hình thành trong một cái kén rất cứng, còn gọi là nhộng, bên ngoài có một lớp tơ mỏng. Kén có hình tròn, hoặc bán cầu (có một mặt dính để bám chặt vào nơi làm kén). Khi vũ hóa, ngài thoát ra ngoài vỏ kén, mở cánh bắt đầu cuộc sống bay lượn.','Nó được tìm thấy từ phía đông bắc Afghanistan , phía đông quanh rìa phía nam của dãy Himalaya đến Vân Nam , sau đó khắp Trung Quốc đến Viễn Đông Nga , Hàn Quốc. Bán đảo và Nhật Bản . Nó cũng được tìm thấy ở phía nam qua Thái Lan và Việt Nam đến Sumatra và bán đảo Malaysia','Hầu hết các loài đều đa năng lượng, có khả năng tạo ra vài thế hệ trong năm nếu điều kiện thời tiết cho phép. [8] Con cái đẻ trứng trong mờ, màu xanh lục, dẹt, nhẵn, thường đơn lẻ trên cây chủ. Thời gian phát triển của trứng rất khác nhau, từ ba đến 21 ngày.Sâu bướm Sphingid có kích thước từ trung bình đến lớn, thân hình mập mạp. Chúng có năm cặp chân trước . [8] Thông thường, cơ thể họ thiếu bất kỳ sợi lông hoặc tubercules, nhưng hầu hết các loài có một \"sừng\" ở cuối sau, [2] có thể được giảm đến một nút, hoặc vắng mặt, trong trận chung kết instar . [8] Nhiều người khó hiểu rau xanh và nâu, và đã countershading mẫu để che giấu chúng. Những con khác có màu rõ ràng hơn, thường có các đốm trắng trên nền đen hoặc vàng dọc theo chiều dài của cơ thể. Một mô hình của các đường gạch chéo dọc theo cạnh là một đặc điểm chung. Khi nghỉ ngơi, ấu trùngthường giữ chân của nó khỏi bề mặt và cúi đầu xuống bên dưới (tư thế cầu nguyện), giống như Đại nhân sư Giza , dẫn đến cái tên \"bướm đêm nhân sư\". [8] Một số ấu trùng nhiệt đới được cho là bắt chước rắn. [2] [13] Ấu trùng nhanh chóng nôn ra chất dính, thường là chất độc, bám trước những kẻ tấn công như kiến ​​và ký sinh trùng. [8] Tốc độ phát triển phụ thuộc vào nhiệt độ, và để tăng tốc độ phát triển, một số loài ở phía bắc và độ cao phải tắm nắng. [8] Ấu trùng đào sâu vào đất để tạo thành nhộng, chúng ở lại trong hai đến ba tuần trước khi trưởng thành.','','Phương pháp của ông Oánh là dùng màn tuy có kích cỡ phù hợp với cây để trùm bao phủ lên trên thân cây, ngăn cách toán bộ cây trồng với bên  ngoài.\n\nƯu điểm của phương pháp này:  Hạn chế tối đa việc bị bướm và ruồi vàng phá hoại quả, không phải sử dụng đến thuốc bảo vệ thực vật. Nâng cao chất lượng nông sản để bán được giá cao hơn.\n\nSau mỗi vụ thu hoạch màn tuyn được dỡ ra, giặt sach, phơi khô và cho vào túi nilon để bảo quản. Thông thường sẽ dùng được khoảng 5 năm.','thumbnails/Ampelophaga.jpg',58,0,'Bướm'),(68,'Spotted lanternfly','Lycorma delicatula','L. delicatula','Lycorma delicatula','insect_Spotted_lanternfly','dài khoảng 25 mm (0,98 inch) và rộng 12 mm (0,47 inch). Khi nghỉ ngơi, đôi cánh sau màu đỏ thẫm có thể nhìn thấy một phần qua cánh trước bán trong mờ, tạo cho con chuồn chuồn đèn màu đỏ. Các mảng màu đen hình chữ nhật cách nhau gọn gàng tạo màu cho các đầu của cánh trước theo một hình mẫu đôi khi được ví như gạch và vữa. Khi bay, con chuồn chuồn đốm có cánh sau màu đỏ với những đốm đen ở 1/3 gần , một hình nêm màu trắng ở giữa cánh và đầu cánh màu đen đặc. Phần bụng màu vàng nhạt với các dải màu đen và trắng ở trên và dưới. [15] Con cái có một bộ van chân màu đỏ ở đầu xa của bụng, và khi giao phối (giao phối), phần bụng của con cái phồng lên đến mức chúng cảm thấy khó bay. [16]Đom đóm là loài nhảy mạnh và sử dụng đôi cánh của mình để hỗ trợ những cú nhảy này hơn là thực hiện các chuyến bay liên tục.','Trung Quốc, Ấn Độ và Việt Nam','Bắt đầu từ cuối tháng 4 đến đầu tháng 5, nhộng non nở ra từ các hộp trứng của chúng. Một con nhộng trải qua một số giai đoạn chưa trưởng thành ( cá thể ), tất cả đều không có cánh. Trong phiên bản đầu tiên, nó có màu đen với những đốm trắng. Các phiên bản sau có các mảng màu đỏ ngoài các đốm trắng. Cá thể nhộng trùng cuối cùng có đệm cánh màu đỏ và phần trên cơ thể màu đỏ, trước khi lột xác thành dạng trưởng thành, với đầu đen và đôi cánh màu xám có đốm đen. [18] Nhộng nhảy hoặc bò để tìm kiếm thực vật để kiếm ăn. [15] Nhộng non (lần đầu tiên đến lần thứ ba) dường như có phạm vi ký chủ rộng hơn sớm, chúng thu hẹp khi chúng lớn lên. [18] [22]Mặc dù đom đóm đã được ghi nhận ăn một số loài cây thân thảo, điều này rất có thể là do nhộng non mới bắt đầu leo ​​lên hoặc rơi xuống những cây này; Nhộng non và đom đóm trưởng thành không có mối liên hệ đáng tin cậy với cây thân thảo .Ngay từ tháng 7, người ta có thể nhìn thấy những con trưởng thành, chúng giao phối và đẻ trứng từ cuối tháng 9 cho đến khi bắt đầu mùa đông.Các khối trứng chứa 30–50 trứng [24] được bao phủ bởi một lớp sáp màu nâu vàng, thường được gọi là vỏ trứng . [18] Tuổi thọ của con đom đóm là một năm','L.ophiatula gây hại trực tiếp cho cây do ăn nhựa từ thân hoặc cành; thiệt hại đáng kể có thể xảy ra khi nhiều côn trùng đồng thời ăn cùng một cây và có thể biểu hiện như sự già đi của cành hoặc toàn cây. [22] Một ví dụ về thiệt hại gián tiếp là sự hình thành của honeydew, dịch tiết chất thải của ruồi đèn, khi nhựa cây bám trên thân của chúng khi nó khóc từ vết thương; sự tích tụ của nhựa ngọt này có thể thu hút kiến, ong, ong bắp cày và ong bắp cày. [8] Điều này thúc đẩy sự phát triển của nấm mốc trên nhựa cây khi chúng tích tụ ở gốc cây, dẫn đến giảm khả năng quang hợp của cây, thậm chí dẫn đến chết cây.','Giết trứng từ tháng 10 đến tháng 5 bằng cách cạo chúng khỏi bề mặt, \"đóng túi đôi và ném vào thùng rác\", [8] hoặc cạo trứng trực tiếp vào túi Ziploc có cồn hoặc nước rửa tay để giết chúng.Loại bỏ các ký chủ của đom đóm đốm, cây Ailanthus altissima (cây sơn hay cây thiên tuế của Trung Quốc), chỉ để dành các cây đực để dùng làm cây \"bẫy\", vì đom đóm đốm đòi hỏi một bữa ăn từ cây này trước khi đẻ trứng. [1] Những cây \"bẫy\" đực còn lại nên được quấn bằng băng dính bắt đầu từ đầu mùa xuân để bắt nhộng. Các chuyên gia về động vật hoang dã đã cảnh báo che các dải dính trên cây bằng dây gà hoặc một loại dây tương tự khác sau khi có nhiều báo cáo về việc các động vật khác (ví dụ như chim) bị mắc kẹt trên chúng và bị thương và / hoặc chết. [42]\nCây bị nhiễm bệnh có thể được xử lý bằng thuốc trừ sâu toàn thân từ tháng 6 đến tháng 8. Bộ Nông nghiệp Pennsylvania khuyến nghị phun thuốc vào cây và phun vỏ cây, được áp dụng bởi những người phun thuốc chuyên nghiệp, và phun rãnh đất và phun lá, có thể được áp dụng bởi chủ nhà.','thumbnails/Lycorma_delicatula.jpg',59,0,'Bọ'),(69,'Xylotrechus quadripes','Xylotrechus','X.quadripes','Xylotrechus','insect_Xylotrechus_quadripes','- Trứng màu ngà, sâu non trắng ngà luôn nằm thẳng, không có chân, toàn thân gồm nhiều đốt, răng cứng khỏe. _x000B_- Trưởng thành thuộc họ xén tóc dài 17-18mm, ngang 5-7mm. Râu đầu thẳng và có nhiều đốt. Cánh cứng màu đen có các khoang đen hình chữ nhân xen kẽ các vạch vàng xám cũng hình chữ nhân. Lưng ngực màu vàng xám._x000B_- Nhộng trần màu vàng.','Ấn Độ','Bọ cánh cứng cái gửi trứng vào các khe nứt và kẽ hở và dưới lớp vỏ có vảy lỏng lẻo của thân chính và các gốc dày, thích cây tiếp xúc với ánh sáng mặt trời. Một con cái có thể đẻ khoảng 100 quả trứng theo nhóm từ I đến 10 trong vòng đời của nó từ 9 đến 30 ngày Trứng nhỏ (dài 1,3 mm và mặt số 0,5 mm, màu trắng và nở trong vòng 9 đến 15 ngày. Ấu trùng nở ra kiếm ăn ở phần nút chai ngay dưới vỏ cây trong khoảng hai tháng. Sau đó, ấu trùng xâm nhập vào gỗ cứng và tạo đường hầm ở tất cả các hướng. Các đường hầm chứa đầy chất thải của sâu bọ. Tổng giai đoạn sâu bệnh kéo dài khoảng 10 tháng. Cây bụi phát triển đầy đủ có màu vàng nhạt và dài khoảng 2 đến 3 cm. Sự nhú diễn ra trong một buồng gần với ngoại vi thân cây. Giai đoạn nhộng kéo dài từ 3 đến 4 tuần, sau đó biến đổi thành con trưởng thành. Con trưởng thành ở trong đường hầm từ 3 đến 7 ngày và trồi ra ngoài bằng cách khoét một lỗ thoát trên vỏ cây. Lỗ thoát trên thân cây cho thấy sâu đã hoàn thành vòng đời và xuất hiện khi trưởng thành, tổng vòng đời của sâu hoàn thành trong khoảng một năm.','Sâu non đục vào trong phần gỗ của cây. Đường đục ngoằn ngèo, tiện ngang các mạch gỗ, sâu đục đến đâu chúng đùn phân và mạt cưa bịt kín đến đó, có thể đục lên phía trên ngọn hay đục xuống phía dưới gốc.Cây bị hại thường vàng úa, cằn cỗi và héo, trong khi các cành phía dưới vẫn xanh tốt và có dấu hiệu phát triển mạnh chồi vượt, cành thứ cấp. Cây dễ bị gãy gục ở vị trí sâu đục.Sâu đục thân phát triển quanh năm nhưng có 2 đợt chính vào tháng 4, 5 và 10, 11.Trưởng thành ưa đẻ trứng vào những cây ít cành, thưa lá.Phá hoại nặng trên café che,hoạt động mạnh khi nhiệt độ cao,ánh sáng nhiều.Vòng đời của sâu đục thân: 130- 217 ngày.','Biện cáp canh tác:- Trồng cây che bóng làm giảm cường độ ánh sáng.\n\n- Tỉa cành tạo tán, bón phân đầy đủ cho cây phát triển tốt hạn chế bị xén tóc hại.\n\n-  Thường xuyên thăm vườn, vệ sinh vườn sạch sẽ; phát hiện sớm các cây bị gây hại, cưa bỏ kịp thời và đem tiêu hủy.\n\n- Dùng bẫy đèn thu hút trưởng thành và tiêu diệt.\n\n- Thường xuyên theo dõi đồng ruộng để phát hiện sự xuất hiện của trưởng thành..\n\nBiện pháp hóa học:\n\nKhi trưởng thành xuất hiện rộ, phun ướt đều phần vỏ từ gốc sát mặt đất lên đến ngọn, cành lớn.','thumbnails/Xylotrechus.jpg',60,0,'Bọ cánh cứng'),(70,'Cicadella viridis','Cicadella viridis','Cicadella viridis','Cicadella viridis','insect_Cicadella_viridis','Con đực trưởng thành của Cicadella viridis có thể đạt chiều dài 5,7–7 mm (0,22–0,28 in), nhưng con cái khá lớn hơn con đực, đạt 7,5–9 mm (0,30–0,35 in). [2] [3]\n\nPronotum và scutellum của chúng có màu xanh lá cây và màu vàng. [3] Đầu trước màu vàng nhạt, có hai đốm đen gần mắt kép. Cánh trước có màu xanh ngọc lam ở con cái, màu xanh lam hoặc hơi xanh sẫm ở con đực (lưỡng hình giới tính). [3] Mặt bụng màu xanh đen.\n\nẤu trùng có màu hơi vàng và có hai sọc màu nâu chạy từ đầu đến cuối bụng.','Loài này có mặt ở hầu hết châu Âu, trong lãnh thổ phía đông Palearctic, ở Cận Đông, trong lãnh thổ Cận đại và trong lãnh thổ Indomalayan','Rầy trưởng thành chủ yếu có thể gặp từ tháng 7 đến tháng 10  Ở những vùng lạnh hơn của châu Âu, cứ một thế hệ mỗi năm, ở những vùng ấm hơn là hai thế hệ và ở một số vùng thậm chí có ba thế hệ. Trong khí hậu ôn đới của châu Âu , con cái đẻ trứng vào cuối tháng 8 - đầu tháng 11. Loài này sinh trưởng trong giai đoạn trứng. Nhộng xuất hiện vào mùa xuân. Quá trình biến đổi nhộng thành con trưởng thành xảy ra vào tháng Sáu hoặc tháng Bảy.','Những con rầy lá này sống ở những khu vực cỏ rậm rạp, những bãi than bùn và bãi lầy, đồng cỏ ẩm ướt, gần đầm lầy hoặc trong môi trường sống đầm lầy, nhưng đôi khi cũng sống ở những khu vực khô hơn.','- Chăm sóc cây khỏe (trồng mật độ vừa phải, bón phân cân đối…) giữ ruộng sạch cỏ, tránh trồng xen hoặc xung quanh ruộng các cây ký chủ của rầy xanh.- Đốn, hái chè đúng kỹ thuật, đúng thời điểm tránh búp chè ra đúng thời điểm rầy rộ.- Thu hái búp chè khi rầy rộ để hạn chế trứng rầy .Thăm vườn thường xuyên để phát hiện sớm Biện pháp hóa học:  Phun thuốc vào buổi sáng hay chiều mát khi rầy tuổi nhỏ mới xuất hiện','thumbnails/Cicadella_viridis.jpg',61,0,'Rầy'),(71,'Miridae','Miridae','','Miridae','insect_Miridae','Miridae là loài côn trùng sống trên cạn, nhỏ, thường có hình bầu dục hoặc thuôn dài và có chiều dài dưới 12 mm (0,5 in). Nhiều người trong số họ có cái nhìn gù vì hình dạng của phần lồi, phần đầu cúi xuống. Một số có màu sắc rực rỡ và có hoa văn hấp dẫn, số khác thì xám xịt hoặc tối, hầu hết đều không dễ thấy. Một số chi là giống kiến ​​ở một số giai đoạn nhất định của cuộc đời. Họ Miridae không có bất kỳ ocelli nào. Rostrum của họ có bốn phân đoạn. Một tính năng hữu ích trong việc xác định các thành viên của gia đình là sự hiện diện của một con cuneus; nó là đỉnh hình tam giác của corium, phần cứng, sừng của cánh trước, hemelytron. Cuneus có thể nhìn thấy ở gần như tất cả các họ Miridae, và chỉ ở một số họ Hemiptera khác, đặc biệt là họ Anthocoridae, không giống họ Miridae về các mặt khác. Các tarsi hầu như luôn luôn có ba đoạn.','khắp thế giới','Trứng được ký sinh trong các mô mềm của các điểm đang phát triển như cuống lá và nách cành. Thời gian phát triển của Nymphal trung bình là 18 ngày, và tổng vòng đời hoàn thành trong khoảng 22 ngày. Tuổi thọ trưởng thành của con cái là 15 ngày; ở nam giới, tuổi thọ ít hơn một tuần','Bọ thực vật là họ phổ biến nhất trong bộ Hemiptera-Heteroptera. Chúng thường được phát hiện ăn thực vật hoặc đậu trên lá. Một số loài thuộc họ này là động vật ăn cỏ và những loài khác là động vật ăn thịt. Những sinh vật nhỏ, thân mềm này được phân biệt bằng bốn râu phân đoạn, một cái mỏ và một cái cuneus ở hai cánh trước.','Cũng như nhiều loài côn trùng khác, thời gian ngắn ngày và nhiệt độ giảm thường xuyên gây ra hiện tượng chết máy thường xảy ra trong giai đoạn trứng. Đây là trường hợp của nhiều loài Miridae, chúng đẻ trứng ở các phần già hơn hoặc cành cây 1 năm tuổi, và đối với một số họ Anthocoridae, Microphysidae, Reduviidae và Lygaeidae. Trong số họ Nabidae, Himacerus apterus, loài ngủ đông ở giai đoạn trứng, xuất hiện như một ngoại lệ.','thumbnails/Miridae.jpg',NULL,0,'Bọ'),(72,'Trialeurodes vaporariorum','Trialeurodes vaporariorum','T. vaporariorum','Trialeurodes vaporariorum','insect_Trialeurodes_vaporariorum','Con trưởng thành có chiều dài 1–2 mm chiều dài với cơ thể hơi vàng.','các vùng ôn đới trên thế giới','Con cái có khả năng giao phối ít hơn 24 giờ sau khi xuất hiện và thường đẻ trứng ở mặt dưới của lá. Trứng có màu vàng nhạt, trước khi nở thành màu xám. Nhộng mới nở, thường được gọi là nhộng, là giai đoạn sống chưa trưởng thành di động duy nhất. Trong lần xuất hiện nhộng đầu tiên và lần thứ hai, biểu hiện là vảy phẳng màu vàng nhạt / mờ, có thể khó phân biệt bằng mắt thường. Trong giai đoạn sống chưa trưởng thành thứ tư và cuối cùng, được gọi là \"nhộng\", mắt kép và các mô cơ thể khác có thể nhìn thấy khi nhộng dày lên và nhô lên khỏi bề mặt lá. [1]','Tất cả các giai đoạn sống, ngoại trừ trứng và \"nhộng\" đều gây hại cây trồng thông qua việc cho ăn trực tiếp, cắm sâu mầm của chúng vào các gân lá và hút chất dinh dưỡng từ nhựa cây. Là một sản phẩm phụ của quá trình cho ăn, mật ong được bài tiết ra ngoài và chỉ đó có thể là nguồn thiệt hại thứ hai, chính. Đặc điểm thứ ba và có khả năng gây hại nhất là khả năng lây truyền một số vi rút thực vật ở người trưởng thành. Các ký chủ cây trồng bị ảnh hưởng chủ yếu là các loại rau như bầu bí, khoai tây và cà chua, mặc dù một loạt các loại cây trồng và cây trồng không phải cây trồng khác bao gồm cả các loài cỏ dại đều dễ bị nhiễm bệnh và do đó có thể nhiễm bệnh. [2]','Kiểm soát hiệu quả đã được cung cấp trong nhiều năm thông qua việc thả côn trùng có ích, chẳng hạn như aphelinid ký sinh, Encarsia formosa (Gahan). Nếu cần thiết, các chiến lược quản lý dịch hại tổng hợp có thể kết hợp các ứng dụng của thuốc trừ sâu hóa học chọn lọc hoặc thuốc trừ sâu sinh học như Lecanicillium muscarium để bổ sung cho những loài thiên địch này. Đối với phần lớn các loại cây trồng ngoài trời, hóa chất vẫn là phương pháp phòng trừ được sử dụng rộng rãi nhất. [2] Để nghiên cứu quản lý tính kháng sâu bệnh, một bộ gen dự thảo chất lượng cao 787 Mb đã được giải trình tự và lắp ráp.','thumbnails/Trialeurodes_vaporariorum.jpg',62,0,'Rệp'),(73,'Erythroneura apicalis','Erythroneura apicalis','Erythroneura apicalis','Erythroneura apicalis','insect_Erythroneura_apicalis','Trưởng thành 2-2,5 mm chiều dài, với cánh 3-4 mm. Trắng, mắt kép màu vàng đen, vòng đầu với hai đốm đen. Pronotum phía trước, có ba đốm đen quanh. Tấm lá chắn nhỏ trên mỗi bên của một điểm tam giác. Hoặc với những mảng màu nâu nhạt trên cánh.Trứng\nMàu vàng trắng, hình chữ nhật, hơi cong, 0,2 mm.\nNhộng\nĐầu nở trắng, vàng trắng hoặc màu nâu đỏ sau, chiều dài cơ thể 0,2 mm.','Trung Quốc (Mãn Châu), Nhật Bản (Hokkaido), Nhật Bản (Honshu), Nhật Bản (Kyushu), Nhật Bản (Shikoku), khu vực phương Đông, Nga (Primorskiy kray), Nga (S Khabarovsk kray), Nga (Đảo S. Kurile), Trung Quốc , Nga (Viễn Đông), Nhật Bản, Hàn Quốc, Hàn Quốc, Đài Loan.','òng đời rầy xanh (14 - 21 ngày) Empoasca sp và Rầy xanh Empoasca sp ấu trùng và trưởng thành.- Trưởng thành (2 - 21 ngày): Thân dài từ 2,5 - 4 mm, màu xanh lá mạ. Đầu hơi hình tam giác, chính giữa đỉnh đầu có đường vân trắng, và hai bên có chấm đen nhỏ. Cánh trong mờ, màu xanh lục, xếp úp hình mái nhà.\n\n- Trứng (5 - 8 ngày): Có hình hơi cong dạng quả chuối, dài khoảng 0,8 mm. Trứng mới đẻ màu trắng sữa, sắp nở có màu lục nhạt hay hơi nâu. Vòng đời của trứng từ 5 - 8 ngày\n\n- Rầy non (9 - 11 ngày (mùa Xuân); 7 - 8 ngày (mùa Hè); 14 - 16 ngày (mùa Đông)): Rầy xanh non có 5 tuổi, tuy chưa có cánh nhưng gần giống trưởng thành. Rầy mới nở màu trắng trong suốt, dài 1 mm. Rầy càng lớn chuyển dần sang màu xanh. Cuối tuổi 5 cơ thể dài 2mm.','. Tổ chức trong nho, táo, lê, đào hoa. Người lớn và nhộng hút nhựa trên bề mặt của lá, nạn nhân để lại cho thấy những đốm trắng. Lá nặng nhạt, vì vậy thiêu đốt đi.','Động thái quần thể của _ Erythroneura apicalis_ đã được điều tra, và các loại thuốc trừ sâu để kiểm soát loài côn trùng gây hại này đã được đánh giá trong giai đoạn 2006-2009. Kết quả cho thấy, mỗi năm rầy nâu có 3 thế hệ. Họ phá hoại nho từ tháng Năm đến tháng Mười. Rầy trưởng thành có 3 đỉnh. Cao điểm đầu tiên vào giữa tháng Năm, cao điểm thứ hai vào đầu tháng Bảy và cao điểm thứ ba sau cuối tháng Chín. Nhộng rầy nâu cũng có 3 đỉnh. Cao điểm đầu tiên từ cuối tháng Năm đến đầu tháng Sáu, cao điểm thứ hai từ giữa đến cuối tháng Bảy, và cao điểm thứ ba từ cuối tháng Tám đến giữa tháng Chín. Thời kỳ tối ưu để kiểm soát rầy là từ cuối tháng Năm đến giữa tháng Sáu. 70% imidacloprid WP, ​​25% thiamethoxam WP và 40% chlorpyrifos EC có thể kiểm soát rầy lá một cách hiệu quả và nhanh chóng. Tỷ lệ hiệu ứng kiểm soát là hơn 95% từ 1 ngày đến 14 ngày. Hiệu quả kiểm soát của 25% buprofezin WP thấp hơn trong 1 ngày, nhưng nó bắt đầu tăng lên sau 7 ngày. Tỷ lệ hiệu ứng khống chế trong _14 ngày là 100%.','thumbnails/Erythroneura_apicalis.jpg',63,0,'Rầy'),(74,'Papilio xuthus','Papilio xuthus','Papilio xuthus','Papilio xuthus','insect_Papilio_xuthus','Đuôi én châu Á là một loài bướm cỡ trung, màu vàng, có đuôi nổi bật. [10] Nó có sải cánh từ 45 đến 55 mm. [10] Mẫu màu bình thường của nó bao gồm một mẫu màu đen trên nền vàng. [10] Màu sắc của cánh là lưỡng hình về giới tính, với những con cái có dải biên gần rộng hơn ở cánh sau. [10] Các vảy màu xanh ánh kim và màu da cam ngăn cách các dải màu đen trên cánh sau. [10] Các dải màu đen cũng chạy thành các sọc có độ dày khác nhau dọc theo cánh trước. [10] Sâu non bắt chước phân chim và có một đốm trắng và nâu trên đầu. [6] Khi trưởng thành, sâu bướm phát triển cơ thể có màu xanh lục nhạt với các đốm nâu. [6]','được tìm thấy ở Đông Bắc Á, bắc Myanmar, nam Trung Quốc, Đài Loan, bán đảo Triều Tiên, Nhật Bản (từ Hokkaidō đến Yaeyama Quần đảo), Siberia và quần đảo Hawaii. [1] Nó cũng được ghi nhận ở bang Arunachal Pradesh, Ấn Độ, vào năm 2014. [2]','P. xuthus có các thụ thể quang nhạy cảm cao, hay còn gọi là ommatidia, có thể phát hiện một loạt các bước sóng. [11] Sự thích nghi này giúp chúng xác định các thành viên trong loài của chính chúng. Màu sắc và hoa văn riêng biệt của chúng là những gì làm cho chúng khác biệt với các loài bướm khác. Màu cánh có nguồn gốc từ “vảy”, và P. xuthus có vảy màu vàng (kem), cam, đen và xanh lam từ ánh sáng mà mỗi vảy hấp thụ và phản xạ. Các nghiên cứu bằng máy quang phổ cho thấy các vảy màu vàng được hấp thụ trong dải UV đến tím, màu da cam được hấp thụ ở nửa bước sóng thấp hơn của quang phổ nhìn thấy, các vảy màu đen được hấp thụ trong hầu hết dải ánh sáng nhìn thấy và các vảy màu xanh lam hấp thụ rất ít ánh sáng. Các khoảng hấp thụ này là do các phân tử sắc tố chứa trong mỗi vảy cánh. Màu vàng và cam chứa papiliochrome II và màu đen chứa melanin. Các vảy màu xanh lam đặc biệt ở chỗ chúng không có phân tử sắc tố và thay vào đó được tô màu bằng hiện tượng quang học. Sự tương tác của ánh sáng với lớp trên và lớp dưới của quy mô tạo cho chúng màu xanh lam riêng biệt mà chúng ta nhìn thấy. [11]\n\nThực nghiệm thao tác tạo màu cánh đã đạt được thông qua việc sử dụng axit cacboxypeptidase, Molsin. Tiêm Molsin vào nhộng 0-2 ngày, bướm có nhiều vảy cánh đen. Những đối tượng bị biến đổi này đã tạo ra một lượng lớn sắc tố melanin và papiliochrome II. Tiêm Molsin vào nhộng 3-4 ngày không thấy thay đổi màu sắc cánh. Điều này chỉ ra rằng P. xuthus có khả năng có một axit cacboxypeptidase của riêng nó để tạo ra các sắc tố này một cách tự nhiên và hoạt động của nó kéo dài trong hai ngày đầu tiên của quá trình nhộng. Việc sử dụng một lượng axit carboxypeptidase cao hơn cho nhộng ở 0–2 ngày sẽ gây ra sự sản sinh quá mức các phân tử sắc tố, dẫn đến số lượng vảy đen cao. [12]\n\nP. xuthus sử dụng màu sắc và hoa văn của cánh để xác định côn trùng cùng loài. Các hành vi tình dục được khơi gợi từ nam giới chỉ bằng nhận dạng trực quan. Những con đực P. xuthus trưởng thành có thể tìm thấy những đặc điểm không mùi, và trong khi chúng không phân biệt giới tính, chúng có thể xác định một con cái sau khi tiếp xúc cơ thể. [13]','Trong mùa giao phối, những con đực đuôi én châu Á bay qua tán lá cây để tìm kiếm bạn tình. [14] Nếu một con đực bắt gặp một con cái đang nghỉ ngơi trên một cây có cánh mở và ngang, nó sẽ tiếp cận cô ấy và kiểm tra cô ấy bằng cách tiếp xúc các chân trước của mình với các đầu cánh của cô ấy. [14] Ngoài ra, con đực sử dụng các dấu hiệu thị giác để tiến hành nghi lễ giao phối và đặc biệt bị thu hút bởi những mảng màu vàng có khoảng cách gần nhau trên cánh của con cái. [14]\n\nHầu hết các con cái của loài bướm đuôi én châu Á đều giao phối nhiều hơn một lần trong đời. Hành vi này là điển hình của nhiều loài bướm đuôi én khác bao gồm P. glaucus, P. helenus và P. protenor. [3] [15] [16] Bằng cách giao phối nhân lên, con cái có thể làm tăng sự đa dạng di truyền của thế hệ con cái của chúng. [17] Ngoài ra, nhiều lần giao phối cho phép con cái sinh ra số lượng trứng lớn hơn, trong đó có thể lên đến ba mươi quả. [18]','- Đối với những ruộng nhỏ, khi mật độ sâu thấp có thể bắt sâu bằng tay vào buổi sáng sớm hay chiều tối bằng cách bới đất quanh gốc cây bị sâu cắn để bắt sâu.- Dùng bẫy bả chua ngọt để bẫy bướm. Cách làm bẫy bả chua ngọt: Trộn hỗn hợp gồm 4 phần đường + 4 phần dấm + 1 phần rượu + 1 phần nước. Cho vào trong bình đậy kín sau 3 - 4 ngày thì thêm vào 1% thuốc trừ sâu. Quấn giẻ hay bùi nhùi rơm rạ vào đầu gậy nhúng vào bả cắm trên bờ ruộng. Bướm trưởng thành sẽ bay vào ăn bả chua ngọt và bị chết. Cứ 2 - 3 ngày nhúng bả lại 1 lần.- Dùng cám rang thơm trộn với thuốc Vibasu 10G để bẫy sâu. Trộn 2 kg cám với 0,5 kg thuốc, rải cho 1.000 m2 trước khi trời tối. Rải thuốc theo hàng hoặc hốc gần gốc cây.','thumbnails/Papilio_xuthus.jpg',64,0,'Bướm'),(75,'Panonchus citri McGregor','Panonchus citri McGregor','Panonychus citri','Panonchus citri McGregor','insect_Panonchus_citri_McGregor','Mạt đỏ có múi, Panonychus citri, là một loài nhện thường liên quan đến cam quýt, nhưng nó cũng ăn hoa hồng, lê, hạnh nhân và một số loài trang trí lá rộng. Nó là một loài gây hại nghiêm trọng trên cây có múi ở Florida và California. Con cái có màu đỏ, đầy đặn và dài khoảng 0,5 mm. Con đực nhỏ hơn và thuôn về phía sau. Bộ lông (\"lông\") có màu trắng với phần gốc màu đỏ.','phân bố trên toàn thế giới trên cây có múi.','Con cái đẻ từ 20 đến 30 quả trứng gần như hình cầu. Những quả trứng có một \"sợi tóc\" uốn cong nhô lên từ trên xuống được gọi là \"trứng cá\". Con cái đẻ hai hoặc ba quả trứng mỗi ngày và thường kéo một mạng tơ mỏng từ vòi trứng đến bề mặt chất nền. Ấu trùng bọ xít đỏ có múi nở sau 8 đến 30 ngày và có ba cặp chân. Sau đó, chúng phát triển qua hai giai đoạn nhộng (với bốn cặp chân), mỗi giai đoạn kéo dài vài ngày, và sau đó lột xác thành con trưởng thành. Trong thời tiết nóng, Quá trình phát triển từ trứng thành trứng có thể ngắn khoảng 3 tuần, và con trưởng thành có thể sống 18 ngày. Phát triển chậm hơn trong thời tiết mát mẻ. Thời tiết quá nóng, khô hoặc thời gian ẩm độ cao kéo dài không thuận lợi cho sự tồn tại của mạt đỏ trên cây có múi.','Mạt đỏ có múi ăn lá, thân và trái cây có múi cũng như Skimmia japonica , hoa hồng và lê. Nó có thể xâm nhập vào nhà vào mùa thu và mùa xuân để phá hoại cây họ cam quýt trên hiên nhà và phòng tắm nắng. Lúc đầu, bọ ve gây ra hiện tượng lá bị bạc màu khi chúng hút các chất bên trong tế bào thực vật ở lớp biểu bì và trung bì. Vết ăn giống như vết xước làm cho lá và quả non xanh nhợt nhạt đi rõ rệt. Cam và chanh trưởng thành bị thương chuyển sang màu vàng rơm nhạt. Nếu không được kiểm soát, ve đỏ trên cây có múi có thể gây rụng lá hoàn toàn.','Một trong các loại dầu bóng cây, dầu làm vườn hoặc xà phòng diệt côn trùng nên kiểm soát đầy đủ bọ đỏ có múi. Những chất này đều hiệu quả và an toàn cho con người khi sử dụng theo hướng dẫn trên nhãn. Một số hỗn hợp xịt cho cây trồng trong nhà cũng được bán trên thị trường. Những loại này cũng sẽ kiểm soát bọ ve đỏ trên cây có múi.','thumbnails/Panonchus_citri_McGregor.jpg',65,0,'Nhện đỏ'),(76,'Phyllocoptes oleiverus ashmead','Phyllocoptes oleiverus ashmead','Phyllocoptes oleiverus','Phyllocoptes oleiverus ashmead','insect_Phyllocoptes_oleiverus_ashmead','có kích thước nhỏ, khi quan sát dưới kính lúp sẽ thấy bọ non và nhộng có hình nêm, bọ trưởng thành có hình củ cà rốt. Bọ trưởng thành và nhộng tụ lại trên lá, quả và ngọn cành và gây hại, lá bị hại tạo thành lá gỉ sắt, quả bị hại tạo thành quả có vỏ đen','phân bố trên toàn thế giới trên cây có múi.','Trạng thái quá đông của côn trùng và nơi trú ngụ của bọ xít rỉ sắt có múi khác nhau tùy thuộc vào nhiệt độ trong mùa đông. Ở Tứ Xuyên và Chiết Giang, ve trưởng thành được tìm thấy trong chồi nách của cây có múi. Những người khai thác lá và cuốn lá trong mùa đông trên lá chết hoặc cuộn lá và dưới những lát hoa và quả chanh mùa thu; ở Phúc Kiến, chúng mùa đông trên lá và cành xanh trong nhiều loại mạt; ở Quảng Đông, chúng mùa đông trên lá mùa thu. Số lượng phát sinh của bọ xít gỉ sắt có múi thay đổi theo khí hậu. Nó xảy ra từ 18 đến 30 thế hệ một năm, và các thế hệ chồng lên nhau. Ve gỉ sắt nói chung là di truyền biểu sinh, và không có ve trưởng thành đực nào được tìm thấy cho đến nay. Khả năng sinh sản của nó đặc biệt mạnh mẽ. Trứng nói chung rải rác, chủ yếu ở mặt dưới lá và chỗ lõm trên bề mặt quả. Nhộng mới nở nằm yên và hoạt động sau đó. Nhộng bậc hai hoạt động nhiều hơn và bọ trưởng thành hoạt động mạnh; nếu bị quấy rầy, chúng sẽ bò nhanh và có thể tung tăng. Cả ve trưởng thành và nhộng đều ưa bóng râm và kỵ ánh sáng. Chúng có nhiều lá hơn ở cả hai mặt của gân chính ở mặt lưng và ít lá hơn. Trên cây có múi, bệnh này xuất hiện đầu tiên ở phần dưới của ngọn và mặt trong lá, và sau đó chuyển sang Tác hại trên bề mặt quả và lá ngoài. Ve gỉ sắt sống trên cây có múi quanh năm, quy luật xuất hiện và sinh trưởng của chúng thay đổi theo môi trường địa lý, điều kiện khí hậu và giống cây có múi, khi nhiệt độ ban ngày từ 15 ° C trở lên chúng có thể di chuyển đi kiếm ăn. Nhiệt độ trung bình hàng ngày đạt khoảng 15 ℃, chồi mùa xuân bắt đầu đẻ trứng khi chúng nảy mầm. Các chồi mới và lá mềm bắt đầu leo ​​vào đầu tháng 4. Chúng tập trung ở cả hai mặt của gân chính của lá trở lại để gây hại. Sau giữa tháng 5, mật độ côn trùng tăng nhanh, lan rộng trên bề mặt quả vào tháng 7 và tháng 8, quần thể bọ xít phát triển cao nhất trong năm từ tháng 7 đến tháng 8, thời kỳ cao điểm từ tháng 7 đến tháng 10. Có nhiều mạt trên một lá và một quả, có hàng trăm đến hơn nghìn trứng. Có một số lượng lớn xác côn trùng và lớp vỏ lột xác trên bề mặt lá và quả, giống như một lớp bụi mỏng, trước thời kỳ này là thời kỳ thích hợp để phòng trừ bằng hóa chất. Sau tháng 8, một phần quần thể bọ ve chuyển sang chồi và lá mùa thu cùng năm, cho đến tháng 11 vẫn có thể thấy chúng ăn lá và quả. Từ tháng 7 đến tháng 9, chúng thường phát tán tràn lan trong điều kiện nhiệt độ cao hơn và độ ẩm. Ve gỉ sắt có kích thước nhỏ và có thể phát tán và lây lan qua việc vận chuyển côn trùng, chim, thiết bị, cây con và trái cây theo gió. Có 7 loại thiên địch của loài ve này, trong đó giun nhiều tơ là thiên địch hữu hiệu. Chú ý bảo vệ, sử dụng cẩn thận hỗn hợp Boocđô và các chế phẩm đồng khác để phòng trừ bệnh, đồng thời chú ý xu hướng phát triển của bọ xít rỉ sắt ở thời điểm nào để phòng trừ kịp thời.','Mọt rỉ sắt có múi ưa môi trường bóng râm, chúng thường bắt đầu từ dưới và trong tán, lan dần ra ngoài và phần trên của tán, ở giai đoạn đầu hại tập trung trên lá, mức độ gây hại là chủ yếu là trên trái ở giai đoạn sau. Mật độ quần thể côn trùng cao trên mặt sau của lá mới, dưới quả và ở mặt sau của mặt trời. Những vườn cam được quản lý rộng rãi, cây yếu bị thiệt hại nặng. Nhiệt độ cao và khô hạn là điều kiện thuận lợi cho sự xuất hiện của bọ xít gỉ sắt trên cây có múi, chủ yếu xuất hiện vào mùa nhiệt độ cao mùa hè và mùa thu.','Phòng trừ nông nghiệp: Kết hợp tỉa nhựa, cắt bỏ cành rậm rạp, thông thoáng tán, giảm mật độ côn trùng; trồng cỏ ba lá và các loại cây che phủ khác trên mặt đất, tưới nước hợp lý trong thời kỳ khô hạn để duy trì độ ẩm cho vườn cam.\n\nPhòng trừ hóa học: Từ tháng 6 đến tháng 9, phun dung dịch pyridaben 20% 1000 lần, spirodiclofen 24% lần 4000 lần, dung dịch 96% dysenzinc 600 lần, và bón 2-3 lần, cứ cách 30 ngày phun 1 lần.\n\nKhi sử dụng thuốc trừ sâu, vui lòng mặc quần áo bảo hộ và tuân theo các hướng dẫn trên nhãn sản phẩm, chẳng hạn như liều lượng, thời gian sử dụng và khoảng thời gian trước khi thu hoạch.','thumbnails/Phyllocoptes_oleiverus_ashmead.jpg',87,0,'Bọ xít'),(77,'Icerya purchasi Maskell','Icerya purchasi Maskell','Icerya purchasi Maskell','Icerya purchasi Maskell','insect_Icerya_purchasi_Maskell','Con lưỡng tính trưởng thành hình bầu dục, màu nâu đỏ, có lông đen, dài 5 mm','Australia,  New Zealand','Khi trưởng thành, côn trùng vẫn đứng yên, bám vào cây bằng chất tiết sáp, và tạo ra một túi trứng màu trắng trong các rãnh, bằng cách đùn ra, trong cơ thể có hàng trăm quả trứng màu đỏ. Túi trứng sẽ phát triển dài gấp 2-3 lần cơ thể. Nhộng mới nở là giai đoạn phát tán sơ cấp, với sự phát tán được biết là xảy ra nhờ gió và do bò. Nhộng non ở giai đoạn đầu ăn từ gân giữa của lá và cành cây nhỏ, và gây ra phần lớn thiệt hại. Ở mỗi lần thay lông, chúng để lại ở điểm kiếm ăn cũ lớp da cũ và chất tiết dạng sáp mà chúng đã bao phủ chính mình và từ đó tên chung của chúng được đặt ra. Không giống như nhiều loài côn trùng có vảy khác, chúng có chân và khả năng di chuyển hạn chế trong tất cả các giai đoạn của cuộc đời. Nhộng già di chuyển đến các cành cây lớn hơn và cuối cùng khi trưởng thành đến các cành và thân cây. Vòng đời của chúng phụ thuộc nhiều vào nhiệt độ, vì thời gian trong mỗi giai đoạn sống ở nhiệt độ lạnh dài hơn nhiệt độ cao.','Những con đực thực sự là không phổ biến đến hiếm gặp, và trong nhiều trường hợp nhiễm bệnh không xuất hiện. Những con cái thuần chủng chưa được biết đến. Sự tự thụ tinh của một cá thể lưỡng tính sẽ chỉ tạo ra những cá thể lưỡng tính. Sự giao phối giữa con đực và con lưỡng tính sẽ tạo ra cả con đực và con lưỡng tính.','Icerya Purchasi là quan trọng như một trong những thành công lớn đầu tiên của việc kiểm soát sinh học. Việc nhập khẩu bọ rùa vedalia (Novius cardinalis) vào năm 1888-1889 bởi C. V. Riley, sau này là người đứng đầu Bộ phận Côn trùng học của USDA, đã làm giảm nhanh chóng quần thể I. buysi, cứu ngành cam quýt đang phát triển của California khỏi loài gây hại phá hoại này.\n\nMột biện pháp kiểm soát sinh học thứ hai, loài ruồi ký sinh Cryptochetum iceryae cũng đã được đưa đến California như một vật trung gian kiểm soát bổ sung. Chỉ nên sử dụng thuốc diệt côn trùng như một biện pháp kiểm soát nếu không có loài kiểm soát sinh học nào. Đặc biệt chống chỉ định imidacloprid, vì nó không có tác dụng đối với loài này, nhưng rất độc đối với Rodolia cardinalis.','thumbnails/Icerya_purchasi_Maskell.jpg',67,0,'Rệp'),(78,'Unaspis yanonensis','Unaspis yanonensis','Unaspis yanonensis','Unaspis yanonensis','insect_Unaspis_yanonensis','Những con cái trưởng thành có vảy hình vỏ sò, dài 2,5 đến 3,6 mm, màu nâu đen với một\nlợi nhuận thấp hơn (CABI, 2004). Đầu cuối Exuviae có màu vàng nâu. Quy mô nam chưa trưởng thành\nnắp dài, 1,3 đến 1,6 mm, có lông màu trắng, với hai hoặc ba đường gờ dọc','Unaspis yanonensis có nguồn gốc từ Đông Nam Á, được du nhập vô tình\nvào các khu vực hạn chế ở miền nam nước Pháp và miền bắc nước Ý (Liguria). Unaspis citri có trong\nTrung Quốc, Nhật Bản, Hàn Quốc, Pháp, Ý và Fiji','Vòng đời mất 10 đến 12 tuần để hoàn thành trong mùa hè nhưng lâu hơn trong\nthời tiết mát mẻ hơn. Mỗi cá cái có thể tạo ra tới 169 cá thể đầu tiên (trong khoảng thời gian 146 ngày);\nsố con trung bình của mỗi con cái là khoảng 80 con. Trong một thời gian ngắn sau khi nở,\nnhững trường hợp đầu tiên bị thu hút bởi ánh sáng và di chuyển lên trên về phía các cành ngọn hoặc đến\nquả, đặc biệt là nếu lá rụng đã xảy ra. Khi một địa điểm cho ăn đã được chọn,\ncon cái và con đực chưa trưởng thành trở nên không cuống','Loài chủ yếu ở châu Á này thích vùng ôn đới ấm áp Địa Trung Hải và nhiệt đới\nkhí hậu; cam quýt là loài ký chủ của nó. Có khả năng côn trùng vảy, U. yanonensis,\ntrở nên thành lập ở các khu vực cụ thể của Hoa Kỳ, nơi sản xuất cam quýt và ấm\nnhiệt độ cùng tồn tại.','Các tác nhân kiểm soát sinh học hiện có bao gồm ký sinh trùng Aphytis dạng màng nổi\nlingnanensis được sử dụng ở Florida (Mỹ), Argentina, quần đảo Solomon và Cuba và Encarsia\nlounsburyi ở Cuba. Xây dựng chuồng trại để bao bọc cây có múi đã tạo điều kiện cho\nphát hành và thành lập A. lingnanensis trong các lùm cây có múi ở Florida (Brooks & Vitelli,\nNăm 1976). Ở Úc, một loài sâu bướm săn mồi, Batrachedra sp., Gây ra số lượng giảm ngoạn mục\nvề số lượng quy mô bất cứ khi nào quần thể trở nên dày đặc (Hely và cộng sự, 1982).','thumbnails/Unaspis_yanonensis.jpg',68,0,'Rệp trắng'),(79,'Ceroplastes rubens','Ceroplastes rubens','Ceroplastes rubens','Ceroplastes rubens','insect_Ceroplastes_rubens','Vảy sáp đỏ ăn lá, thân, cành và quả của vật chủ. Trên lá, chúng được tìm thấy nhiều hơn ở mặt trên, thường là các đường dọc theo gân lá (Ảnh 1). Khi chúng hút nhựa cây từ cây, phần dư thừa sẽ được thải ra ngoài dưới dạng mật ong, bao phủ các tán lá bằng các chất có đường, chúng trở thành khu trú do nấm đen phát triển (Ảnh 2 & 3). Kiến có xu hướng vảy để thu thập mật ong.','Châu Á, Đông Phi, Bắc (Florida và Hawaii), Nam và Trung Mỹ, Caribê, Châu Âu (trên cây trồng ngoài trời cũng như dưới mái che), Châu Đại Dương. Nó được ghi lại từ Úc, Quần đảo Cook, Fiji, Polynesia thuộc Pháp, Guam, Kiribati, Quần đảo Marshall, New Caledonia, New Zealand, Niue, Quần đảo Bắc Mariana, Palau, Papua New Guinea, Samoa, Quần đảo Solomon và Vanuatu.','Ở Australia, mỗi con cái đẻ khoảng 300 quả trứng, nhưng ước tính 50% số bò cái bị mất trong 24 giờ đầu sau khi nở. Con đực không được biết đến ở hầu hết các quốc gia. Sự lan truyền theo khoảng cách xa của quy mô xảy ra khi bánh xích được mang theo gió hoặc bởi các động vật khác. Sự lây lan cũng xảy ra trên thực vật di chuyển trong khu vực buôn bán làm vườn.','trực tiếp qua đường ăn uống và gián tiếp do nấm mốc tích tụ trên bề mặt lá làm giảm khả năng quang hợp. Cả hai hành động này đều có thể làm cây bị suy yếu, gây rụng lá, chết héo và chết. Thông thường, thiệt hại trực tiếp là nhỏ, nhưng quy mô là dịch hại nghiêm trọng trên cây có múi ở một số quốc gia vì nấm mốc làm giảm chất lượng. Tương tự, vẻ ngoài bẩn thỉu của cây cảnh khiến chúng có vẻ ngoài khó coi và giảm giá trị trong nghề làm vườn.','Kiểm tra đàn giống không bị đóng cặn; nếu có, hãy cắt tỉa những phần bị nhiễm và phun thuốc diệt côn trùng (xem bên dưới). Tỉa bỏ thân, cành, quả bị nhiễm bệnh và đốt bỏ. Tiêu diệt tổ kiến ​​bằng nước sôi mà không làm hỏng cây trồng bị côn trùng vảy, sử dụng mồi kiến ​​thương mại hoặc thuốc pyrethroid tổng hợp (xem bên dưới); không có kiến, ký sinh trùng và động vật ăn thịt sẽ giúp kiểm soát quy mô một cách tự nhiên.','thumbnails/Ceroplastes_rubens.jpg',69,0,'Rệp lá'),(80,'Chrysomphalus aonidum','Chrysomphalus aonidum','Chrysomphalus aonidum','Chrysomphalus aonidum','insect_Chrysomphalus_aonidum','Con cái trưởng thành và ở giai đoạn trung gian có dạng vảy tròn từ phẳng đến lồi vừa phải, đường kính đến 2 mm, mỗi vảy có một điểm dưới trung tâm hơi nhô lên, đôi khi có màu nhạt. Nếu dùng đầu kim nhấc vảy lên, côn trùng bên dưới có màu vàng và dài tới 1,7 mm. Vảy đực hơi nhạt hơn vảy cái, hình bầu dục dài và có kích thước bằng một nửa. Con đực trưởng thành dài 0,7 mm và có một đôi cánh, hai cặp mắt đơn giản, không có miệng và cơ quan sinh dục rất dài. Nhộng đầu tiên dài 0,3 mm và có chân nhưng sau đó sẽ sớm lắng xuống để tạo thành các vảy màu trắng hình tròn (giai đoạn đốm trắng) có chiều ngang lên tới 0,4 mm. Chúng trở nên hợp nhất với quy mô của các giai đoạn tiếp theo, tạo thành điểm dưới trung tâm nhạt màu hơn.','Châu Âu','Tỷ lệ giới tính ở C. aonidum được phát hiện có xu hướng nghiêng về con cái (Nur, 1990). Mỗi con cái trưởng thành đẻ khoảng 50-150 trứng hình bầu dục dưới vảy trong khoảng thời gian từ 1-8 tuần, tùy thuộc vào bộ phận của cây bị nhiễm bệnh (những quả trên lá ít bị nhiễm bệnh hơn những quả bị nhiễm bệnh) (Rose và DeBach, 1978) . Trứng nở theo quy mô và nhộng đầu tiên hoặc nhộng bò đi tìm nơi kiếm ăn thích hợp trước khi chuyển sang lối sống không cuống. Nhộng trùng lứa thứ hai là giai đoạn kiếm ăn chính ở cả hai giới. Phát triển đến trưởng thành mất 7-16 tuần theo nhiệt độ. Ở California, Hoa Kỳ, C. aonidum có tới sáu thế hệ mỗi năm (Gill, 1997). Ở các quốc gia có mùa đông lạnh giá, chẳng hạn như Đài Loan, có thể có ba thế hệ khác biệt mỗi năm (Su, 1983), trong khi ở điều kiện nhiệt đới (và nhà kính sưởi ấm) việc sinh sản diễn ra liên tục và các thế hệ không đồng bộ.','C. aonidum đã khá phổ biến, đặc biệt là ở các vùng trồng cam quýt trên thế giới. Khi hiện tượng ấm lên toàn cầu tiến triển, sự phân bố của nó có khả năng mở rộng theo hướng Bắc và Nam với sự gia tăng của các khu vực sản xuất cam quýt. Các quốc gia có ngành công nghiệp cây có múi mới hoặc đang phát triển ngay bên ngoài vùng phân bố hiện tại của C. aonidum (CIE, 1988) sẽ cần phải thận trọng để loại trừ quy mô nếu có thể. Quy mô cũng có thể trở thành một vấn đề đối với cây cảnh ở những nước này, và có thể trở thành một loài gây hại cho các vật trang trí dưới kính ở các nước ôn đới, như ở Hungary (Reiderné và Kozár, 1994). Nó được đề cập trong danh sách kiểm dịch (Burger và Ulenburg, 1990).','Sử dụng các biện pháp kiểm soát văn hóa và sinh học và xịt dầu từ dầu mỏ lên cây có múi được quản lý hữu cơ.','thumbnails/Chrysomphalus_aonidum.jpg',70,0,'Rệp'),(81,'Parlatoria zizyphus Lucus','Parlatoria zizyphus Lucus','Parlatoria ziziphi','Parlatoria zizyphus Lucus','insect_Parlatoria_zizyphus_Lucus','','','','','','thumbnails/Parlatoria_zizyphus_Lucus.jpg',71,0,'Rệp'),(82,'Nipaecoccus vastalor','Nipaecoccus vastalor','Nipaecoccus vastator','Nipaecoccus vastalor','insect_Nipaecoccus_vastalor','Trứng có màu tím sẫm và do con cái đẻ ra có màu vàng nhạt đến trắng do các sợi sáp tạo thành. Các trường hợp ấu trùng đực và cái được mô tả và minh họa bởi Ghosh và Ghose (1989). Ghose và Ghosh (1990) cung cấp các chìa khóa cho ấu trùng cái thứ nhất, ấu trùng cái thứ hai và thứ ba và con cái trưởng thành.','Ấn độ, Châu Úc, Trung Quốc','quần thể N. viridis đạt đỉnh vào tháng 5 và tháng 10 (Jarjes et al., 1989). Có mối tương quan thuận đáng kể giữa mật độ dân số và nhiệt độ, và mối tương quan âm với độ ẩm tương đối. Các con cái của N. viridis mỗi lần đẻ 90-138 trứng, và giai đoạn trứng và nhộng kéo dài lần lượt là 10-13 và 31-43 ngày. Quá đông diễn ra khi trứng, nhộng và con trưởng thành.','N. viridis mỗi năm (Cilliers và Bedford, 1978). Thế hệ tháng 9-10 của con cái trưởng thành đẻ trứng nở trong tháng 10-12. Các loài bò sát di cư và định cư chủ yếu trong các khu bảo tồn, dưới các lá đài của quả con khi chúng có kích thước bằng hạt đậu hoặc lớn hơn. Thế hệ thứ hai này trưởng thành vào tháng 11 và đẻ trứng nở vào tháng 12. Thế hệ thứ ba của con cái trưởng thành vào khoảng tháng 3-4.','','thumbnails/Nipaecoccus_vastalor.jpg',72,0,'Rầy'),(83,'Aleurocanthus spiniferus','Aleurocanthus spiniferus','A. spiniferus','Aleurocanthus spiniferus','insect_Aleurocanthus_spiniferus','Các quả trứng thường được đẻ gần nhau trên cây lương thực, chẳng hạn như cây họ cam quýt, thường là trên lá. Đom đóm có sáu giai đoạn phát triển: trứng, giai đoạn thu thập thông tin (giai đoạn đầu tiên), hai giai đoạn nhộng trùng không cuống (giai đoạn thứ 2 và thứ 3), nhộng (giai đoạn thứ 4) và trưởng thành. Về mặt nhận dạng trong họ Aleyrodidae, giai đoạn nhộng (giai đoạn 4) hiển thị nhiều đặc điểm chẩn đoán nhất của loài bướm trắng có họ hàng gần.','Châu Phi, Úc, Châu Mỹ, các đảo Thái Bình Dương và Ý','Sự bắt đầu và thời gian của chu kỳ sống, cũng như số thế hệ mỗi năm phụ thuộc nhiều vào khí hậu xung quanh. [5] [6] Nhiệt độ ôn hòa cùng với độ ẩm cao là môi trường lý tưởng để cây sinh trưởng và phát triển thành công. Kuwana và cộng sự. (1927) đã có thể ghi lại khoảng 4 thế hệ mỗi năm, với 7 thế hệ xảy ra trong điều kiện phòng thí nghiệm lý tưởng này. [6] Nghiên cứu này cũng có thể chứng minh sự thay đổi trong thời gian của vòng đời.','Chất lượng và sản lượng trái cây có múi là mục tiêu chính mà các nhà nghiên cứu đang tập trung vào. A. spiniferus gây hại trực tiếp cũng như gây hại gián tiếp cho cây bị nhiễm bệnh. [7] Thiệt hại trực tiếp bao gồm sự suy yếu của những cây bị nhiễm bệnh do nhựa cây ăn vào. Loại thiệt hại thứ hai xảy ra khi ruồi trắng tiết mật trên bề mặt lá. Điều này lại thúc đẩy sự phát triển của nấm mốc, khiến nhiều bộ phận của cây bị nhiễm bệnh như lá, quả và cành bị bao phủ bởi nấm mốc. Điều này cản trở quá trình quang hợp, do đó làm giảm chất lượng tổng thể của cây. Người ta đã quan sát thấy rằng những loài gây hại cây có múi này cũng đã tấn công cây chè, chẳng hạn như Camellia sinensis được tìm thấy ở Nhật Bản. Tuy nhiên, các nhà nghiên cứu phát hiện ra rằng những con cái trưởng thành của quần thể nhiễm bệnh có múi không đẻ trứng trên lá của những cây chè này, và chỉ trên những cây có múi, do đó chứng tỏ tính độc quyền của mỗi quần thể.','các biện pháp kiểm soát hóa học đã được cố gắng để đối phó với sự bùng phát như phun thuốc trừ sâu, có thể được coi là hiệu quả tuy nhiên điều này phải trả giá đắt. Nồng độ thuốc trừ sâu cao này có thể dẫn đến kháng thuốc trừ sâu, và thuốc trừ sâu trong đồ uống trà gây ra các nguy cơ độc hại cho con người. [13] Do đó, do những yếu tố này, nói chung nó không được chứng minh là có hiệu quả đối với A. spiniferus, bao gồm cả các loài ruồi trắng khác trong các hệ thống cây trồng','thumbnails/Aleurocanthus_spiniferus.jpg',73,0,'Rệp'),(84,'Tetradacus c Bactrocera minax','Tetradacus c Bactrocera minax','Bactrocera minax','Tetradacus c Bactrocera minax','insect_Tetradacus_c_Bactrocera_minax','','','','','','thumbnails/Tetradacus_c_Bactrocera_minax.jpg',NULL,0,'Bọ xít'),(85,'Bactrocera dorsalis','Dacus dorsalis(Hendel)','B. dorsalis','Dacus dorsalis(Hendel)','insect_Bactrocera_dorsalis','Trưởng thành ruồi màu nâu, kích thước 7mm, trên lưng ngực giữa có 2 vệt vàng dọc, lưng ngực sau có vệt vàng ngang, 3 vệt này xếp thành hình chữ \"U\". Bụng tròn giống bụng ong và cuối bụng nhọn. Phía lưng bụng có 2 vệt đậm đen hình chữ \"T\". Trứng ruồi hình trái dưa leo, dài 1mm, màu vàng nhạt. Ấu trùng dạng dòi, màu trắng, mới nở dài 1,5mm, đẫy sức có thể dài đến 8mm. Nhộng dạng nhộng bọc nằm trong kén hình trứng dài, màu nâu đỏ.','Đây là loài đặc hữu Đông Nam Á nhưng cũng được du nhập vào Hawaii, quần đảo Mariana và Tahiti.','Vòng đời của ruồi từ 30 - 40 ngày: Trứng: 2 - 3 ngày → Dòi (sâu non): 10 - 18 ngày → Nhộng: 8 - 10 ngày → Trưởng thành: 10 - 20 ngày. Ruồi cái thường dùng bộ phận đẻ trứng chọc thủng vỏ trái và đẻ trứng vào trong vùng tiếp giáp giữa vỏ và thịt trái. Trứng được đẻ thành từng ổ từ 5 – 10 trứng. Dòi nở ra đục và ăn phần mềm trái, thải phân làm ô nhiễm trái, từ đó làm trái thối và rụng.\n\nĐẫy sức dòi cắn vỏ chui ra búng mình rơi xuống đất làm nhộng. Ruồi đẻ trứng mạnh trong giai đoạn quả gần già đến chín. Ruồi phát sinh rộ bắt đầu từ cuối mùa khô, đầu mùa mưa và kéo dài cho đến hết mùa mưa. Ruồi ưa hoạt động trong vườn cây rậm rạp, um tùm.','Loài ruồi này là một loại côn trùng đa thực vì ngoài ổi chúng còn gây hại trên rất nhiều loại quả cây khác, như mận, táo, sapôche, đu đủ, xoài, thanh long, chôm chôm, mãng cầu xiêm... và là một dịch hại nguy hiểm đối với cây ăn quả vì sâu non sinh sống và gây hại trong quả. Ngoài tác hại trực tiếp, ruồi đục quả Phương Đông còn là đối tượng kiểm dịch thực vật của nhiều nước nhập khẩu sản phẩm quả tươi. Ruồi cái thường dùng bộ phận đẻ trứng chọc thủng vỏ trái và đẻ trứng vào trong vùng tiếp giáp giữa vỏ và thịt trái. Vết chích rất nhỏ chỉ nhìn thấy nhờ vết mủ trái chảy ra. Dòi nở ra đục và ăn phần mềm trái, thải phân làm ô nhiễm trái, từ đó làm trái thối và rụng.','','thumbnails/Dacus_dorsalis.jpg',74,0,'Ruồi đục trái'),(86,'Bactrocera tsuneonis','Bactrocera tsuneonis','Bactrocera tsuneonis','Bactrocera tsuneonis','insect_Bactrocera_tsuneonis','Các giai đoạn chưa trưởng thành có bề ngoài tương tự như các giai đoạn Bactrocera khác. Mỗi trong số hai nhánh trước của ấu trùng trưởng thành có khoảng 34 ống. Con trưởng thành lớn hơn so với hầu hết các loài Bactrocera khác. Con cái trưởng thành dài khoảng 11 mm, không kể vòi trứng, với cánh mở rộng khoảng 10 mm; con đực nhỏ hơn một chút. Đầu chủ yếu là màu vàng, với một hình tam giác ô bào màu đen; râu ochraceous, Arista piceous, có gốc màu vàng. Lồng ngực dày đặc, chủ yếu là chất nhờn, với màu vàng, ngắn, màu vàng; một vệt tinh hoàn màu tía hình chữ Y theo chiều dọc trung bình trên lưng, kết thúc ở phía sau ở trung tâm của đờm; một cặp tuyến tinh hoàn màu tía khá mờ nhạt, hơi gợn sóng, bị đứt đoạn ở đường khâu ngang và hợp nhất ở phía sau với các nhánh sau của vệt hình chữ Y, một mảng màu vàng trên mỗi mô sẹo lõm; bìu màu vàng nhạt với hai lông cứng. Các hateres là ochraceous. Chân có chất nhờn, có màu vàng muốt. Bụng có nhiều lỗ thủng, có chất nhờn sáng ở trên, màu vàng ở dưới, và màu nâu ở cuối, với một đoạn ngắn màu vàng nhạt; một vệt dọc màu đen ở giữa, khá rộng, kéo dài chiều dài của bụng, hoặc gần như vậy; các dải ngang xuất hiện trên phân đoạn thứ ba, thứ tư và đôi khi là phân đoạn thứ năm, dải trên đường dọc đánh dấu chéo của phân đoạn thứ ba.','Nhật, Mỹ, Trung Quốc','Thời kỳ tiền đẻ của con cái là 17 đến 25 ngày. Sự đẻ trứng chủ yếu xảy ra vào tháng 7 và tháng 8, và trứng được đẻ dưới vỏ. Trái cây có vỏ dày hiếm khi bị tấn công vì trứng không đủ dài để tiếp cận cùi. Thông thường, một vết thủng do trứng rụng duy nhất được thực hiện trên một quả; từ hai đến sáu trứng được gửi vào một lỗ thủng mà từ đó chỉ có một ấu trùng xuất hiện. Ấu trùng xuất hiện vào khoảng đầu tháng 10 và ăn hết các chất trong lá noãn này đến lá noãn khác, từ hai đến mười lá noãn bị một con giòi phá hoại. Đến đầu tháng 11, ấu trùng trưởng thành, và khoảng thời gian này trái bị nhiễm bệnh rơi xuống đất. Nhồi máu xuất hiện ở hai inch trên cùng của đất. Thỉnh thoảng, ấu trùng rơi xuống đất để hóa nhộng trong khi quả vẫn còn trên cây. Con trưởng thành ăn mật ong do rệp, cầu trùng và rầy chổng cánh tiết ra; điều này dường như cần thiết cho sức khỏe, tuổi thọ và sản xuất trứng trong giai đoạn tiền đẻ trứng. Giao phối thường xuyên rõ ràng là cần thiết, vì điều này xảy ra sau mỗi đợt trứng đã được gửi vào.','Bướm khế chủ yếu sinh sống ở môi trường rừng nhiệt đới khô, rừng thứ sinh và cây bụi.Nơi sống ưa thích của loài bướm này là dưới các tán cây. Đặc biệt, ở Việt Nam loài sinh vật này thường sống và đẻ trứng trên cây khế, đây cũng là một lý do mà chúng được gọi là bướm khế.','','thumbnails/Bactrocera_tsuneonis.jpg',74,0,'Ruồi vàng'),(87,'Spodoptera litura','Prodenia litura','S. litura','Prodenia litura','insect_Spodoptera_litura','Có sự khác biệt nhỏ nhưng rõ ràng về hình thái giữa con đực và con cái của S. litura cho phép dễ dàng phân biệt hai giới tính. Chiều dài cánh trước của con đực là 14–17 mm trong khi chiều dài của cánh trước của con cái lớn hơn một chút và là 15–18 mm. Các đốm vảy trên cánh trước cũng rõ ràng hơn ở con đực. [6]','Châu Á, Châu Đại Dương và tiểu lục địa Ấn Độ','Trứng có hình cầu và hơi dẹt. Mỗi quả trứng có đường kính khoảng 0,6 mm với màu nâu cam hoặc hồng. Những quả trứng này được đẻ trên mặt lá thành từng đợt lớn, mỗi chùm thường chứa vài trăm trứng. Con cái có khả năng sinh sản điển hình từ 2000 đến 2600 trứng. [5] Tuy nhiên, các thí nghiệm đã chỉ ra rằng nhiệt độ cao và độ ẩm thấp có liên quan tỷ lệ nghịch với khả năng sinh sản. [2] Khi đẻ, các lứa trứng được bao phủ bởi lớp vảy lông do con mái cung cấp, tạo ra màu vàng nâu. Khối lượng trứng có tổng đường kính 4–7 mm, và trứng sẽ nở 2–3 ngày sau khi được đẻ. [5]. Chiều dài cơ thể ấu trùng từ 2,3 đến 32 mm. Ấu trùng có màu sắc thay đổi tùy theo độ tuổi. Ấu trùng nhỏ hơn có xu hướng có màu xanh nhạt hơn trong khi những ấu trùng lớn hơn phát triển thành màu xanh đậm hoặc nâu. Một đường sọc màu vàng tươi dọc theo mặt lưng là đặc điểm đặc trưng của ấu trùng. Ấu trùng cũng không có lông. Có thể tìm thấy ấu trùng mới nở bằng cách tìm các vết xước trên bề mặt lá. Vì S. litura sống về đêm nên ấu trùng kiếm ăn vào ban đêm. Vào ban ngày, chúng thường có thể được tìm thấy trong đất xung quanh cây. Có sáu giai đoạn thử nghiệm, và đến giai đoạn cuối cùng, giai đoạn cuối cùng có thể nặng tới 800 mg. [5]. Nhồi mầm kéo dài khoảng 7 đến 10 ngày và diễn ra trên đất gần gốc cây. Nhộng thường dài từ 15–20 mm và có màu nâu đỏ. [5] Một tính năng đặc trưng là sự hiện diện của hai gai nhỏ ở đầu bụng, mỗi gai dài khoảng 0,5 mm. [6]. Bướm đêm trưởng thành dài trung bình 15–20 mm và có tổng sải cánh là 30–38 mm. Cơ thể có màu nâu xám. Cánh trước có hoa văn với các màu xám đậm, đỏ và nâu. Các cánh sau có màu trắng xám với đường viền màu xám. [5] Tuổi thọ trung bình của nữ là 8,3 ngày trong khi của nam là 10,4 ngày','Ở động vật sinh sản hữu tính, sự nhận biết và thu hút bạn tình tiềm năng có thể xảy ra dưới dạng pheromone. [13] Ở các loài bướm đêm, pheromone được sản xuất bởi con cái bởi các tuyến pheromone và được tiết ra để thu hút con đực cùng loài. [14] Việc nhận biết chính xác bạn tình tương thích là điều cần thiết cho sự thành công trong sinh sản vì nếu không làm như vậy sẽ đi kèm với chi phí lớn: lãng phí thời gian và năng lượng, nguy cơ bị ăn thịt cao hơn và giảm số con còn sống. Do đó, có một sự lựa chọn chặt chẽ cho các tín hiệu nhận biết bạn tình chính xác để tối đa hóa khả năng sinh sản. Cả S. litura và S. littoralis đều có chung 11 thành phần tạo nên pheromone của chúng (với số lượng khác nhau), với Z9, E11–14: Ac đóng vai trò là thành phần chính. [13]. Có một mối quan hệ nghịch đảo giữa nồng độ pheromone trong cơ thể của phụ nữ và hành vi kêu gọi của phụ nữ. Điều này là do pheromone được giải phóng trong quá trình nữ gọi. Trước đây, người ta đã tuyên bố rằng tuyến phụ của nam giới ngăn chặn sự kêu gọi của con cái và sau đó, tái giao phối. Khi tiếng gọi bị kìm hãm, nồng độ pheromone sẽ tích tụ trong cơ thể của những con cái được giao phối. Do đó, khi phân tích các tuyến pheromone, những con cái giao phối sẽ có hiệu giá cao hơn những con cái còn trinh. Điều quan trọng cần lưu ý là kết quả này khác với các nghiên cứu trước đây về các loài côn trùng khác. [14]','thuốc trừ sâu luôn được sử dụng trên các loài cây này quanh năm. Điều này đã gây ra sự phát triển nhanh chóng của khả năng kháng thuốc trừ sâu và thuốc trừ sâu ở S. litura. [9] Ngoài ra, lượng thuốc bảo vệ thực vật được sử dụng quá nhiều đã gây ra mối lo ngại về dư lượng thuốc trừ sâu trên thực phẩm, hủy hoại môi trường và tiêu diệt các loài có ích. Do đó, các nghiên cứu gần đây đã tập trung vào các cách sinh học khác để kiểm soát hiệu quả những loài gây hại này. [4] Một nghiên cứu hiện tại về việc kiểm soát loài gây hại này tập trung vào việc sử dụng nấm Nomuraea rileyi trên giai đoạn ấu trùng của loài sâu bướm này. Người ta nhận thấy rằng việc phun dung dịch nấm này lên ấu trùng trong phòng thí nghiệm đã dẫn đến việc kiểm soát hiệu quả giai đoạn cuối giai đoạn thứ hai và đầu giai đoạn thứ ba của ấu trùng trên cây thầu dầu. Khi thử nghiệm trên đồng ruộng, tỷ lệ ấu trùng chết rất cao là 88–97% sau 19 ngày sau khi sử dụng dung dịch nấm.','thumbnails/Prodenia_litura.jpg',74,0,'Bướm'),(88,'Adris tyrannus','Adristyrannus','A. tyrannus','Adristyrannus','insect_Adris_tyrannus','Palpi với khớp thứ hai dày lên và đạt đến đỉnh đầu, và khớp thứ ba trần truồng bị cùn. Ăng-ten có lông cực nhỏ ở nam giới. Metathorax có các búi nhẹ. Bụng có lông thô trên lưng. Xương chày không có xương sống và mặc quần áo với mái tóc dài. Cánh trước có cổ chân cong và đỉnh nhọn. Lề trong chia thùy và có các búi tóc gần gốc và ở góc ngoài. Ấu trùng có bốn cặp chân bụng, nơi đầu tiên có đôi thô sơ','đông nam Siberia, Ấn Độ, đông Trung Quốc, Philippines và Nhật Bản.','Như đã nói ở trên, một vòng đời của loài bướm này khá ngắn, thông thường à từ 1 đến 2 tuần. Cá thể bướm khế có chu trình phát triển cũng giống như các loài bướm khác, bao gồm: Giai đoạn trứng, ấu trùng sâu bướm, nhộng và bướm trưởng thành.Cá thể cái sẽ tiết ra một loại Pheromone thông qua một tuyến ở bụng để thu hút bạn tình. Với bộ râu nhạy bén mà con đực có thể phát hiện ra bướm khế cái cách đó vài km.\n\nSau khi được thụ tinh, cá thể bướm khế cái sẽ đẻ một số trứng có hình cầu, đường kính khoảng 2.5mm ở mặt dưới của lá cây.','','Phương pháp của ông Oánh là dùng màn tuy có kích cỡ phù hợp với cây để trùm bao phủ lên trên thân cây, ngăn cách toán bộ cây trồng với bên ngoài.','thumbnails/Adristyrannus.jpg',75,0,'Bướm'),(89,'Phyllocnistis citrella Stainton','Phyllocnistis citrella Stainton','P. citrella','Phyllocnistis citrella Stainton','insect_Phyllocnistis_citrella_Stainton','Con trưởng thành của CLM (Hình 2) là những con bướm đêm nhỏ với một lớp cánh 4 mm. Chúng có vảy màu trắng và ánh bạc trên cánh trước, với một số mảng màu đen và rám nắng, cộng với một điểm đen trên mỗi đầu cánh. Cánh sau và thân màu trắng, với các vảy rìa dài kéo dài từ rìa cánh sau. Ở tư thế nghỉ ngơi với đôi cánh xếp lại, loài bướm đêm có bề ngoài nhỏ hơn nhiều (khoảng 2,4 mm). Đầu rất mịn và có vảy màu trắng, và lông tơ không có vảy cơ bản. CLM được phát hiện dễ dàng nhất bởi mỏ của ấu trùng ngoằn ngoèo, thường ở mặt bụng của lá. Sâu non có kích thước phút (đến 3 mm), màu vàng lục mờ, nằm bên trong mỏ lá. Đặc điểm của nhộng là trong một tế bào nhộng ở mép lá. Người lớn thường quá ít phút để có thể dễ dàng nhận thấy, và hoạt động vào ban ngày và vào buổi tối.','được tìm thấy trên khắp thế giới, bao gồm Argentina, Úc, Brasil, Trung Quốc, Corse, Costa Rica, Cuba, Ấn Độ, Israel, Malaysia, Mauritius, Nam Phi, México, Philippines, Tây Ban Nha, và Hoa Kỳ.','Trứng của được đẻ đơn lẻ ở mặt dưới của lá cây chủ. Sự xuất hiện của trứng xảy ra trong vòng từ hai đến 10 ngày, khi đó ấu trùng xâm nhập ngay vào lá và bắt đầu kiếm ăn. Sâu non tạo mỏ ngoằn ngoèo trên lá non (đôi khi cả chồi non), dẫn đến lá bị quăn và bị thương nặng. Mìn lá thường ở mặt bụng lá, trừ trường hợp bị sâu bệnh nặng khi sử dụng cả hai mặt lá. Thường chỉ có một mỏ lá trên mỗi lá nhưng nhiễm nặng có thể có hai hoặc ba mỏ trên mỗi lá, và có tới chín mỏ trên các lá lớn đã được tìm thấy ở Florida.','Ấu trùng hình thành các mỏ ngoằn ngoèo trong lá (Hình 3) và hiếm khi ra quả của vật chủ. Những mỏ này được lấp đầy bởi một đường viền trung tâm. Đặc điểm này giúp tách loài sâu vẽ bùa này khỏi sâu vẽ bùa. Ấu trùng sâu vẽ bùa chỉ phá hoại những tán lá non, đỏ rực. Con trưởng thành đẻ trứng ở cả mặt trên và mặt dưới của lá có chiều dài dưới 1,27 cm (1/2 in). Các báo cáo từ Úc cho thấy sự xâm nhập của một đến ba quả mìn trên mỗi lá, trong khi điều kiện ẩm ướt hơn ở các khu vực khác, chẳng hạn như Florida, có thể hỗ trợ nhiều thợ khai thác trên lá hơn (Jones 2001).','kiểm soát sinh học và các ứng dụng của dầu là những phương pháp phù hợp để giúp giảm quần thể CLM. Thiên địch đã có mặt ở Florida đã đối phó với sự phá hoại của sâu vẽ bùa, gây ra tỷ lệ chết ấu trùng và nhộng lên đến 90%. Những kẻ thù tự nhiên này bao gồm loài ký sinh trùng Ageniaspis citricola được giới thiệu thành lập ở hầu hết Florida và là nguyên nhân gây ra tới 30% tỷ lệ tử vong này chủ yếu vào cuối năm (Rogers, Stansly và Stelinski 2009). Rõ ràng, Ageniaspis citricola đã được đưa vào Hawaii cùng lúc với sâu vẽ bùa hại cây có múi. Kể từ đó, Ageniaspis citricola đã lan rộng ra tất cả các đảo và có khả năng kiểm soát tốt (Nagamine và Heu 2003).','thumbnails/Phyllocnistis_citrella_Stainton.jpg',76,0,'Bướm'),(90,'Toxoptera citricidus','Toxoptera citricidus','T. citricida','Toxoptera citricidus','insect_Toxoptera_citricidus','Rệp muội đen có cánh hoặc không cánh, hình dạng và kích thước tương tự như rệp muội nâu Toxoptera aurantii, tuy nhiên đốt râu thứ I, II và III của trưởng thành có cánh có màu đen và trên cauda có mang 25-40 lông nhỏ. Vết trên cánh trước nhạt, bên cạnh đó gân media ở cánh trước của rệp muội đen Toxoptera citricida chẻ đôi 2 lần.','phân bố phổ biến tại vùng Đông Nam châu Á, Australia, New Zealand, quần đảo Pacific, Nam Mỹ, Caribbean, Floria và Nam Phi.','Vòng đời của rệp muội nâu ít phức tạp hơn nhiều so với hầu hết các loại rệp. Ở hầu hết các khu vực trên thế giới, rệp muội nâu vĩnh viễn không có chu kỳ sinh dục, có nghĩa là không có chu kỳ sinh dục vào mùa thu, và do đó, không có con đực, không có trứng và không có trứng. Tất cả các cá thể trong suốt cả năm đều là những con cái sinh sản biểu sinh viviparous. Ở Nhật Bản, có một hình ba vòng chức năng trên cây có múi (Komazaki 1988). Dự kiến, rệp nâu hại cam quýt vĩnh viễn ở các vùng sản xuất cam quýt chính của Florida.','Đây là loài rệp muội gây hại quan trọng nhất trên cây có múi (Citrus). T. citicidus gây hại bằng cách chích hút chồi non, tập trung chủ yếu ở mặt dưới lá, làm chồi biến dạng, lá cong queo còi cọc, không phát triển. Ngoài ra, rệp muội đen còn tiết mật ngọt làm nấm muội đen phát triển, ảnh hưởng đến sự quang hợp của cây. T. citricidus còn là tác nhân quan trọng trong việc truyền bệnh “Tristeza” trên cam quýt. Đây là một loại bệnh đã gây chết nhiều vườn cam quýt trên thế giới.','','thumbnails/Toxoptera_citricidus.jpg',77,0,'Rệp muội đen'),(91,'Toxoptera aurantii','Toxoptera aurantii','Toxoptera aurantii','Toxoptera aurantii','insect_Toxoptera_aurantii','Khi trưởng thành thì chúng có cánh hoặc không cánh. Kích thước của trưởng thành ở con cái (không cánh và có cánh)dài khoảng 1,7-2,1mm. Trưởng thành cái không cánh có hình bầu dục nâu đen hoặc nâu đỏ, bóng. Giai đoạn ấu trùng có màu nâu. Các đoạn nối các đốt râu đầu của trưởng thành cái không cánh và ấu trùng tuổi lớn có màu tối nên râu đầu trông như có sọc. Cánh trước của trưởng thành cái có cánh có pterostigma màu đen sậm và chỉ có 1 gân chẻ đôi media. Ống siphunculi dài gấp đôi cauda. Cả hai bộ phận siphunculi và cauda đều có màu đen. Trên cauda có mang khoảng 8 -19 lông nhỏ.','phân bố tại các vùng nhiệt đới và cận nhiệt đới, Nam Mỹ, châu Phi, châu Á, Úc, vùng Địa Trung Hải, Trung Mỹ, và Hoa Kỳ.','Ở vùng khí hậu nhiệt đới, rầy mềm chủ yếu sinh sản đơn tính và đẻ con, mỗi con cái đẻ trung bình 40 con. Vòng đời: của rầy mềm từ 7- 9 ngày, rầy có thể sống đến 3 tuần. Rầy mềm là môi giới truyền bệnh Tristera, rầy chỉ cần chích hút cây bệnh trong vòng 5- 10 phút là có thể truyền bệnh trong 24 giờ.','Chúng thường gây hại trên cá c vườn cam, quýt, chanh còn tơ. Tương tự như rệp muội nâu đen Toxoptera citricidus, chúng cũng là tác nhân truyền bệnh \"Tristeza\" trên cam quýt. Đây là một loại bệnh đã gây chết nhiều vườn cam quýt trên thế giới. Tại một số nước, chúng còn là tác nhân truyền bệnh \"lá nhỏ Spiroplasma citri\" trên cam quýt và bệnh Đốm vòng trên cà phê cũng như bệnh Đốm vòng trên đu đủ và bệnh Khảm trên dưa leo.','Để xử lý rệp sáp hại cà phê trước hết bà con nên cắt tỉa những cây bị bệnh đem đi tiêu hủy để tránh lây lan. Sau đó sử dụng nấm xanh nấm trắng kết hợp với Siêu đồng phun xịt ướt đẫm hai lần cách nhau 5 ngày. Đồng mát sẽ giúp làm bào mòn lớp cutin của chúng. Từ đó giúp cho nấm xanh – nấm trắng xâm nhập tiêu diệt rệp một cách nhanh chóng. Nấm xanh khi được phun lên cây sẽ ký sinh gây bệnh cho côn trùng sau đó lây nhiễm cho cả đàn. Nấm xanh xâm nhập vào cơ thể rồi gây bệnh cho côn trùng gây hại.Ngoài ra, bà con nên kết hợp phân bón lá giúp lá cây mập, dày để cây quang hợp tốt. Bà con nên phun vào các ngày mát trời, không nắng gắt cũng không mưa dầm.\n\nĐồng thời, bà con cho tưới định kỳ 3 tháng/lần bộ giải pháp Wao boom. Đây là bộ giải pháp vừa tiêu diệt nấm bệnh, vừa kích thích tái tạo hệ rễ. Vừa bổ sung những dinh dưỡng thiết yếu cho cây trồng.','thumbnails/Toxoptera_aurantii.jpg',77,0,'Rầy mềm'),(92,'Aphis citricola van der Goot','Aphis citricola Vander Goot','A. craccivora','Aphis citricola Vander Goot','insect_Aphis_citricola_van_der_Goot','Rệp muội đen có cánh hoặc không cánh, hình dạng và kích thước tương tự như rệp muội nâu Toxoptera aurantii, tuy nhiên đốt râu thứ I, II và III của trưởng thành có cánh có màu đen và trên cauda có mang 25-40 lông nhỏ. Vết trên cánh trước nhạt, bên cạnh đó gân media ở cánh trước của rệp muội đen Toxoptera citricida chẻ đôi 2 lần.','hân bố phổ biến tại vùng Đông Nam châu Á, Australia, New Zealand, quần đảo Pacific, Nam Mỹ, Caribbean, Floria và Nam Phi. Chúng là loài gây hại chủ yếu trên cây có múi (Citrus).','Rệp non và trưởng thành sống tập trung ở ngọn và mặt dưới lá non, ít di chuyển, khi mật độ rệp cao hoặc vào cuối vụ thường xuất hiện dạng có cánh để di chuyển phát tán.-    Rệp trưởng thành đẽ trứng mặt dưới lá. Trong điều kiện nhiệt độ và ẩm độ thích hợp, rệp sinh sản theo cách đơn tính và đẽ ra con, mật đọ tăng rất nhanh.-    Vòng đời trung bình 15 – 20 ngày.-    Rệp chích hút nhựa cây làm lá bị cong và xoăn lại, cây sinh trưởng kém, lá bị vàng héo, quả nhỏ và dễ bị cháy xám.-    Chất dịch do rệp tiết ra dẫn dụ kiến đến và là môi trường cho loài nấm muội phát triển.','Đây là loài rệp muội gây hại quan trọng nhất trên cây có múi (Citrus). T. citicidus gây hại bằng cách chích hút chồi non, tập trung chủ yếu ở mặt dưới lá, làm chồi biến dạng, lá cong queo còi cọc, không phát triển. Ngoài ra, rệp muội đen còn tiết mật ngọt làm nấm muội đen phát triển, ảnh hưởng đến sự quang hợp của cây. T. citricidus còn là tác nhân quan trọng trong việc truyền bệnh “Tristeza” trên cam quýt. Đây là một loại bệnh đã gây chết nhiều vườn cam quýt trên thế giới.','Tại nhiều nước trên thế giới, biện pháp sinh học đã được sử dụng để phòng trị rệp muội đen, trong điều kiện tự nhiên, thành phần thiên địch của rệp muội rất phong phú, có thể khống chế sự bộc phát của rệp muội. Có thể sử dụng các loại thuốc trừ sâu phổ biến gốc Cúc, Carbamate hoặc gốc lân hữu cơ để phòng trị.','thumbnails/Aphis_citricola_Vander_Goot.jpg',78,0,'Rệp đậu màu đen'),(93,'Scirtothrips dorsalis','Scirtothrips dorsalis Hood','S. dorsalis','Scirtothrips dorsalis Hood','insect_Scirtothrips_dorsalis','Bọ trĩ ớt có màu nhạt và chiều dài của ấu trùng lần thứ nhất và thứ hai và nhộng lần lượt là 0,37-0,39, 0,68-0,71 và 0,78-0,80 mm. Con trưởng thành dài khoảng 1,2 mm với đôi cánh sẫm màu và các đốm đen tạo thành các sọc không hoàn chỉnh xuất hiện ở mặt lưng trên bụng (Seal et al. 2009a). Có rất nhiều microtrichia và các gờ phản tinh thể ngang sẫm màu trên bụng cũng như xương ức. Trên các trường vi mô bên của các loài mối bụng là ba bộ đĩa đệm. Lược sau gốc trên phân đoạn VIII đã hoàn tất. Các cánh trước bóng mờ có màu sáng ở xa với các lông mao thẳng. Các cánh trước sở hữu tĩnh mạch thứ hai không hoàn chỉnh, hoặc một dãy gân guốc với hai hoặc ba tĩnh mạch không đều ở nửa xa và tĩnh mạch thứ nhất hoàn chỉnh','miền Nam và Đông Á, Châu Phi và Châu Đại Dương','Các giai đoạn vòng đời của Scirtothrips dorsalis bao gồm trứng, ấu trùng cái đầu tiên và thứ hai, giai đoạn chuẩn bị, nhộng và trưởng thành. Những con cái mập mạp nhét trứng vào bên trong các mô thực vật phía trên bề mặt đất. Trứng có kích thước siêu nhỏ (dài 0,075 mm và rộng 0,070 mm), hình quả thận và có màu trắng kem (Seal et al. 2009a). Trứng nở từ hai đến bảy ngày, tùy thuộc vào nhiệt độ. Ấu trùng và con trưởng thành có xu hướng tụ tập gần gân giữa hoặc viền của lá chủ. Hai giai đoạn ấu trùng được hoàn thành trong tám đến mười ngày và giai đoạn nhộng kéo dài trong 2,6-3,3 ngày. Tuổi thọ của bọ trĩ ớt bị ảnh hưởng bởi các loài cây ký chủ. Ví dụ, ở 28 ° C, mất 11,0 ngày để ấu trùng lứa đầu tiên tiến đến giai đoạn trưởng thành trên cây hồ tiêu và 13,3 ngày trên cây bí. Tuổi thọ trưởng thành của bọ trĩ ớt kéo dài 15,8 ngày trên cây cà tím, nhưng chỉ 13,6 ngày trên cây cà chua','Bọ trĩ xâm nhập và chích hút các loại mụn ở miệng và gây ra tổn thương bằng cách lấy nội dung của các tế bào biểu bì riêng lẻ dẫn đến hoại tử mô. Điều này làm thay đổi màu mô từ bạc sang nâu hoặc đen. Bọ trĩ ớt tạo ra các vết sẹo ăn gây hại, biến dạng lá, và sự đổi màu của chồi, hoa và quả non bằng cách ăn các mô phân sinh của các đầu cuối của cây ký chủ và trên các bộ phận mềm khác trên bề mặt đất. Scirtothrips dorsalis không được báo cáo ăn các mô vật chủ trưởng thành. Theo Sanap và Nawale (1987), con trưởng thành và nhộng của Scirtothrips dorsalis hút nhựa tế bào của lá, gây ra hiện tượng cuốn lá lên trên và giảm kích thước lá. Ví dụ, một sự phá hoại nặng của Scirtothrips dorsalis trên cây hồ tiêu làm thay đổi diện mạo của cây thành cái được gọi là \"bệnh xoăn lá ớt\". Sự xuất hiện của các bộ phận cây bị biến màu hoặc biến dạng cho thấy sự hiện diện của Scirtothrips dorsalis.','Việc phát triển các phương pháp quản lý hiệu quả đối với Scirtothrips dorsalis vẫn còn trong giai đoạn sơ khai. Nhiều khuyến nghị đã được đưa ra bởi Trung tâm Rau quả Thế giới (AVRDC) có thể được coi là các biện pháp quản lý cơ bản đối với dịch hại này. Thực hành quản lý bao gồm luân canh cây trồng, loại bỏ cỏ dại (có thể là vật chủ) và hỗ trợ sử dụng tối đa các loài thiên địch, bao gồm cả động vật ăn thịt và ký sinh trùng, và luân phiên thuốc trừ sâu.','thumbnails/Scirtothrips_dorsalis_Hood.jpg',79,0,'Rệp'),(94,'Dasineura sp. near capsulae','Dasineura sp','Dasineura sp. near capsulae','Dasineura sp','insect_Dasineura_sp._near_capsulae','Những con trưởng thành xuất hiện từ đầu tháng 4 đến cuối tháng 5, sống từ 2–4 ngày. Trứng được đẻ ở phần bên trong của các lá bắc bao bọc cyathium. Ấu trùng sơ sinh di chuyển vào cyathium, nơi chúng gây ra sự hình thành các túi mật. Các túi mật, xuất hiện vào đầu tháng 5, được tạo ra do sự mở rộng và biến dạng của cyathium và ngăn chặn việc sản xuất hạt ở những bông hoa bị nhiễm bệnh. Vào cuối tháng 6 và đầu tháng 7, ấu trùng trưởng thành rời khỏi túi mật, rơi xuống đất nơi chúng xâm nhập vào đất, ngủ đông cho đến mùa xuân năm sau, và hóa nhộng vài ngày trước khi trưởng thành xuất hiện. Các phép thử tính đặc hiệu của vật chủ đối với D. sp. gần capsulae đã được thực hiện, sử dụng 48 cây thử nghiệm trong 17 họ. Loài muỗi vằn đã sinh sản trên 13 cây thử nghiệm (tất cả đều thuộc chi Euphorbia) và đối chứng (E. esula).','Bắc Mỹ , Canada','Con trưởng thành chủ yếu sống về đêm và ẩn náu vào ban ngày. Con cái đẻ nhiều lứa trứng nhỏ (lên đến sáu quả) ở mặt dưới của lá lúa. Những quả trứng lúc đầu có màu đỏ, nhưng đến khi nở, hai đến bốn ngày sau, chúng có màu nâu sô cô la. Những ấu trùng nhỏ bé chui xuống bẹ lá cho đến khi chúng chạm tới nách lá, nơi chúng chui vào thân. Sau khi kiếm ăn khoảng mười ngày và hình thành một túi mật , chúng sẽ hóa nhộng bên trong. Bốn đến bảy ngày sau, chúng sử dụng gai ở đầu bụng để tạo một lỗ trên túi mật gần đầu của nó. Ở đây các côn trùng trưởng thành xuất hiện. Chúng sống trong ba hoặc bốn ngày, và có thể có tới tám thế hệ muỗi vằn trong năm.','Giai đoạn trưởng thành (trong đó giao phối và đẻ trứng) có thể chỉ kéo dài từ một đến vài ngày. Trứng được đẻ giữa các vảy của nụ hoa sau khi nụ bắt đầu nở ra. Các chồi ngủ hoàn toàn không bị nhiễm bệnh. Trứng nở sau hai đến ba ngày. Vì ấu trùng tiêu hóa các mô thực vật nên chúng là giai đoạn gây hại cho thực vật. Có thể có từ một đến chín ấu trùng trong một nụ hoa. Ấu trùng dường như ăn các mô chồi và trên cuống giữ các nụ hoa riêng lẻ đến cuống trong cụm hoa đang phát triển. Ấu trùng có thể rơi xuống đất sau khi cho ăn, sau đó hóa nhộng và chuyển sang giai đoạn trưởng thành. Trong điều kiện phòng thí nghiệm, những nụ hoa bị nhiễm bệnh đã trưởng thành sau 12 ngày. Nụ hoa có thể đẻ trứng liên tục từ tháng Giêng đến tháng Ba. Khi thực vật tiến tới nảy chồi sinh dưỡng, sự rụng trứng cũng xảy ra trên các mô phân sinh chồi mới. Các chồi sinh dưỡng bị nhiễm bệnh sưng lên và các lá bên ngoài cuộn tròn lại bọc lấy ấu trùng bên trong. Oviposition tiếp tục cho đến cuối tháng Năm. Trong suốt mùa hè, mùa thu và đầu mùa đông ở Florida, ấu trùng dường như đi vào giai đoạn phát triển và ở lại trong đất. Các chồi sinh dưỡng bị nhiễm bệnh sưng lên và các lá bên ngoài cuộn tròn lại bao bọc lấy ấu trùng bên trong.','Các phương pháp kiểm soát vẫn đang được điều tra (Lyrene và Payne 1995). Người lớn dễ dàng bị giết bằng thuốc diệt côn trùng. Tuy nhiên, lịch sử sống đa chủng và tuổi thọ trưởng thành ngắn của chúng đòi hỏi phải theo dõi cẩn thận và xác định thời điểm sử dụng thuốc diệt côn trùng. Liên hệ với văn phòng hoặc đại lý mở rộng dịch vụ hợp tác tại quận của bạn để biết các loại thuốc diệt côn trùng mới nhất được áp dụng. Giai đoạn ấu trùng cho ăn và trứng ít dễ bị chết hơn, vì những giai đoạn này ít nhất được bảo vệ một phần bởi mô thực vật xung quanh. Ấu trùng và nhộng trong đất có thể dễ bị nhiễm thuốc trừ sâu trong đất. Bất kỳ biện pháp xử lý côn trùng nào trong thời kỳ ra hoa của cây việt quất phải được áp dụng một cách thận trọng vì côn trùng thụ phấn đang hoạt động mạnh vào thời điểm này. Ngoài ra, Thuốc trừ sâu có thể được áp dụng sau khi ra hoa khi các mô phân sinh sinh dưỡng đang bị tấn công và các quần thể muỗi vằn đang phát triển. Thời điểm này sẽ làm giảm số lượng ấu trùng quá lớn và sự tấn công của muỗi vằn tiếp theo vào mùa đông và mùa xuân năm sau.','thumbnails/Dasineura_sp.jpg',80,0,'Sâu non'),(95,'Lawana imitata  (Melichar, 1902)','Lawana imitata Melichar','Lawana imitata (Melichar, 1902)','Lawana imitata Melichar','insect_Lawana_imitata_(Melichar,_1902)','Bướm đêm lông trắng là một loài côn trùng đặc biệt với sải cánh dài từ 26 đến 34 mm (1,0 đến 1,3 in). Con trưởng thành có màu trắng tinh, các cánh chia thành năm chùm mỏng như lông vũ, hai phần tạo thành cánh trước và ba phần tạo thành cánh sau. Loài côn trùng này sống về đêm, nổi lên vào lúc hoàng hôn và có cánh trong tháng 6 và tháng 7. Các ấu trùng có màu xanh, với sọc vằn trên lưng màu vàng và những túm lông nhạt.','Loài bướm đêm này được tìm thấy ở phần lớn châu Âu và Trung Đông, xa về phía đông như Iran, cũng như Bắc Phi. Ở Anh, nó phổ biến ở Anh và xứ Wales nhưng địa phương hơn ở miền nam Scotland và ở các vùng ven biển phía tây, nam và đông Ireland.','Bướm trắng có thể tạo ra tới 300 quả trứng cùng một lúc nằm ở mặt dưới lá. Sau 4 – 12 ngày, những quả trứng nhỏ, màu trắng, hình bầu dục. Chúng đi vòng quanh mặt dưới của chiếc lá cho đến khi tìm thấy một nơi để kiếm ăn. Các nữ thần mất khả năng đi lại và sẽ ở cùng một chỗ. Trông giống như những con côn trùng nhỏ, phẳng không có chân hoặc râu.Các nữ thần dần dần lớn hơn khi chúng tiến triển qua bốn giai đoạn instar. Cuối cùng, chúng nổi lên như những con trưởng thành có cánh, giống như bướm đêm. Toàn bộ vòng đời của ruồi trắng mất 14 – 60 ngày, tùy thuộc vào nhiệt độ. Trong điều kiện lý tưởng (khoảng 80 F), chúng sẽ đến tuổi trưởng thành trong khoảng 3 tuần.','Bướm trắng có thể truyền nhiều loại bệnh sang rau và cây cảnh. Nhiều trong số này, chẳng hạn như virut xoăn lá vàng cà chua, có thể tàn phá mùa màng.','Dùng phương pháp thủ công: Bạn cần quan sát và thường xuyên kiểm tra vườn cây của mình. Truy tìm trứng sâu bướm và sâu bướm và loại bỏ chúng ngay sau khi bạn vừa phát hiện.Dùng lưới che phủ cho vườn cây: của bạn với lưới có nhiều lỗ sẽ vẫn cung cấp lưu lượng không khí và ánh sáng mặt trời trong khi cách ly với sâu.\n\nTrồng xen canh các loại thảo dược để sua đuổi bướm: Ví dụ như các loại cây: Bạc hà, oải hương, ngãi cứu, xô thơm… Những cây này sẽ giúp sâu bướm và những loài gây hại khác tránh xa.','thumbnails/Lawana_imitata_Melichar.jpg',81,0,'Rệp'),(96,'Green moth wax cicada','Salurnis marginella Guerr','Salurnis marginella','Salurnis marginella Guerr','insect_Green_moth_wax_cicada','Thân trưởng thành dài 5-6mm, cánh trước màu xanh vàng, mép trước, mép sau và mép ngoài màu nâu sẫm, mép sau là một mảng sẫm màu ở 1/3 góc hông, khi nghỉ, trái và các cánh phải đứng gần nhau. Ve sầu sáp bướm xanh là con trưởng thành, thân dẹp. Trứng có màu xanh nhạt, hình quả chuối ngắn, dài khoảng 1,3mm. Nhộng màu xanh lục, có 4 sọc dọc màu nâu vàng ở ngực và lưng, 2 chùm lông trắng bằng giấy sáp ở cuối bụng, và các bông sáp trắng ở hai bên và sau bụng. Ở trung và hạ lưu sông Dương Tử, mỗi năm có một thế hệ, và thời kỳ xuất hiện của mỗi trạng thái côn trùng muộn hơn khoảng 10 ngày so với ve sầu sáp hại trà. Nhộng và sâu non gây hại bằng cách hút nhựa của thân và lá non','G. mellonella lần đầu tiên được báo cáo là loài gây hại ở châu Á , nhưng sau đó lan sang miền bắc châu Phi , Anh , một số vùng ở châu Âu , bắc Mỹ và New Zealand . [3] Loài này hiện phân bố trên toàn cầu. [1] Nó đã được báo cáo ở 27 quốc gia châu Phi, chín quốc gia châu Á, năm quốc gia Bắc Mỹ, ba quốc gia Mỹ Latinh, Úc , mười quốc gia châu Âu và năm quốc đảo. Dự báo dịch hại có thể lây lan xa hơn, đặc biệt là do biến đổi khí hậu .','Con trưởng thành xuất hiện vào mùa xuân và mùa hè và sống ở các vùng núi có độ cao thấp hoặc giữa các cây trên mặt đất bằng phẳng. Nhộng hoặc con trưởng thành đôi khi gây hại cho một số cây nông nghiệp.','Con trưởng thành xuất hiện vào mùa xuân và mùa hè và sống ở các vùng núi có độ cao thấp hoặc giữa các cây trên mặt đất bằng phẳng. Nhộng hoặc con trưởng thành đôi khi gây hại cho một số cây nông nghiệp.','G. mellonella gây thiệt hại kinh tế lớn trong ngành nuôi ong mật; Miền Nam Hoa Kỳ mất 4-5% lợi nhuận mỗi năm do loại dịch hại này. [3] Để ngăn ngừa hoặc quản lý sự xâm nhập, người trồng trọt được khuyến khích duy trì các điều kiện vệ sinh cho đàn ong của họ, vì nó sẽ giữ cho đàn ong mạnh mẽ để họ có thể ngăn chặn G. mellonella . Các vết nứt và kẽ hở cũng nên được bịt kín để G. mellonella trưởng thành không thể đẻ trứng ở đó. Nên thay lược thường xuyên và loại bỏ lược bị nhiễm khuẩn càng sớm càng tốt.Xử lý nhiệt độ cũng tiêu diệt G. mellonella ở tất cả các giai đoạn trong vòng đời của nó. Xử lý nhiệt giữ lược và thiết bị nuôi ong ở 45-80 ° C trong 1–4 giờ, hoặc trong nước nóng trong 3-5 giờ. [10] Tuy nhiên, đun nóng ở nhiệt độ này có thể khiến sáp bị chảy xệ và biến dạng. Xử lý lạnh làm nguội lược xuống -15 đến -7 ° C trong 2-4,5 giờ','thumbnails/Salurnis_marginella_Guerr.jpg',87,0,'Bọ xít'),(97,'Deporaus marginatus','Deporaus marginatus Pascoe','D. marginatus','Deporaus marginatus Pascoe','insect_Deporaus_marginatus','Nó có màu nâu nhạt với elytra đen(vỏ cánh)','nguồn gốc từ châu Á nhiệt đới, chúng xuất hiện ở Pakistan, Ấn Độ, Bangladesh, Myanmar, Thái Lan, Malaysia và Singapore.','Con cái trưởng thành sử dụng vòi trứng của mình để gửi trứng đơn lẻ vào các hốc nhỏ được đào trên mặt trên của một chiếc lá non gần gân giữa; Sau đó, cô ấy cắt bỏ chiếc lá gần cuống từ mép này sang mép khác, bao gồm cả gân giữa, sau đó nó rơi xuống đất. [1] Trứng nở sau khoảng hai ngày, và ấu trùng chui vào mô lá. Sau trạng thái ấu trùng kéo dài khoảng mười một ngày, ấu trùng thoát ra khỏi lá và tạo thành các khoang đất để hóa thành nhộng. Sau khi trải qua quá trình biến thái, những con trưởng thành xuất hiện trong khoảng tám ngày. Sáu ngày sau, chúng trưởng thành hoàn toàn và bắt đầu sinh sản, giao phối thường diễn ra vào sáng sớm, và kéo dài khoảng một giờ. Khả năng sinh sản của con cái trung bình là 614. Con cái sống được khoảng mười tuần và con đực sống được khoảng một tuần','Đuông trưởng thành cạo lớp bề mặt của lá xoài khiến lớp lá xoài chuyển sang màu nâu, vò nát và biến dạng. [1] Họ cũng cắt \"khung cửa sổ\" giữa các tĩnh mạch. Dấu hiệu rõ ràng nhất của sự nhiễm bệnh là sự xuất hiện của những chiếc lá bị cắt trên mặt đất bên dưới gốc cây, và những chồi non bị tước lá, có thể được nhìn thấy từ xa. Cây bị nhiễm bệnh làm giảm tốc độ sinh trưởng, ra hoa kém và năng suất thấp hơn, sự phát triển của chồi rễ có thể bị chậm lại và ghép không đạt','','thumbnails/Deporaus_marginatus_Pascoe.jpg',82,0,'Bọ cắt lá'),(98,'Hofmannophila pseudospretella','Chlumetia transversa','H. pseudospretella','Chlumetia transversa','insect_Hofmannophila_pseudospretella','Trứng có hình elip với các rãnh dọc song song nối với nhau bằng các đường ngang mảnh. Màu sắc từ trắng sáng đến vàng. Sâu non có đầu màu nâu, thân màu trắng đục mờ và chân màu nâu vàng nhạt. Do phần thân trong suốt nên nó có thể thay đổi màu sắc tùy thuộc vào thành phần ruột, lần lượt phụ thuộc vào màu sắc của các loại vải được ăn vào. Nhộng có màu nâu vàng và bao gồm các bộ nhộng có móc câu chắc chắn trên các đoạn cuối của cơ thể bụng. Các cá thể trưởng thành có lông màu vàng nhạt xen kẽ với các mảng màu nâu đen. Mỗi cánh có một đốm hình đĩa nổi bật và các đốm tế bào nhỏ hơn màu nâu đen. Cánh sau có màu xám nâu, trong khi đầu, ngực và bụng màu nâu xám đen. Ăng-ten rất đơn giản và dạng sợi. [2] Sải cánh từ 15 - 26 mm.','Các nước châu Âu và châu Á','Thông thường, có tới 260 noãn được đẻ bởi một con cái trong một vòng đời, đơn lẻ hoặc thành từng đợt. [2] Những con cái lớn đã được báo cáo đẻ 400 - 500 trứng. [10] Trong điều kiện thuận lợi, trứng nở 10 - 20 ngày sau khi được đẻ. [11]. Ấu trùng hoạt động tích cực từ tháng 6 đến tháng 4, trong thời gian này chúng quay các ống mềm bằng thức ăn mà chúng ăn, để lại cặn bẩn và tơ. Chúng yêu cầu độ ẩm tương đối cao để phát triển thành công đến khi trưởng thành, và thời gian ở giai đoạn nhộng của chúng được rút ngắn do nhiệt độ môi trường cao hơn. [11] Mặc dù chúng có thể xâm nhập trong điều kiện không thuận lợi, chúng bị chết do sương giá nghiêm trọng. [12] Trước khi hóa nhộng, ấu trùng rời khỏi nơi kiếm ăn sơ sinh của chúng và có thể di chuyển trong 2 - 3 ngày trước khi tìm một nơi thích hợp mới để làm nhộng. [11].','Con trưởng thành thường hoạt động từ tháng 5 đến tháng 9, mặc dù chúng có thể được tìm thấy vào mọi thời điểm trong năm trong các tòa nhà có hệ thống sưởi. Chúng đặc biệt bị thu hút bởi ánh sáng và có thể bay quanh năm. Ve Cheyletus eruditus dường như là một kẻ săn mồi đáng kể của loài bướm đêm này.','','thumbnails/Chlumetia_transversa.jpg',83,0,'Bướm'),(99,'Idioscopus nitidulus','Mango flat beak leafhopper','Idioscopus nagpurensis','Mango flat beak leafhopper','insect_Idioscopus_nitidulus','','Đông Nam Á, Châu Đại Dương. Idioscopus nitidulus được ghi nhận từ Papua New Guinea và Palau, loài này và Idioscopus clypealis được ghi nhận từ Úc.','Idioscopus nitidulus sinh sản ở hoa và lá mới, trong khi Idioscopus clypealis chỉ sinh sản ở hoa. Mỗi con cái đẻ từ 100-200 trứng đơn lẻ vào gân giữa ở mặt dưới của lá và / hoặc hoa.','Rầy xoài xuất hiện với số lượng lớn trên hoa và lá, gây thiệt hại cho cây trồng lên đến 50%. Những thiệt hại này xảy ra theo hai cách: (i) rầy lá ăn nhựa cây, chúng ăn và đẻ trứng làm cho hoa chuyển sang màu nâu và khô, làm giảm khả năng đậu trái và sản lượng; và (ii) khi chúng ăn, chúng tiết ra chất lỏng được gọi là \'honeydew\' dính; Honeydew lắng đọng trên lá và trái cây và trở thành khu trú của nấm mốc, làm cho lá chuyển sang màu đen và làm giảm khả năng quang hợp','Sử dụng pyrethroid tổng hợp hoặc dimethoate, nếu loại thuốc trừ sâu toàn thân được ưu tiên. Dimethoate có thể được phun hoặc tiêm vào thân cây. Ở Úc, khuyến cáo phun hai lần cách nhau 7 ngày trước khi bắt đầu ra hoa. Phun thuốc trước khi ra hoa làm giảm nguy cơ giết chết các loài thụ phấn. Ở Úc, dimethoate đã được xem xét từ giữa năm 2015. Nó không còn được phép sử dụng trong vườn nhà.','thumbnails/Mango_flat_beak_leafhopper.jpg',84,0,'Rầy xoài'),(100,'Cerambycinae','Rhytidodera bowrinii white','R. simulans','Rhytidodera bowrinii white','insect_Cerambycinae','Chiều dài thân 25-35 mm, rộng 5-8 mm, màu nâu đến nâu, thân dài và hẹp, hai bên song song. Ngực phía trước hẹp hơn phía sau. Pronotum có các gờ ngang ở đầu trước và sau , với 19 gờ dọc nổi lên ở giữa, và các rãnh ở đỉnh có nhiều lông màu vàng nhạt. Mặt cánh xù xì, có dải dài màu xám lông ngắn và lông tơ vàng, xếp xen kẽ 5 hàng dọc. Bề mặt bụng của cơ thể và bàn chân được bao phủ bởi nhiều lông màu xám hoặc màu nâu. Ấu trùng trưởng thành dài 46-63 mm, hình trụ, màu trắng sữa, có lông thưa màu nâu. Hàm trên có hình răng, màu đen. Hai bên mép trước của tấm đệm và tấm lưng có lông màu nâu, van lồng ngực nằm ở giữa ngực giữa và có hình bầu dục. Mặt sau của bụng tạo thành một lồi giống bong bóng với 2 rãnh ngang và 1 hàng nhú ở mặt trước và mặt sau của rãnh ngang. Mỗi hàng gồm 10-16 lồi. Các đoạn bụng thứ nhất đến thứ ba có đĩa bên, mặt trên của đoạn bụng thứ bảy đến thứ 9 có lồi rõ, hậu môn có 3 thùy. Nó dài 43-47 mm, lúc đầu màu trắng vàng, sau đó màu vàng nâu nhạt. Mắt kép có màu đen khi chúng nhô lên, và phần cuối của xương chày, thân mình và mặt bụng có màu đỏ đất.','','Quá đông có ấu trùng. Thời gian xuất hiện của người lớn thay đổi một chút giữa các khu vực. Ở Hải Nam , con trưởng thành xuất hiện vào tháng 3-7, tháng 4 đến tháng 6 là sự xuất hiện của đỉnh; ở Vân Nam , tháng 6-8 là đỉnh của sự xuất hiện của con trưởng thành. Con trưởng thành đẻ trứng vào cành, lá, cành gãy hoặc kẽ cây. Trứng được đẻ rời, chủ yếu tập trung một chỗ, có nhiều đến 6-8 trứng dính lại thành một cục, thời gian trứng khoảng 10 ngày. Sau khi nở, sâu non chủ yếu xâm nhập từ đầu cành và ngọn gỗ, từ cuối cành xuống theo hướng của thân chính, đến phân đôi và thường ăn hết một đoạn nhỏ của chạc rồi quay trở lại. thân chính, từ cành, đến thân và cả thân chính. Đường hầm có dạng hình trụ đơn giản với thành bên trong màu đen, ấu trùng có thể di chuyển lên xuống. Trên cành bị thương có các lỗ đại tiện đều đặn. Khi còn nhỏ, lỗ đại tiện nhỏ và dày đặc, khi tuổi côn trùng càng tăng thì lỗ đại tiện càng lớn, khoảng cách xa dần. Các lỗ trên cành nhỏ thải phân côn trùng dạng hạt và mùn cưa, phân lỏng và có màu trắng vàng; phân côn trùng trên cành lớn trộn với chất lỏng sền sệt màu đen và thải ra từ các lỗ phân, rơi xuống các lá phía dưới hoặc trên mặt đất, và cô đặc lại thành khối .','Một dấu hiệu quan trọng cho thấy sự hiện diện của giun. Đường hầm do ấu trùng gây ra như ở cành nhỏ thì kéo dài xuống tâm cành, nếu ở cành lớn thường bị sâu đục bởi dát gỗ, nếu cành nghiêng thì đường hầm và lỗ đại tiện thường ở phía dưới. ; nếu cành ở thân thẳng đứng, nó có thể bị côn trùng phá hại theo mọi hướng. Dù hướng hầm lên cành nào thì hầm đại tiện phải nghiêng xuống dưới để thuận tiện cho việc đại tiện và ngăn nước mưa xâm nhập. Giai đoạn sâu non là 260-310 ngày. Ấu trùng trưởng thành già xây dựng một buồng nhộng trong đường hầm dài 7-10 cm và rộng hơn một chút so với đường hầm chung, hai đầu của buồng nhộng thường được ngăn cách bởi chất tiết màu trắng có chứa canxi cacbonat. Thời kỳ nhộng 30-50 ngày. Sau khi xuất hiện, con trưởng thành ở trong buồng nhộng một thời gian (10 - 30 ngày), sau đó mở rộng lỗ đại tiện để bò ra ngoài. Nó thường hoạt động vào ban đêm và có hiện tượng quang điều hòa. Ẩn mình trong những tán lá rậm rạp vào ban ngày. Giao phối xảy ra vào lúc 9-10 giờ đêm hôm đó, và những con cái giao phối bắt đầu đẻ trứng trong vòng vài phút sau khi những con đực rời đi. Mỗi con sâu cái đẻ từ 6-25 trứng, thời gian trưởng thành là 13-36 ngày.','① Loại bỏ những cành sâu bệnh. Từ tháng 7 hàng năm tiến hành kiểm tra cây xoài lần lượt, phát hiện cành bị cắt sâu 15cm dưới hố đào cuối cùng để loại bỏ cành sâu bệnh, kiểm tra phần trên của vết cắt xem có vết côn trùng hay không, nếu có thì dùng máy dây để đâm những con còn lại. ấu trùng.\n② có các nhánh lớn của ấu trùng , 80% ống tiêm có sẵn dichlorvos hoặc EC 38% clo lỏng ngựa đến lỗ đại tiện cuối cùng.\n③ Đối với những cây bị sâu bệnh phá tán, sau khi thu hoạch tỉa bỏ bớt cành già yếu, sâu bệnh, chỉ để lại cành xương chính, đồng thời tăng cường quản lý, tăng cường bón phân hữu cơ. thúc đẩy sự hình thành của các chi nhánh mới.','thumbnails/Rhytidodera_bowrinii_white.jpg',85,0,'Bọ cắt lá'),(101,'Sternochetus frigidus','Sternochetus frigidus','Sternochetus frigidus','Sternochetus frigidus','insect_Sternochetus_frigidus','Con trưởng thành của mọt cùi là một loài côn trùng nhỏ thân cứng. Đó là các mảng màu đen, mọc trên elytra và chân. Con cái đẻ trứng đơn lẻ trên quả xoài non. Trứng có màu trắng đục và chuyển sang màu vàng nhạt. Con cái sau đó bao phủ trứng bằng dịch tiết dính màu đen, sau đó chuyển thành màu nâu, khô và cứng như nút trứng.','Philippines, USA, Japan, Hongkong, Canada and China','Nút trứng này đóng vai trò bảo vệ bằng cách giữ trứng ở đúng vị trí. Trứng dài 0,4 mm, rộng 0,5 mm và nở trong 9,3 ngày. Cuối cùng, ấu trùng sơ sinh xâm nhập vào trái xoài non bằng cách đục qua lớp vỏ mềm, thích vùng gần hạt hơn gây ra hiện tượng sẫm màu của các mô bị ảnh hưởng (Catindig và Kong, 2005).','Trong mùa đậu quả, con trưởng thành ăn những trái đang phát triển bằng cách tạo những vết thủng rất nhỏ trên vỏ. Tuy nhiên, ấu trùng phá hại mạnh nhất vì chúng ăn và phát triển trên cùi. Đuông chỉ ăn xoài bất kể loại nào (De Jesus, et al., 2005). Rất khó phát hiện sự xâm nhập của dịch hại vì không thể nhìn thấy những thiệt hại mà chúng gây ra từ bên ngoài. Đến khi quả được thu hoạch, những lỗ xâm nhập nhỏ xíu do ấu trùng tạo ra sẽ không thể phát hiện được nữa. Trong trường hợp không có trái xoài, người ta phát hiện thấy mọt trưởng thành ăn hoa hoặc bông hoa ở giai đoạn nở rộ với hoạt động cao nhất được quan sát vào lúc 0600-1000h','','thumbnails/Sternochetus_frigidus.jpg',86,0,NULL),(102,'Cicadellidae','Cicadellidae','','Cicadellidae','insect_Cicadellidae','Phần râu dày lên rất ngắn và kết thúc bằng một sợi lông tơ (Arista).\n\nHai mắt ocelli (mắt đơn giản) hiện diện trên đỉnh hoặc phía trước của đầu.\n\nCác tarsi được làm bằng ba phân đoạn.\n\nCác xương cái ở phía trước, nhiều nhất là các gai yếu.\n\nXương chày sau có một hoặc nhiều mỏm nhọn riêng biệt, với một hàng gai có thể di chuyển được trên mỗi xương, đôi khi trên các mấu mở rộng.\n\nPhần gốc của các chân giữa gần nhau nơi chúng bắt nguồn dưới lồng ngực.\n\nCác cánh trước không đặc biệt dày.','trên toàn thế giới; ở Bắc Mỹ, một số loài di cư về phía nam vào mùa thu, và trở lại phía bắc vào mùa xuân','thay đổi tùy theo loài; Nói chung, con cái chèn một số trứng vào mô sống của cây ký chủ; trứng hoặc ở trạng thái không hoạt động trong khoảng thời gian từ một tháng đến hơn một năm, hoặc phát triển và nở trong vòng vài tuần; nhộng trải qua năm lần lột xác, đạt đến giai đoạn trưởng thành trong vài tuần hoặc vài tháng','Con cái sẽ khoét lỗ theo gân lá hoặc cuống lá để đẻ trứng vào trong đó, đời sống của rầy lá kéo dài khoảng 40 đến 45 ngày, tuỳ thuộc vào điều kiện khí hậu. Ngoài ra còn có loại rầy lá ở củ cải đường tên khoa học Circulifer tenellus gây nên bệnh cuống lá cà, vi khuẩn nầy nhiễm và truyền bệnh đi liên tục ở mọi lứa tuổi và bệnh cuống lá cà không lây nhiểm hay truyền bệnh.','Vệ sinh đồng ruộng, thu gom, tiêu hủy tàn dư, làm sạch trước khi gieo trồng, dùng màng phủ, nông nghiệp, để phủ đất.','thumbnails/Cicadellidae.jpg',NULL,0,NULL);
